INSERT INTO animes VALUES(1,'Crest\ of\ the\ Stars','\星\界\の\紋\章','Nagaoka\ Yasuchika',1999,8.17,'http://img7.anidb.net/pics/anime/440.jpg','\*\ Based\ on\ the\ sci\-fi\ novel\ series\ by\ http\:\/\/anidb\.net\/cr4495\ \[Morioka\ Hiroyuki\]\.\\nhttp\:\/\/anidb\.net\/ch4081\ \[Linn\ Jinto\]\`s\ life\ changes\ forever\ when\ the\ http\:\/\/anidb\.net\/ch7514\ \[Humankind\ Empire\ Abh\]\ takes\ over\ his\ home\ planet\ of\ Martine\ without\ firing\ a\ single\ shot\.\ He\ is\ soon\ sent\ off\ to\ study\ the\ http\:\/\/anidb\.net\/t2324\ \[Abh\]\ language\ and\ culture\ and\ to\ prepare\ himself\ for\ his\ future\ as\ a\ nobleman\ \—\ a\ future\ he\ never\ dreamed\ of\,\ asked\ for\,\ or\ even\ wanted\.\\nNow\,\ Jinto\ is\ entering\ the\ next\ phase\ of\ his\ training\,\ and\ he\ is\ about\ to\ meet\ the\ first\ Abh\ in\ his\ life\,\ the\ lovely\ http\:\/\/anidb\.net\/ch28\ \[Lafiel\]\.\ However\,\ Jinto\ is\ about\ to\ learn\ that\ there\ is\ more\ to\ her\ than\ meets\ the\ eye\,\ and\ together\ they\ will\ have\ to\ fight\ for\ their\ very\ lives\.');
INSERT INTO animes VALUES(2,'Girls\ und\ Panzer\ der\ Film','\ガ\ー\ル\ズ\&\パ\ン\ツ\ァ\ー\ \劇\場\版','Mizushima\ Tsutomu',2015,8.48,'http://img7.anidb.net/pics/anime/178754.jpg','Despite\ winning\ the\ 63rd\ annual\ high\ school\ Sensha\-do\ tournament\,\ the\ Japanese\ Ministry\ of\ Education\ decides\ to\ move\ forward\ with\ its\ plan\ to\ decommission\ Ooarai\ Girls\ High\ School\.\ In\ order\ to\ keep\ the\ school\ open\,\ Miho\ and\ her\ team\ must\ win\ an\ elimination\ match\ against\ Japan\`s\ university\ Sensha\-do\ team\.\\nHow\ will\ Ooarai\ be\ able\ to\ face\ such\ an\ opponent\?\ For\ this\ difficult\ battle\,\ all\ of\ the\ other\ high\ school\ teams\,\ both\ Miho\`s\ former\ competitors\ and\ new\ friends\ Chihatan\ Academy\ and\ Keizoku\ High\ School\,\ join\ forces\ with\ Miho\ to\ help\ save\ Ooarai\ from\ closure\.\\n\—\ written\ by\ CDB\-Man');
INSERT INTO animes VALUES(3,'Barakamon','\ば\ら\か\も\ん','Tachibana\ Masaki',2014,8.32,'http://img7.anidb.net/pics/anime/152034.jpg','\*\ Based\ on\ the\ manga\ series\ by\ http\:\/\/anidb\.net\/cr38972\ \[Yoshino\ Satsuki\]\ by\ the\ same\ name\.\\nCalligrapher\ http\:\/\/anidb\.net\/ch64663\ \[Handa\ Seishuu\]\ moves\ to\ the\ remote\ Gotou\ Islands\ off\ the\ western\ coast\ of\ Kyushu\,\ interacting\ with\ various\ people\ from\ the\ island\.\\nNote\:\ The\ first\ two\ episodes\ were\ shown\ at\ an\ advance\ screening\ event\ on\ June\ 29\ that\ was\ held\ in\ Tokyo\ and\ the\ Goto\ Islands\,\ where\ the\ story\ takes\ place\.\ The\ regular\ broadcast\ started\ on\ 6th\ of\ July\.');
INSERT INTO animes VALUES(4,'Haikyu\!\!','\ハ\イ\キ\ュ\ー\!\!','Mitsunaka\ Susumu',2014,8.13,'http://img7.anidb.net/pics/anime/152230.jpg','A\ chance\ event\ triggered\ http\:\/\/anidb\.net\/ch60471\ \[Hinata\ Shouyou\]\`s\ love\ for\ volleyball\.\ His\ club\ had\ no\ members\,\ but\ somehow\ persevered\ and\ finally\ made\ it\ into\ its\ very\ first\ and\ final\ regular\ match\ of\ middle\ school\,\ where\ it\ was\ steamrollered\ by\ http\:\/\/anidb\.net\/ch60470\ \[Kageyama\ Tobio\]\,\ a\ superstar\ player\ known\ as\ the\ King\ of\ the\ Court\.\ Vowing\ revenge\,\ Shouyou\ applied\ to\ the\ Karasuno\ High\ School\ volleyball\ club\.\.\.\ only\ to\ come\ face\-to\-face\ with\ his\ hated\ rival\,\ Tobio\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(5,'Stand\ By\ Me\ Doraemon','STAND\ BY\ ME\ \ド\ラ\え\も\ん','Yagi\ Ryuuichi',2014,8.19,'http://img7.anidb.net/pics/anime/145840.jpg','http\:\/\/anidb\.net\/ch8465\ \[Nobi\ Nobita\]\ is\ a\ fourth\ grader\ who\ constantly\ gets\ failing\ grades\ in\ his\ subjects\ due\ to\ his\ laziness\ and\ is\ always\ bullied\ by\ his\ classmates\ http\:\/\/anidb\.net\/ch8553\ \[Honekawa\ Suneo\]\ and\ http\:\/\/anidb\.net\/ch8549\ \[Gouda\ Takeshi\]\.\ His\ great\-great\ grandson\ from\ the\ 22nd\ century\,\ http\:\/\/anidb\.net\/ch76800\ \[Sewashi\]\,\ who\ watches\ him\ every\ day\,\ travels\ to\ Nobita\`s\ timeline\ while\ bringing\ along\ his\ robotic\ cat\ http\:\/\/anidb\.net\/ch8456\ \[Doraemon\]\.\ Sewashi\ reveals\ that\ if\ Nobita\ keeps\ up\ his\ act\,\ he\ will\ have\ a\ disastrous\ future\:\ he\ will\ marry\ Takeshi\`s\ sister\ Jaiko\,\ have\ his\ private\ company\ burned\ down\,\ and\ will\ be\ left\ with\ a\ great\ debt\.\ To\ circumvent\ this\,\ he\ orders\ Doraemon\ to\ help\ Nobita\ and\ activates\ a\ program\ to\ prevent\ Doraemon\ from\ returning\ to\ the\ 22nd\ century\ unless\ Nobita\ gains\ a\ better\ future\.\\nSource\:\ Wikipedia');
INSERT INTO animes VALUES(6,'Parasyte\:\ The\ Maxim','\寄\生\獣\ \セ\イ\の\格\率','Shimizu\ Ken\`ichi',2014,8.42,'http://img7.anidb.net/pics/anime/158798.jpg','\*\ Based\ on\ http\:\/\/anidb\.net\/cr39200\ \[Iwaaki\ Hitoshi\]\`s\ science\-fiction\ horror\ manga\ by\ the\ same\ name\.\\n17\-year\-old\ http\:\/\/anidb\.net\/ch68919\ \[Izumi\ Shin\`ichi\]\ lives\ with\ his\ http\:\/\/anidb\.net\/ch70244\ \[mother\]\ and\ http\:\/\/anidb\.net\/ch70245\ \[father\]\ in\ a\ quiet\ neighborhood\ in\ Tokyo\.\ One\ night\,\ worm\-like\ parasitic\ aliens\ invade\ Earth\,\ taking\ over\ the\ brains\ of\ human\ hosts\ by\ entering\ through\ their\ ears\ or\ noses\.\ One\ such\ parasite\ attempts\ to\ crawl\ into\ Shinichi\`s\ ear\ while\ he\ sleeps\,\ but\ fails\ since\ he\ is\ wearing\ headphones\;\ it\ enters\ his\ body\ by\ burrowing\ into\ his\ arm\ instead\,\ taking\ over\ his\ right\ hand\ and\ eventually\ receiving\ the\ name\ http\:\/\/anidb\.net\/ch68917\ \[Migi\]\ from\ him\.\\nBecause\ Migi\ matured\ in\ Shin\`ichi\`s\ hand\,\ it\ wasn\`t\ able\ to\ travel\ further\ up\ into\ his\ brain\,\ and\ as\ such\ both\ beings\ retain\ their\ separate\ intellect\ and\ personality\.\ As\ they\ encounter\ other\ hosts\ to\ these\ parasites\,\ they\ capitalize\ on\ their\ strange\ situation\ and\ gradually\ form\ a\ strong\ bond\,\ working\ together\ to\ survive\.\ This\ gives\ them\ an\ edge\ in\ battling\ the\ other\ aliens\,\ who\ have\ taken\ over\ their\ human\ hosts\`\ brains\ and\ attack\ the\ pair\ upon\ realizing\ that\ Shin\`ichi\`s\ human\ brain\ is\ still\ intact\.\ Shin\`ichi\ feels\ compelled\ to\ fight\ the\ other\ parasites\,\ who\ devour\ humans\ as\ food\,\ and\ he\ enlists\ Migi\`s\ help\ to\ that\ end\.\\nSource\:\ Wikipedia');
INSERT INTO animes VALUES(7,'Mushishi\ Tokubetsu\-hen\ \-\ Hihamukage','\蟲\師\ \特\別\篇\ \日\蝕\む\翳','Nagahama\ Hiroshi',2014,9.21,'http://img7.anidb.net/pics/anime/146131.jpg','Perceived\ as\ strange\ and\ alien\,\ inferior\ and\ grotesque\.\ These\ are\ beings\ that\ appear\ entirely\ unlike\ flora\ and\ fauna\ familiar\ to\ us\.\ Since\ time\ immemorial\,\ man\ has\ feared\ the\ misshappen\ ones\.\ Over\ time\,\ they\ came\ to\ be\ know\ as\ Mushi\.\ \—\ from\ intro\\nWhen\ an\ eclipse\ occurs\,\ the\ sun\ remains\ dark\ in\ one\ area\.\ The\ Mushi\ expert\ http\:\/\/anidb\.net\/ch1800\ \[Ginko\]\ must\ come\ and\ determine\ how\ to\ return\ the\ sun\ to\ the\ village\ before\ their\ crops\ die\.\ The\ secret\ seems\ connected\ to\ twin\ girls\ who\ live\ nearby\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(8,'When\ Marnie\ Was\ There','\思\い\出\の\マ\ー\ニ\ー','Yonebayashi\ Hiromasa',2014,8.69,'http://img7.anidb.net/pics/anime/166516.jpg','\*\ Based\ on\ http\:\/\/anidb\.net\/cr38899\ \[Joan\ G\.\ Robinson\]\`s\ novel\ When\ Marnie\ Was\ There\ \(Omoide\ no\ Marnie\)\.\\nhttp\:\/\/anidb\.net\/ch66694\ \[Anna\]\ lives\ with\ foster\ parents\,\ a\ misfit\ with\ no\ friends\,\ always\ on\ the\ outside\ of\ things\.\ Then\ she\ is\ sent\ to\ Norfolk\ to\ stay\ with\ old\ Mr\ and\ Mrs\ Pegg\,\ where\ she\ runs\ wild\ on\ the\ sand\ dunes\ and\ around\ the\ water\.\ There\ is\ a\ house\,\ the\ Marsh\ House\,\ which\ she\ feels\ she\ recognizes\ \—\ and\ she\ soon\ meets\ a\ strange\ little\ girl\ called\ http\:\/\/anidb\.net\/ch62275\ \[Marnie\]\,\ who\ becomes\ Anna\`s\ first\ ever\ friend\.\ Then\ one\ day\,\ Marnie\ vanishes\.\\nA\ new\ family\,\ the\ Lindsays\,\ move\ into\ the\ Marsh\ House\.\ Having\ learnt\ so\ much\ from\ Marnie\ about\ friendship\,\ Anna\ makes\ firm\ friends\ with\ the\ Lindsays\ \—\ and\ learns\ some\ strange\ truths\ about\ Marnie\,\ who\ was\ not\ all\ she\ seemed\.\.\.\\nSource\:\ Wikipedia');
INSERT INTO animes VALUES(9,'Mushi\-Shi\:\ Next\ Passage','\蟲\師\ \続\章','Nagahama\ Hiroshi',2014,9.43,'http://img7.anidb.net/pics/anime/152364.jpg','Perceived\ as\ strange\ and\ alien\,\ inferior\ and\ grotesque\.\ These\ are\ beings\ that\ appear\ entirely\ unlike\ flora\ and\ fauna\ familiar\ to\ us\.\ Since\ time\ immemorial\,\ man\ has\ feared\ the\ misshapen\ ones\.\ Over\ time\,\ they\ came\ to\ be\ know\ as\ Mushi\.\\nThe\ appearance\ of\ Mushi\ can\ cause\ grave\ harm\ to\ humans\,\ and\ only\ a\ select\ few\ humans\ know\ of\ their\ existence\ and\ can\ see\ them\.\ http\:\/\/anidb\.net\/ch1800\ \[Ginko\]\,\ a\ Mushi\-shi\,\ travels\ the\ land\ to\ investigate\ the\ Mushi\.\ But\ his\ special\ ability\ comes\ at\ a\ price\:\ he\ cannot\ stay\ at\ any\ place\ for\ too\ long\,\ or\ the\ Mushi\ will\ congregate\ there\,\ endangering\ those\ close\ to\ him\.\ So\,\ the\ gentle\ and\ wise\ man\ must\ keep\ on\ travelling\,\ trying\ to\ resolve\ Mushi\-related\ supernatural\ occurrences\.\\n\—\ written\ by\ foo2');
INSERT INTO animes VALUES(10,'Ping\ Pong\ the\ Animation','\ピ\ン\ポ\ン\ THE\ ANIMATION','Yuasa\ Masaaki',2014,8.9,'http://img7.anidb.net/pics/anime/148607.jpg','Two\ long\-time\ friends\ http\:\/\/anidb\.net\/ch65254\ \[Smile\]\ and\ http\:\/\/anidb\.net\/ch65253\ \[Peco\]\ are\ both\ members\ of\ the\ ping\ pong\ club\ at\ their\ high\ school\ and\ are\ both\ very\ talented\ at\ the\ sport\.\ However\,\ Smile\`s\ quiet\ personality\ keeps\ him\ from\ being\ able\ to\ win\ against\ Peco\.\ The\ club\`s\ teacher\ takes\ notice\ of\ Smile\`s\ talent\ and\ works\ to\ change\ his\ attitude\ toward\ the\ sport\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(11,'Yorinuke\ Gintama','\よ\り\ぬ\き\銀\魂\さ\ん\オ\ン\シ\ア\タ\ー2D','',2012,8.85,'http://img7.anidb.net/pics/anime/148761.jpg','Note\:\ Movie\ version\ of\ the\ Shinsengumi\ Crisis\ arc\ \(episodes\ 101\-105\)\ and\ the\ Kabukicho\ Four\ Devas\ arc\ \(episodes\ 210\-214\)\ which\ were\ screened\ in\ selected\ theaters\ in\ Japan\.\\nSource\:\ MAL');
INSERT INTO animes VALUES(12,'Natsume\ Yuujinchou\:\ Itsuka\ Yuki\ no\ Hi\ ni','\夏\目\友\人\帳\ \い\つ\か\ゆ\き\の\ひ\に','',2014,8.26,'http://img7.anidb.net/pics/anime/143625.jpg','During\ a\ winter\ walk\,\ http\:\/\/anidb\.net\/ch1806\ \[Natsume\ Takashi\]\ meets\ a\ snowman\ yokai\ who\ is\ searching\ for\ something\ she\ is\ lost\ and\ cannot\ seem\ to\ recall\ and\ decides\ to\ help\ her\ despite\ not\ knowing\ what\ exactly\ she\ is\ looking\ for\.');
INSERT INTO animes VALUES(13,'Lupin\ the\ Third\:\ Jigen\`s\ Gravestone','LUPIN\ THE\ IIIRD\ \次\元\大\介\の\墓\標','Koike\ Takeshi',2014,8.58,'http://img7.anidb.net/pics/anime/160241.jpg','http\:\/\/anidb\.net\/ch7622\ \[Lupin\]\ and\ http\:\/\/anidb\.net\/ch7976\ \[Jigen\]\ have\ their\ sights\ set\ on\ a\ treasure\ worth\ stealing\ called\ the\ Little\ Comet\ which\ is\ located\ in\ the\ country\ of\ East\ Doroa\.\ The\ country\ has\ fortified\ its\ border\ after\ a\ singer\ named\ http\:\/\/anidb\.net\/ch69715\ \[Queen\ Malta\]\ got\ assassinated\ in\ the\ neighboring\ country\ of\ West\ Doroa\ upon\ visit\.\\nDespite\ the\ two\ countries\ being\ enemies\,\ Lupin\ and\ Jigen\ still\ plan\ to\ steal\ the\ treasure\.\ During\ the\ heist\,\ Jigen\ gets\ almost\ killed\ by\ a\ skilled\ sniper\ named\ http\:\/\/anidb\.net\/ch69716\ \[Yael\ Okuzaki\]\.\ His\ specialty\ is\ preparing\ tombstones\ for\ his\ targets\ before\ executing\ his\ kills\.\ It\`s\ said\ that\ no\ one\ has\ survived\ after\ Yael\ makes\ a\ grave\ for\ that\ target\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(14,'Your\ Lie\ in\ April','\四\月\は\君\の\嘘','Ishiguro\ Kyouhei',2014,8.55,'http://img7.anidb.net/pics/anime/158192.jpg','\*\ Based\ on\ http\:\/\/anidb\.net\/cr39666\ \[Arakawa\ Naoshi\]\`s\ manga\ by\ the\ same\ name\.\\nhttp\:\/\/anidb\.net\/ch67240\ \[Arima\ Kousei\]\ is\ a\ former\ child\ prodigy\ who\ lost\ his\ ability\ to\ play\ the\ piano\ when\ his\ mother\ died\.\ His\ daily\ life\ is\ monochrome\,\ but\ it\ begins\ to\ gain\ colour\ when\ he\ meets\ a\ female\ violinist\ by\ chance\.\ http\:\/\/anidb\.net\/ch65811\ \[Miyazono\ Kaori\]\ is\ an\ audacious\ go\-getter\ who\ is\ overflowing\ with\ personality\.\ Enchanted\ by\ the\ girl\,\ Kousei\ starts\ to\ move\ forward\ with\ his\ own\ legs\ at\ the\ age\ of\ 14\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(15,'Mushishi\ Zoku\ Shou\ 2','\蟲\師\ \続\章\ \(2014\)','Nagahama\ Hiroshi',2014,9.64,'http://img7.anidb.net/pics/anime/157350.jpg','Perceived\ as\ strange\ and\ alien\,\ inferior\ and\ grotesque\.\ These\ are\ beings\ that\ appear\ entirely\ unlike\ flora\ and\ fauna\ familiar\ to\ us\.\ Since\ time\ immemorial\,\ man\ has\ feared\ the\ misshapen\ ones\.\ Over\ time\,\ they\ came\ to\ be\ know\ as\ Mushi\.\\nThe\ appearance\ of\ Mushi\ can\ cause\ grave\ harm\ to\ humans\,\ and\ only\ a\ select\ few\ humans\ know\ of\ their\ existence\ and\ can\ see\ them\.\ http\:\/\/anidb\.net\/ch1800\ \[Ginko\]\,\ a\ Mushi\-shi\,\ travels\ the\ land\ to\ investigate\ the\ Mushi\.\ But\ his\ special\ ability\ comes\ at\ a\ price\:\ he\ cannot\ stay\ at\ any\ place\ for\ too\ long\,\ or\ the\ Mushi\ will\ congregate\ there\,\ endangering\ those\ close\ to\ him\.\ So\,\ the\ gentle\ and\ wise\ man\ must\ keep\ on\ travelling\,\ trying\ to\ resolve\ Mushi\-related\ supernatural\ occurrences\.\\n\—\ written\ by\ foo2');
INSERT INTO animes VALUES(16,'Fate\/stay\ night\ \[Unlimited\ Blade\ Works\]\ \(2015\)','Fate\/stay\ night\ \[Unlimited\ Blade\ Works\]\ \(2015\)','Miura\ Takahiro',2015,8.31,'http://img7.anidb.net/pics/anime/170473.jpg','\*\ Based\ on\ the\ second\ route\ of\ the\ Fate\/Stay\ Night\ erotic\ visual\ novel\ by\ http\:\/\/anidb\.net\/cr927\ \[Type\-Moon\]\.\\nNow\ that\ http\:\/\/anidb\.net\/ch1910\ \[Caster\]\ has\ become\ the\ most\ difficult\ contender\ among\ the\ six\ remaining\ Servants\ from\ those\ summoned\ into\ the\ 5th\ Holy\ Grail\ War\,\ allied\ Masters\ http\:\/\/anidb\.net\/ch1904\ \[Emiya\ Shirou\]\ and\ http\:\/\/anidb\.net\/ch241\ \[Toosaka\ Rin\]\ face\ a\ dire\ situation\.\ Desperate\ for\ a\ way\ to\ fortify\ their\ position\,\ and\ with\ their\ backs\ against\ the\ wall\,\ they\ seek\ to\ forge\ a\ temporary\ alliance\ with\ http\:\/\/anidb\.net\/ch1913\ \[Illyasviel\ von\ Einzbern\]\,\ someone\ they\ would\ previously\ never\ consider\ allying\ with\.\ Meanwhile\,\ however\,\ http\:\/\/anidb\.net\/ch1914\ \[Matou\ Shinji\]\ has\ not\ forfeited\ his\ rights\ as\ a\ Master\ simply\ because\ he\ lost\ http\:\/\/anidb\.net\/ch1909\ \[Rider\]\,\ and\ has\ since\ forged\ a\ contract\ with\ http\:\/\/anidb\.net\/ch1912\ \[another\ Servant\]\;\ like\ Shirou\ and\ Rin\,\ this\ Servant\,\ who\ isn\`t\ one\ to\ wait\ for\ his\ Master\ to\ order\ him\ around\,\ also\ holds\ a\ direct\ interest\ in\ http\:\/\/anidb\.net\/ch1907\ \[Berserker\]\`s\ Master\,\ albeit\ for\ different\ reasons\.\ In\ this\ permanently\ chaotic\ power\ rearrangement\,\ in\ this\ fragile\,\ easily\ shifting\ power\ balance\,\ a\ shadow\ of\ betrayal\ constantly\ looms\ above\,\ and\ trust\ is\ not\ to\ be\ found\;\ alliances\ and\ contracts\ are\ easily\ broken\,\ those\ who\ are\ swayed\ one\ way\ by\ the\ circumstances\ may\ well\ be\ swayed\ another\ way\ later\,\ and\ those\ who\ find\ new\ pawns\ for\ themselves\ must\ be\ wary\ of\ becoming\ pawns\ themselves\,\ perhaps\ even\ of\ their\ own\ pawns\.\\n\—\ written\ by\ Hinoe\\nNote\:\ Episode\ 1\ \(13\)\ received\ a\ special\ advance\ screening\ on\ March\ 14\,\ 2015\.\ Episodes\ 2\-3\ \(14\-15\)\ received\ a\ special\ advance\ screening\ on\ March\ 28\,\ 2015\.\ The\ official\ airing\ began\ on\ April\ 5\,\ 2015\.');
INSERT INTO animes VALUES(17,'Shirobako','SHIROBAKO','Mizushima\ Tsutomu',2014,8.5,'http://img7.anidb.net/pics/anime/162539.jpg','http\:\/\/anidb\.net\/ch69459\ \[Miyamori\ Aoi\]\ and\ her\ high\ school\ animation\ club\ friends\ share\ a\ dream\ they\ all\ pledge\ to\ turn\ into\ reality\:\ getting\ jobs\ in\ the\ anime\ industry\ and\ eventually\ coming\ together\ once\ more\ to\ create\ a\ professional\ anime\ they\ can\ be\ proud\ of\.\ To\ that\ end\,\ their\ first\ step\ is\ the\ production\ of\ their\ club\`s\ very\ own\ amateur\ anime\,\ which\ gets\ screened\ during\ the\ school\`s\ cultural\ festival\.\\nTwo\ and\ a\ half\ years\ later\,\ Aoi\ has\ a\ production\ assistant\ job\ at\ http\:\/\/anidb\.net\/ch70860\ \[Musashino\ Animation\]\,\ or\ Musani\ for\ short\,\ a\ once\ relevant\ animation\ company\ that\ fell\ from\ grace\ and\ is\ now\ making\ its\ first\ anime\ in\ many\ years\.\ Animator\ http\:\/\/anidb\.net\/ch69458\ \[Yasuhara\ Ema\]\,\ one\ of\ Aoi\`s\ clubmates\,\ has\ also\ landed\ a\ job\ at\ Musani\,\ where\ she\ is\ a\ keyframer\.\ They\ find\,\ however\,\ that\ creating\ anime\ professionally\ is\ far\ more\ demanding\ than\ they\ had\ thought\ when\ they\ were\ still\ high\ schoolers\,\ and\ Exodus\!\,\ the\ anime\ they\`re\ working\ on\,\ shoulders\ a\ responsibility\ that\ leaves\ no\ room\ for\ issues\.\\nMeanwhile\,\ their\ friends\ from\ the\ club\ days\ also\ struggle\ in\ their\ own\ ways\:\ http\:\/\/anidb\.net\/ch69460\ \[Toudou\ Misa\]\ is\ a\ CG\ artist\ with\ a\ job\ that\ consists\ of\ drawing\ car\ parts\ only\,\ http\:\/\/anidb\.net\/ch69457\ \[Sakaki\ Shizuka\]\ has\ studied\ to\ be\ a\ seiyuu\ but\ is\ still\ only\ trying\ hard\ to\ land\ anything\ better\ than\ walk\-on\ parts\ while\ juggling\ a\ waitress\ part\-time\ job\,\ and\ http\:\/\/anidb\.net\/ch69456\ \[Imai\ Midori\]\,\ who\ wishes\ to\ be\ a\ scriptwriter\,\ is\ still\ a\ student\ and\ hasn\`t\ even\ begun\ to\ walk\ the\ path\ towards\ an\ industry\ job\ yet\.\\nIn\ an\ industry\ where\ the\ budget\ is\ small\,\ the\ schedule\ is\ constrained\,\ people\ overwork\ themselves\ to\ meet\ absurd\ deadlines\,\ and\ something\ is\ always\ ready\ to\ come\ out\ of\ left\ field\ and\ wreak\ havoc\ on\ what\ little\ order\ there\ was\,\ those\ five\ friends\ fight\ on\ towards\ their\ dream\.\ Whether\ this\ dream\ was\ just\ a\ fleeting\ teenage\ passion\ that\ will\ get\ hammered\ by\ reality\ or\ whether\ they\ will\ be\ able\ to\ pursue\ it\ while\ adapting\ to\ the\ difficulties\ remains\ to\ be\ seen\,\ but\ one\ thing\ is\ certain\:\ Exodus\!\ has\ many\ issues\ that\ seem\ impossible\ to\ solve\,\ but\ Aoi\ still\ needs\ to\ solve\ a\ number\ of\ them\,\ and\ soon\,\ because\ the\ airing\ of\ the\ anime\ she\`s\ working\ on\ depends\ on\ it\!\\n\—\ written\ by\ Hinoe');
INSERT INTO animes VALUES(18,'JoJo\`s\ Bizarre\ Adventure\:\ Stardust\ Crusaders\ \-\ Battle\ in\ Egypt','\ジ\ョ\ジ\ョ\の\奇\妙\な\冒\険\ \ス\タ\ー\ダ\ス\ト\ク\ル\セ\イ\ダ\ー\ス\ \(2015\)','Suzuki\ Ken\`ichi',2015,8.18,'http://img7.anidb.net/pics/anime/166194.jpg','Continuation\ of\ the\ http\:\/\/anidb\.net\/a10206\ \[first\ half\]\ of\ Stardust\ Crusaders\.\\nhttp\:\/\/anidb\.net\/ch894\ \[Joutarou\]\,\ http\:\/\/anidb\.net\/ch1742\ \[Joseph\]\,\ http\:\/\/anidb\.net\/ch1722\ \[Avdol\]\,\ http\:\/\/anidb\.net\/ch1732\ \[Kakyouin\]\ \&\ http\:\/\/anidb\.net\/ch1725\ \[Polnareff\]\ have\ finally\ made\ it\ to\ Egypt\ in\ their\ quest\ to\ find\ and\ vanquish\ their\ sworn\ enemy\,\ http\:\/\/anidb\.net\/ch895\ \[DIO\]\.\ On\ their\ arrival\ to\ Egypt\,\ they\ are\ joined\ by\ a\ new\ but\ unwilling\ ally\,\ http\:\/\/anidb\.net\/ch1739\ \[Iggy\]\,\ who\ possesses\ the\ http\:\/\/anidb\.net\/t133\ \[Stand\]\,\ http\:\/\/anidb\.net\/ch1741\ \[The\ Fool\]\.\ The\ crusaders\ are\ then\ informed\ that\ after\ they\ defeated\ all\ fourteen\ of\ DIO\`s\ minions\ of\ the\ Tarot\,\ nine\ more\ minions\ of\ the\ Egyptian\ Tarot\ have\ been\ dispatched\ by\ DIO\ to\ eliminate\ them\.\ The\ crusaders\ continue\ their\ journey\ in\ Egypt\ to\ find\ DIO\ and\ confront\ the\ almighty\ Stand\,\ http\:\/\/anidb\.net\/ch1721\ \[The\ World\]\.');
INSERT INTO animes VALUES(19,'Lupin\ the\ 3rd\ Part\ 4','\ル\パ\ン\三\世\ LUPIN\ THE\ THIRD','Yano\ Yuuichirou',2015,8.43,'http://img7.anidb.net/pics/anime/175729.jpg','Infamous\ master\ thief\ http\:\/\/anidb\.net\/ch7622\ \[Lupin\ Sansei\]\ is\ back\ once\ again\ to\ do\ some\ grand\ thievery\,\ now\ in\ San\ Marino\,\ Italy\.\ Only\ this\ time\ he\`s\ stealing\.\.\.\ Love\?\ http\:\/\/anidb\.net\/ch75414\ \[Rebecca\ Rossellini\]\,\ a\ famous\ heiress\ and\ businesswoman\,\ is\ now\ married\ to\ Lupin\,\ much\ to\ the\ surprise\ of\ Lupin\`s\ gang\ who\ were\ invited\ to\ the\ wedding\,\ and\ Interpol\ Inspector\ http\:\/\/anidb\.net\/ch8460\ \[Zenigata\ Kouichi\]\,\ whom\ has\ not\ yet\ given\ up\ on\ catching\ Lupin\,\ and\ even\ went\ as\ far\ as\ to\ crash\ the\ wedding\ in\ order\ to\ give\ his\ objection\.\ But\ did\ Lupin\ really\ fall\ in\ love\ with\ a\ woman\ other\ than\ http\:\/\/anidb\.net\/ch8458\ \[Mine\ Fujiko\]\?\ Surely\ he\ must\ have\ something\ up\ his\ sleeve\,\ right\?\ That\`s\ what\ his\ right\-hand\ man\ http\:\/\/anidb\.net\/ch7976\ \[Jigen\ Daisuke\]\ believes\,\ and\ the\ swordsman\ http\:\/\/anidb\.net\/ch8474\ \[Ishikawa\ Goemon\]\ wants\ to\ believe\ this\ as\ well\.\\nOne\ thing\ is\ for\ certain\;\ He\ is\ not\ the\ only\ scheming\ thief\ in\ San\ Marino\.\ And\ not\ only\ that\,\ but\ it\ seems\ that\ a\ cunning\ MI6\ agent\,\ http\:\/\/anidb\.net\/ch77278\ \[Nyx\]\,\ is\ stationed\ here\ as\ well\.\ Just\ what\ exactly\ is\ in\ store\ for\ Lupin\ in\ his\ Italian\ adventure\?\\n\[i\]\—\ written\ by\ Mortsyn\\nNote\:\ Initially\ broadcasted\ in\ Italy\.\ The\ Japanese\ broadcast\ started\ on\ October\ 2nd\,\ 2015\,\ and\ concluded\ on\ March\ 18th\,\ 2016\.\\nEpisodes\ http\:\/\/anidb\.net\/e171135\ \[6\]\ and\ http\:\/\/anidb\.net\/e173129\ \[23\]\ were\ not\ a\ part\ of\ the\ TV\ broadcast\ in\ Japan\,\ airing\ only\ in\ Italy\.\ They\ were\ instead\ released\ exclusively\ on\ DVD\/BD\ and\ for\ streaming\ services\.\[\/i\]');
INSERT INTO animes VALUES(20,'A\ Silent\ Voice','\映\画\ \聲\の\形','Yamada\ Naoko',2016,8.38,'http://img7.anidb.net/pics/anime/188217.jpg','A\ deaf\ elementary\ school\ girl\,\ Nishimiya\ Shouko\,\ upon\ transferring\,\ meets\ a\ boy\ named\ Ishida\ Shouya\ in\ her\ new\ class\.\ Shouya\,\ who\ is\ not\ deaf\,\ leads\ the\ class\ in\ bullying\ Shouko\,\ because\ she\ is\ deaf\.\ As\ the\ bullying\ continues\,\ the\ class\ starts\ to\ bully\ Shouya\ for\ bullying\ Shouko\.\ After\ graduating\ from\ elementary\ school\,\ Shouko\ and\ Shouya\ do\ not\ speak\ to\ each\ other\.\ Until\ later\,\ when\ Shouya\,\ tormented\ over\ his\ past\,\ decides\ he\ must\ see\ Shouko\ once\ more\.\ Shouya\ wants\ to\ make\ amends\ for\ what\ he\ did\ in\ elementary\ school\ and\ be\ Shouko\`s\ friend\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(21,'The\ Anthem\ of\ the\ Heart','\心\が\叫\び\た\が\っ\て\る\ん\だ\.','Nagai\ Tatsuyuki',2015,8.34,'http://img7.anidb.net/pics/anime/176585.jpg','http\:\/\/anidb\.net\/ch73956\ \[Jun\]\ is\ a\ girl\ whose\ words\ have\ been\ sealed\ away\.\ She\ was\ once\ a\ happy\ girl\,\ but\ because\ of\ a\ certain\ thing\ she\ said\ when\ she\ was\ very\ young\,\ her\ family\ was\ torn\ apart\.\ One\ day\,\ the\ egg\ fairy\ appeared\ in\ front\ of\ her\ and\ sealed\ away\ her\ ability\ to\ talk\ in\ order\ to\ stop\ her\ from\ hurting\ anybody\ else\.\ Since\ this\ traumatic\ experience\,\ Jun\ lives\ in\ the\ shadows\ away\ from\ the\ limelight\.\ But\ one\ day\,\ she\ is\ nominated\ to\ become\ an\ executive\ member\ of\ the\ community\ outreach\ council\.\ On\ top\ of\ that\,\ Jun\ is\ also\ appointed\ to\ play\ the\ main\ lead\ in\ their\ musical\.\\nSource\:\ ANN\\nNote\:\ The\ movie\ had\ a\ preview\ showing\ on\ 10\.09\.2015\.\ The\ theatrical\ run\ started\ on\ 19\.09\.2015\.');
INSERT INTO animes VALUES(22,'Showa\ Genroku\ Rakugo\ Shinju','\昭\和\元\禄\落\語\心\中\ \(2016\)','Hatakeyama\ Mamoru',2016,8.96,'http://img7.anidb.net/pics/anime/179568.jpg','When\ a\ certain\ man\ is\ released\ from\ prison\,\ he\ knows\ exactly\ where\ he\`s\ heading\ first\.\ After\ falling\ in\ love\ with\ a\ traditional\ comic\ storyteller\`s\ rendition\ of\ the\ story\ called\ \"Shinigami\"\,\ he\ is\ determined\ to\ become\ his\ apprentice\.\ The\ performer\,\ http\:\/\/anidb\.net\/ch71872\ \[Yakumo\]\,\ has\ never\ taken\ an\ apprentice\ before\,\ but\ to\ everyone\`s\ surprise\,\ he\ accepts\ the\ eager\ ex\-prisoner\,\ nicknaming\ him\ http\:\/\/anidb\.net\/ch71871\ \[Yotarou\]\.\\nAs\ Yotarou\ happily\ begins\ his\ new\ life\,\ he\ meets\ others\ in\ Yakumo\`s\ life\,\ including\ Yakumo\`s\ ward\ http\:\/\/anidb\.net\/ch71873\ \[Konatsu\]\.\ Konatsu\ was\ the\ daughter\ of\ a\ famous\ storyteller\,\ and\ Yakumo\ took\ her\ in\ after\ her\ father\`s\ tragic\ death\.\ Konatsu\ loved\ her\ father\`s\ storytelling\,\ and\ would\ love\ to\ become\ a\ performer\ in\ her\ own\ right\,\ but\ that\ path\ is\ not\ available\ for\ women\.\\nSource\:\ MangaHelpers');
INSERT INTO animes VALUES(23,'The\ Boy\ and\ the\ Beast','\バ\ケ\モ\ノ\の\子','Hosoda\ Mamoru',2015,8.4,'http://img7.anidb.net/pics/anime/165791.jpg','The\ story\ of\ the\ film\ is\ set\ in\ the\ human\ realm\ \(Tokyo\`s\ Shibuya\ ward\)\ and\ the\ bakemono\ realm\ \(\"Juutengai\"\)\.\ In\ these\ two\ worlds\ which\ must\ not\ intersect\,\ there\ lives\ a\ lonely\ boy\ and\ a\ lonely\ bakemono\.\ One\ day\,\ the\ boy\ gets\ lost\ in\ the\ bakemono\ world\,\ becomes\ the\ disciple\ of\ the\ bakemono\ Kumatetsu\,\ and\ is\ renamed\ Kyuuta\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(24,'Haikyu\!\!\ 2nd\ Season','\ハ\イ\キ\ュ\ー\!\!\ \セ\カ\ン\ド\シ\ー\ズ\ン','Mitsunaka\ Susumu',2015,8.78,'http://img7.anidb.net/pics/anime/177031.jpg','Following\ their\ participation\ at\ the\ Inter\-High\,\ the\ Karasuno\ High\ School\ volleyball\ team\ attempts\ to\ refocus\ their\ efforts\,\ aiming\ to\ conquer\ the\ Spring\ tournament\ instead\.\\nWhen\ they\ receive\ an\ invitation\ from\ long\-standing\ rival\ Nekoma\ High\,\ Karasuno\ agrees\ to\ take\ part\ in\ a\ large\ training\ camp\ alongside\ many\ notable\ volleyball\ teams\ in\ Tokyo\ and\ even\ some\ national\ level\ players\.\ By\ playing\ with\ some\ of\ the\ toughest\ teams\ in\ Japan\,\ they\ hope\ not\ only\ to\ sharpen\ their\ skills\,\ but\ also\ come\ up\ with\ new\ attacks\ that\ would\ strengthen\ them\.\ Moreover\,\ http\:\/\/anidb\.net\/ch60471\ \[Hinata\]\ and\ http\:\/\/anidb\.net\/ch60470\ \[Kageyama\]\ attempt\ to\ devise\ a\ more\ powerful\ weapon\,\ one\ that\ could\ possibly\ break\ the\ sturdiest\ of\ blocks\.\\nFacing\ what\ may\ be\ their\ last\ chance\ at\ victory\ before\ the\ senior\ players\ graduate\,\ the\ members\ of\ Karasuno\`s\ volleyball\ team\ must\ learn\ to\ settle\ their\ differences\ and\ train\ harder\ than\ ever\ if\ they\ hope\ to\ overcome\ formidable\ opponents\ old\ and\ new\—including\ their\ archrival\ Aoba\ Jousai\ and\ its\ world\-class\ setter\ http\:\/\/anidb\.net\/ch62559\ \[Oikawa\ Tooru\]\.\\nSource\:\ MAL');
INSERT INTO animes VALUES(25,'Mushi\-Shi\:\ Bell\ Droplets','\蟲\師\ \続\章\ \鈴\の\雫','Nagahama\ Hiroshi',2015,9.55,'http://img7.anidb.net/pics/anime/170351.jpg','Ginko\ stumbles\ upon\ a\ young\ girl\ in\ a\ mountain\ with\ branches\ and\ leaves\ growing\ out\ of\ her\ body\.\ He\ later\ realises\ that\ she\ is\ the\ lord\ of\ that\ mountain\ but\ finds\ it\ strange\ that\ a\ human\ like\ her\ was\ chosen\ as\ the\ lord\.\ He\ later\ meets\ her\ older\ brother\ who\ has\ continued\ to\ search\ for\ her\ ever\ since\ she\ disappeared\ while\ she\ was\ accompanying\ him\ on\ a\ stormy\ day\.\ The\ story\ is\ about\ that\ girl\,\ Kaya\,\ and\ how\ she\ is\ torn\ between\ continuing\ her\ duty\ as\ a\ mushi\ lord\ and\ returning\ back\ to\ her\ loving\ human\ family\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(26,'gintama4','\銀\魂\゜','Miyawaki\ Chizuru',2015,9.61,'http://img7.anidb.net/pics/anime/166237.jpg','In\ a\ world\ where\ aliens\ have\ invaded\ Edo\ Period\ Japan\,\ skyscrapers\,\ trains\ and\ motor\ bikes\ have\ replaced\ the\ simple\ life\ of\ Earth\ inhabitants\.\ One\ man\ however\,\ still\ carries\ the\ soul\ of\ a\ samurai\,\ Gintoki\ Sakata\,\ otherwise\ known\ as\ Yorozuya\ Gin\-san\.\ As\ reckless\ as\ he\ is\,\ Gintoki\ carries\ his\ own\ resolve\ and\ is\ ready\ to\ take\ on\ any\ challenge\ with\ his\ fellow\ companions\.\\nSource\:\ crunchyroll');
INSERT INTO animes VALUES(27,'Aria\ 2015','ARIA\ The\ AVVENIRE','Satou\ Jun\`ichi',2015,8.73,'http://img7.anidb.net/pics/anime/174277.jpg','Note\:\ The\ Blu\-ray\ boxes\ for\ each\ Aria\ TV\ series\ contained\ one\ episode\ of\ Aria\ the\ Avvenire\ each\,\ for\ a\ total\ of\ three\:\ the\ http\:\/\/anidb\.net\/a2659\ \[Aria\ the\ Animation\]\ box\ shipped\ with\ the\ first\ episode\ on\ 24\.12\.2015\,\ the\ http\:\/\/anidb\.net\/a4243\ \[Aria\ the\ Natural\]\ box\ shipped\ with\ the\ second\ episode\ on\ 23\.03\.2016\,\ and\ the\ http\:\/\/anidb\.net\/a5424\ \[Aria\ the\ Origination\]\ box\ shipped\ with\ the\ third\ episode\ on\ 24\.06\.2016\.\ All\ three\ episodes\ were\ also\ shown\ at\ a\ special\ event\ on\ 26\.09\.2015\.');
INSERT INTO animes VALUES(28,'One\-Punch\ Man','ONE\ PUNCH\ MAN\ \ワ\ン\パ\ン\マ\ン','Natsume\ Shingo',2015,8.97,'http://img7.anidb.net/pics/anime/177065.jpg','The\ story\ takes\ place\ in\ the\ fictional\ metropolis\ of\ City\ Z\,\ Japan\.\ The\ world\ is\ full\ of\ strange\ monsters\ that\ mysteriously\ appear\ and\ cause\ many\ disasters\.\ http\:\/\/anidb\.net\/ch73940\ \[Saitama\]\ is\ a\ super\ powerful\ hero\ who\ easily\ defeats\ the\ monsters\ and\ other\ villains\ with\ one\ punch\.\ However\,\ after\ becoming\ too\ strong\,\ Saitama\ has\ become\ bored\ with\ his\ powers\ and\ is\ always\ trying\ to\ find\ stronger\ opponents\ who\ can\ fight\ him\.\\nOn\ his\ adventures\,\ he\ meets\ new\ friends\,\ enemies\,\ and\ his\ own\ disciple\,\ the\ cyborg\ http\:\/\/anidb\.net\/ch73941\ \[Genos\]\,\ and\ also\ joins\ the\ Hero\ Association\ in\ order\ to\ gain\ fame\ for\ all\ of\ his\ actions\ to\ prevent\ evil\.\ Despite\ defeating\ many\ strong\ monsters\ that\ even\ the\ Hero\ Association\`s\ top\ heroes\ are\ unable\ to\ defeat\,\ Saitama\ struggles\ to\ gain\ respect\.\ Most\ people\ discriminate\ him\ due\ to\ his\ plain\ physical\ appearance\ and\ some\ accuse\ him\ of\ being\ a\ counterfeit\ hero\.\ Only\ a\ small\ number\ of\ individuals\ recognize\ his\ incredible\ talent\ and\ humility\ towards\ others\.\\nSource\:\ Wikipedia');
INSERT INTO animes VALUES(29,'Spirited\ Away','\千\と\千\尋\の\神\隠\し','Miyazaki\ Hayao',2001,8.67,'http://img7.anidb.net/pics/anime/142157.jpg','For\ the\ 10\-year\-old\ http\:\/\/anidb\.net\/ch8759\ \[Chihiro\]\ and\ her\ family\,\ a\ mysterious\ tunnel\ and\ haunted\ town\ located\ in\ everyday\ Japan\ lead\ to\ the\ Land\ of\ Spirits\,\ inhabited\ by\ gods\ and\ monsters\ and\ ruled\ by\ the\ greedy\ witch\ http\:\/\/anidb\.net\/ch10026\ \[Yubaaba\]\.\ Chihiro\`s\ parents\ are\ transformed\ into\ pigs\;\ to\ rescue\ them\,\ she\ must\ surrender\ her\ name\ and\ serve\ in\ this\ world\.\ Luckily\ she\ finds\ friends\ and\ allies\,\ including\ the\ handsome\ but\ mysterious\ boy\ http\:\/\/anidb\.net\/ch10025\ \[Haku\]\.\ Initially\ sulky\ and\ listless\,\ Chihiro\ \(or\ Sen\,\ as\ she\ is\ now\ called\)\ finds\ inner\ strength\ and\ establishes\ an\ identity\ in\ this\ strange\ world\.\ But\ can\ she\ win\ back\ her\ name\ and\ return\ home\?\\nSource\:\ AnimeNfo');
INSERT INTO animes VALUES(30,'Erased','\僕\だ\け\が\い\な\い\街','Itou\ Tomohiko',2016,8.5,'http://img7.anidb.net/pics/anime/180785.jpg','http\:\/\/anidb\.net\/ch78638\ \[Fujinuma\ Satoru\]\ is\ a\ struggling\ manga\ artist\ who\ has\ the\ ability\ to\ turn\ back\ time\ and\ prevent\ deaths\.\ When\ his\ mother\ is\ killed\ he\ turns\ back\ time\ to\ solve\ the\ mystery\,\ but\ ends\ up\ back\ in\ elementary\ school\,\ just\ before\ the\ disappearance\ of\ his\ classmate\ http\:\/\/anidb\.net\/ch78641\ \[Hinazuki\ Kayo\]\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(31,'JoJo\`s\ Bizarre\ Adventure\:\ Diamond\ Is\ Unbreakable','\ジ\ョ\ジ\ョ\の\奇\妙\な\冒\険\ \ダ\イ\ヤ\モ\ン\ド\は\砕\け\な\い','Katou\ Toshiyuki',2016,8.35,'http://img7.anidb.net/pics/anime/184243.jpg','It\ is\ 1999\ \(10\ years\ after\ http\:\/\/anidb\.net\/ch81467\ \[Kuujou\ Joutarou\]\ defeated\ http\:\/\/anidb\.net\/ch75409\ \[DIO\]\ in\ Egypt\)\,\ and\ high\ schooler\ http\:\/\/anidb\.net\/ch81463\ \[Higashikata\ Jousuke\]\ \(illegitimate\ son\ of\ http\:\/\/anidb\.net\/ch1742\ \[Joseph\ Joestar\]\)\ lives\ in\ the\ small\ and\ peaceful\ town\ of\ Morioh\,\ Japan\.\\nThe\ Arrow\,\ manifesting\ latent\ Stand\ abilities\,\ travels\ throughout\ Morioh\;\ as\ Jousuke\ and\ his\ friends\ seek\ out\ the\ culprits\ of\ a\ series\ of\ homicides\.');
INSERT INTO animes VALUES(32,'Sound\!\ Euphonium\ 2','\響\け\!\ \ユ\ー\フ\ォ\ニ\ア\ム\ 2','Ishihara\ Tatsuya',2016,8.3,'http://img7.anidb.net/pics/anime/189320.jpg','Spring\ in\ the\ first\ year\ of\ high\ school\.\ Kumiko\,\ a\ member\ of\ the\ brass\ band\ in\ junior\ high\ school\,\ visits\ the\ high\ school\ brass\ band\ club\ with\ classmates\ Hazuki\ and\ Sapphire\.\ There\,\ she\ comes\ across\ Reina\,\ her\ former\ classmate\ from\ junior\ high\.\ Hazuki\ and\ Sapphire\ decide\ to\ join\ the\ club\,\ but\ Kumiko\ can\`t\ make\ up\ her\ mind\.\ She\ recollects\ her\ experience\ with\ Reina\ at\ a\ competition\ in\ junior\ high\ school\.\\nSource\:\ crunchyroll');
INSERT INTO animes VALUES(33,'Ghost\ in\ the\ Shell\:\ Stand\ Alone\ Complex\ 2nd\ GIG','\攻\殻\機\動\隊\ S\.A\.C\.\ 2nd\ GIG\ GHOST\ IN\ THE\ SHELL\ \"STAND\ ALONE\ COMPLEX\"','Kamiyama\ Kenji',2004,8.76,'http://img7.anidb.net/pics/anime/130668.jpg','The\ story\ continues\ to\ follow\ the\ adventures\ of\ Section\ 9\`s\ top\ members\,\ Motoko\ Kusanagi\,\ Batou\,\ and\ Togusa\.\ For\ this\ second\ season\,\ Innocence\-famed\ director\ Mamoru\ Oshii\ contributed\ with\ his\ ideas\ to\ the\ concept\ of\ the\ entire\ series\ right\ from\ the\ initial\ planning\ stages\.\ The\ series\ maintains\ an\ episodic\ format\ and\ portrays\ Section\ 9\ dealing\ with\ political\ issues\ such\ as\ invited\ refugees\ and\ nuclear\ intrigue\.\ Another\ government\ institution\,\ the\ Information\ Bureau\ of\ the\ Cabinet\,\ comes\ up\ head\-to\-head\ against\ them\.\ And\ a\ terrorist\ entity\ who\ calls\ itself\ the\ \"Individual\ Eleven\"\ joins\ the\ set\.\ The\ in\-depth\ storytelling\ of\ the\ series\ is\ likely\ to\ surpass\ the\ first\ series\.');
INSERT INTO animes VALUES(34,'Your\ Name\.','\君\の\名\は\.\ your\ name\.','Shinkai\ Makoto',2016,9.2,'http://img7.anidb.net/pics/anime/184462.jpg','http\:\/\/anidb\.net\/ch78861\ \[Mitsuha\]\ is\ a\ female\ high\ school\ student\ who\ lives\ in\ a\ rural\ town\ nestled\ deep\ in\ the\ mountains\.\ She\ laments\ that\ she\ lives\ in\ the\ countryside\,\ and\ yearns\ for\ the\ wonderful\ lifestyle\ in\ Tokyo\.\\nhttp\:\/\/anidb\.net\/ch78862\ \[Taki\]\ is\ a\ male\ high\ school\ student\ who\ lives\ in\ central\ Tokyo\.\ He\ spends\ time\ with\ his\ friends\,\ works\ part\-time\ at\ an\ Italian\ restaurant\,\ and\ is\ also\ interested\ in\ architecture\ and\ fine\ arts\.\\nOne\ day\,\ Mitsuha\ has\ a\ dream\ where\ she\ is\ a\ young\ man\.\ Taki\ also\ has\ a\ dream\ where\ he\ is\ a\ female\ student\ attending\ high\ school\ in\ the\ countryside\.\ What\ is\ the\ secret\ behind\ their\ dreams\?\\nSource\:\ ANN\\nNote\:\ The\ movie\ premiered\ at\ Anime\ Expo\ 2016\.\ Regular\ cinematic\ release\ started\ on\ August\ 26\.');
INSERT INTO animes VALUES(35,'Gintama\°\ \(2016\)','\銀\魂\゜\(2016\)','',2016,8.71,'http://img7.anidb.net/pics/anime/185545.jpg','Note\:\ Bundled\ with\ limited\ editions\ of\ the\ 65th\ and\ 66th\ Gintama\ manga\ volumes\.');
INSERT INTO animes VALUES(36,'Haikyu\!\!\ Karasuno\ High\ School\ vs\ Shiratorizawa\ Academy','\ハ\イ\キ\ュ\ー\!\!\ \烏\野\高\校\ VS\ \白\鳥\沢\学\園\高\校','Mitsunaka\ Susumu',2016,9.31,'http://img7.anidb.net/pics/anime/193389.jpg','\*\ Based\ on\ shounen\ manga\ series\ written\ and\ illustrated\ by\ http\:\/\/anidb\.net\/cr39882\ \[Furudate\ Haruichi\]\\nThe\ boys\ prepare\ to\ finally\ face\ off\ for\ the\ right\ to\ represent\ the\ prefecture\ in\ the\ volleyball\ national\ championship\.\ Despite\ being\ known\ as\ \"The\ Fallen\ Champions\,\"\ Karasuno\ is\ determined\ to\ take\ down\ the\ powerhouse\ that\ is\ the\ Shiratorizawa\ High\ volleyball\ team\.\ As\ http\:\/\/anidb\.net\/ch60471\ \[Hinata\]\ comes\ closer\ to\ fulfilling\ his\ promise\ to\ defeat\ Ushijima\`s\ team\,\ will\ the\ \"Flightless\ Crows\"\ finally\ find\ their\ wings\ and\ soar\ above\ the\ best\ school\ in\ the\ prefecture\?\\nSource\:\ crunchyroll');
INSERT INTO animes VALUES(37,'Natsume\ Yujin\-cho\ Go','\夏\目\友\人\帳\ \伍','Deai\ Kotomi',2016,8.43,'http://img7.anidb.net/pics/anime/190395.jpg','\*\ Based\ on\ fantasy\ manga\ series\ by\ http\:\/\/anidb\.net\/cr3542\ \[Midorikawa\ Yuki\]\.\\nNote\:\ The\ first\ episode\ received\ an\ early\ screening\ at\ a\ special\ event\ on\ 01\.10\.2016\.\ The\ regular\ TV\ broadcast\ started\ on\ October\ 5\,\ 2016\.');
INSERT INTO animes VALUES(38,'Descending\ Stories\:\ Showa\ Genroku\ Rakugo\ Shinju','\昭\和\元\禄\落\語\心\中\ \~\助\六\再\び\篇\~','Hatakeyama\ Mamoru',2017,9.36,'http://img7.anidb.net/pics/anime/200154.jpg','Upon\ his\ release\ from\ prison\,\ a\ man\ seeks\ out\ the\ famous\ comedic\ storyteller\ Yakumo\ after\ falling\ in\ love\ with\ his\ rendition\ of\ a\ story\ called\ \"Shinigami\.\"\ Yakumo\ accepts\ the\ ex\-convict\ as\ his\ apprentice\,\ nicknaming\ him\ \"Yotaro\.\"\ As\ Yotaro\ gets\ acclimated\ to\ his\ new\ life\,\ he\ meets\ Konatsu\,\ a\ girl\ in\ the\ care\ of\ Yakumo\ who\ wants\ to\ become\ a\ performer\ as\ well\,\ but\ is\ unable\ to\ because\ she\ is\ a\ woman\.\\nSource\:\ crunchyroll');
INSERT INTO animes VALUES(39,'Howl\`s\ Moving\ Castle','\ハ\ウ\ル\の\動\く\城','Miyazaki\ Hayao',2004,8.17,'http://img7.anidb.net/pics/anime/18364.jpg','http\:\/\/anidb\.net\/ch10044\ \[Sophie\ Hatter\]\,\ the\ eldest\ of\ three\,\ is\ apprenticed\ to\ make\ hats\ for\ the\ people\ of\ Ingary\,\ a\ place\ where\ spells\,\ magic\ cloaks\,\ and\ seven\-league\ boots\ exist\.\ She\ and\ all\ the\ young\ girls\ are\ warned\ to\ stay\ inside\ or\ be\ taken\ by\ http\:\/\/anidb\.net\/ch5005\ \[Howl\]\,\ the\ evil\ wizard\ whose\ black\ castle\ can\ be\ seen\ moving\ through\ the\ hills\.\ After\ an\ encounter\ with\ a\ witch\ and\ with\ a\ spell\ cast\ on\ her\ to\ make\ her\ an\ http\:\/\/anidb\.net\/ch10048\ \[old\ woman\]\,\ Sophie\ goes\ to\ seek\ adventure\.\ She\ heads\ towards\ Howl\`s\ moving\ castle\ where\ she\ will\ encounter\ things\ she\ had\ never\ imagined\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(40,'Lupin\ the\ Third\:\ The\ Blood\ Spray\ of\ Goemon\ Ishikawa','LUPIN\ THE\ IIIRD\ \血\煙\の\石\川\五\ェ\門','Koike\ Takeshi',2017,8.39,'http://img7.anidb.net/pics/anime/195482.jpg','The\ grandson\ of\ Ars\ène\ Lupin\ is\ tall\,\ lanky\,\ impertinent\,\ and\ very\ sneaky\.\ His\ prime\ qualities\ are\ listed\ as\ \"appearing\ like\ a\ god\,\ disappearing\ like\ a\ demon\"\;\ in\ other\ words\,\ he\ appears\ with\ a\ flash\ and\ leaves\ with\ a\ whisper\.\ Despite\ being\ aided\ by\ many\ gadgets\,\ his\ main\ talents\ lie\ in\ plotting\ and\ evasion\ of\ weapons\.\\nWhile\ his\ grandfather\ was\ known\ as\ the\ \"Gentleman\ Thief\"\,\ Lupin\ III\ has\ no\ qualms\ about\ trying\ to\ separate\ a\ woman\ from\ her\ modesty\.\ He\ fancies\ himself\ as\ quite\ the\ ladies\ man\,\ but\ his\ advances\ rarely\ succeeds\.\ His\ primary\ weakness\ is\ his\ overconfidence\ and\ lust\ for\ Mine\ Fujiko\.');
INSERT INTO animes VALUES(41,'Gintama\ Season\ 4','\銀\魂\.','Miyawaki\ Chizuru',2017,9.36,'http://img7.anidb.net/pics/anime/195616.jpg','In\ a\ world\ where\ aliens\ have\ invaded\ Edo\ Period\ Japan\,\ skyscrapers\,\ trains\ and\ motor\ bikes\ have\ replaced\ the\ simple\ life\ of\ Earth\ inhabitants\.\ One\ man\ however\,\ still\ carries\ the\ soul\ of\ a\ samurai\,\ http\:\/\/anidb\.net\/ch1162\ \[Sakata\ Gintoki\]\,\ otherwise\ known\ as\ Yorozuya\ Gin\-san\.\ As\ reckless\ as\ he\ is\,\ Gintoki\ carries\ his\ own\ resolve\ and\ is\ ready\ to\ take\ on\ any\ challenge\ with\ his\ fellow\ companions\.\\nSource\:\ crunchyroll');
INSERT INTO animes VALUES(42,'Meitantei\ Conan\:\ Episode\ One\ \-\ Chiisaku\ Natta\ Meitantei','\名\探\偵\コ\ナ\ン\ \エ\ピ\ソ\ー\ドONE\ \小\さ\く\な\っ\た\名\探\偵','',2016,8.27,'http://img7.anidb.net/pics/anime/196179.jpg','Two\-hour\ remake\ of\ the\ original\ 1st\ episode\,\ in\ celebration\ of\ the\ anime\ celebrating\ 20\ years\ in\ broadcast\.\ The\ special\ retells\ what\ happened\ on\ the\ day\ Shinichi\ was\ transformed\ into\ the\ body\ of\ a\ child\.\ The\ special\ includes\ new\ scenes\ that\ weren\`t\ in\ the\ original\ manga\ or\ the\ first\ anime\ episode\.');
INSERT INTO animes VALUES(43,'Natsume\ Yujin\-cho\ Roku','\夏\目\友\人\帳\ \陸','Deai\ Kotomi',2017,8.49,'http://img7.anidb.net/pics/anime/198770.jpg','Precious\ days\ with\ kinds\ friends\.\ A\ beautiful\ yet\ fleeting\ story\ about\ people\ and\ spirits\.\ Natsume\ Takashi\ had\ been\ able\ to\ see\ yokai\ ever\ since\ he\ was\ young\ and\ inherited\ his\ grandmother\ Reiko\’s\ Book\ of\ Friends\.\ He\ spends\ his\ days\ with\ his\ self\-proclaimed\ bodyguard\ Nyanko\-sensei\ and\ freeing\ the\ yokai\ that\ were\ bound\ to\ the\ book\.\ Natsume\ continues\ to\ find\ ways\ to\ protect\ the\ precious\ days\ where\ he\ tries\ to\ find\ which\ path\ to\ follow\ through\ his\ connections\ with\ spirits\ and\ those\ involved\ with\ them\ and\ being\ helped\ out\ by\ friends\ who\ share\ the\ same\ feelings\.\\nSource\:\ crunchyroll');
INSERT INTO animes VALUES(44,'Fighting\ Spirit','\は\じ\め\の\一\歩\ THE\ FIGHTING\!','Nishimura\ Satoshi',2000,8.76,'http://img7.anidb.net/pics/anime/144682.jpg','Makunouchi\ Ippo\ is\ an\ ordinary\ high\ school\ student\ in\ Japan\.\ Since\ he\ spends\ most\ of\ his\ time\ away\ from\ school\ helping\ his\ mother\ run\ the\ family\ business\,\ he\ doesn\`t\ get\ to\ enjoy\ his\ younger\ years\ like\ most\ teenagers\.\ Always\ a\ target\ for\ bullying\ at\ school\ \(the\ family\ fishing\ business\ grants\ him\ a\ distinct\ odor\)\,\ Ippo\`s\ life\ is\ one\ of\ hardship\.\\nOne\ of\ these\ after\-school\ bullying\ sessions\ turns\ Ippo\`s\ life\ around\ for\ the\ better\,\ as\ he\ is\ saved\ by\ a\ boxer\ named\ Takamura\.\ He\ decides\ to\ follow\ in\ Takamura\`s\ footsteps\ and\ train\ to\ become\ a\ boxer\,\ giving\ his\ life\ direction\ and\ purpose\.\ Ippo\`s\ path\ to\ perfecting\ his\ pugilistic\ prowess\ is\ just\ beginning\ \.\.\.\\nSource\:\ AnimeNfo');
INSERT INTO animes VALUES(45,'MCitSoS','\銀\河\英\雄\伝\説\:\ \わ\が\征\く\は\星\の\大\海','Ishiguro\ Noboru',1988,8.61,'http://img7.anidb.net/pics/anime/10125.jpg','\*\ Based\ on\ an\ anecdote\ of\ Ginga\ Eiyuu\ Densetsu\ written\ by\ novelist\ http\:\/\/anidb\.net\/cr991\ \[Tanaka\ Yoshiki\]\.\\nPreludes\ the\ 110\-episodes\ TV\ series\ by\ describing\ the\ first\ encounter\ between\ the\ ambitious\ young\ man\ http\:\/\/anidb\.net\/ch1687\ \[Reinhard\ von\ Musel\]\ under\ the\ imperial\ flag\ and\ the\ passive\ http\:\/\/anidb\.net\/ch737\ \[Yang\ Wen\-li\]\ who\ serves\ a\ corrupting\ democracy\.\ Set\ in\ an\ imaginative\ future\,\ the\ story\ describes\ the\ first\ encounter\ between\ Yang\ and\ Reinhard\ and\ discusses\ how\ heroes\ are\ born\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(46,'Overture','\銀\河\英\雄\伝\説\ \新\た\な\る\戦\い\の\序\曲\[\オ\ー\ヴ\ァ\チ\ュ\ア\]','Shimizu\ Keizou',1993,8.89,'http://img7.anidb.net/pics/anime/53490.jpg','The\ recently\ ennobled\ http\:\/\/anidb\.net\/ch186\ \[Reinhard\ von\ Lohengramm\]\ who\ on\ suspicion\ of\ imperial\ favouritism\ and\ nepotism\ is\ facing\ resistance\ from\ his\ peers\,\ and\ http\:\/\/anidb\.net\/ch737\ \[Yang\ Wen\-Li\]\ the\ unwilling\ hero\ of\ the\ opposite\ faction\,\ must\ prove\ their\ worth\ in\ the\ Battle\ of\ Astate\.\.\.\\nNote\:\ The\ film\ is\ a\ more\ detailed\ retelling\ of\ the\ first\ 2\ episodes\ of\ the\ Legend\ of\ Galactic\ Heroes\ OVA\ series\.');
INSERT INTO animes VALUES(47,'logh\ gaiden\ 1','Heldensagen\ vom\ Kosmosinsel\ \銀\河\英\雄\伝\説\外\伝','Ishiguro\ Noboru',1998,8.91,'http://img7.anidb.net/pics/anime/5569.jpg','These\ short\ stories\ fill\ in\ the\ first\ part\ of\ the\ background\ of\ Reinhard\ von\ Lohengramm\ and\ Siegfried\ Kircheis\ before\ the\ start\ of\ the\ main\ Legend\ of\ the\ Galactic\ Heroes\ series\.\ In\ these\ stories\,\ they\ journey\ to\ a\ planet\ of\ ice\ and\ are\ betrayed\ by\ their\ commanding\ officer\,\ they\ investigate\ a\ possible\ murder\ at\ their\ alma\ mater\,\ Kircheis\ takes\ a\ vacation\ and\ gets\ involved\ in\ a\ plot\ against\ an\ admiral\,\ and\ finally\ the\ major\ 12\-part\ story\ of\ Reinhard\ at\ Iserlohn\,\ a\ battle\ fortress\ that\ protects\ the\ Galactic\ Empire\ from\ the\ Free\ Planets\.\\nSource\:\ ANN\\nNote\:\ The\ first\ three\ volumes\ \(\白\銀\の\谷\;\ \朝\の\夢\,\夜\の\歌\;\ \汚\名\)\ were\ screened\ in\ the\ Tokyo\`s\ Tokuma\ Hall\ on\ February\ 9\,\ 10\ and\ 12\ respectively\,\ prior\ to\ its\ release\ on\ VHS\ rental\ on\ February\ 27\,\ 1998\.');
INSERT INTO animes VALUES(48,'logh\ gaiden\ 2','Heldensagen\ vom\ Kosmosinsel\ \銀\河\英\雄\伝\説\外\伝\ \(1999\)','Shimizu\ Keizou',1999,8.92,'http://img7.anidb.net/pics/anime/10744.jpg','These\ short\ stories\ fill\ in\ the\ background\ of\ Yang\ Wenli\ prior\ to\ the\ Overture\ to\ a\ New\ War\ movie\,\ and\ continue\ with\ the\ background\ of\ Reinhard\ and\ Kircheis\ where\ Gaiden\ 1\ left\ off\.\ In\ these\ stories\,\ Yang\ becomes\ the\ Hero\ of\ El\ Facile\ and\ is\ given\ a\ research\ investigation\ of\ some\ delicacy\,\ Reinhard\`s\ first\ assignment\ to\ a\ ship\ at\ Iserlohn\,\ Reinhard\ deals\ with\ a\ formal\ duel\ among\ the\ politics\ of\ the\ nobles\,\ Reinhard\`s\ secret\ mission\ into\ Free\ Planet\ territory\,\ and\ the\ Third\ Tiamat\ Battle\,\ wherein\ Reinhard\ earns\ the\ rank\ of\ General\ at\ the\ age\ of\ 19\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(49,'HxH\ OVA\ 3','\ハ\ン\タ\ーx\ハ\ン\タ\ー\ G\・I\ Final','Tokoro\ Toshikatsu',2004,8.12,'http://img7.anidb.net/pics/anime/144671.jpg','Gon\ is\ still\ searching\ for\ his\ father\ inside\ the\ game\ Greed\ Island\.\ This\ OVA\ will\ cover\ Gon\,\ Killua\ and\ Biscuit\`s\ adventures\ throughout\ the\ game\.\ Will\ Gon\ find\ his\ father\?\ Find\ out\.\.\.');
INSERT INTO animes VALUES(50,'anj','\あ\し\た\の\ジ\ョ\ー','Dezaki\ Osamu',1970,8.28,'http://img7.anidb.net/pics/anime/170242.jpg','http\:\/\/anidb\.net\/ch8995\ \[Joe\]\,\ a\ teenage\ orphan\ in\ the\ slums\ of\ the\ Doya\ streets\,\ meets\ http\:\/\/anidb\.net\/ch40307\ \[Danpei\]\,\ a\ homeless\,\ alcoholic\ ex\-boxing\ coach\.\ Danpei\,\ seeing\ Joe\`s\ boxing\ talent\,\ decides\ to\ train\ him\.\ When\ Joe\ is\ sent\ to\ a\ terrible\ juvenile\ home\ for\ petty\ crimes\,\ he\ meets\ Rikiishi\ who\ becomes\ his\ boxing\ rival\.\ Danpei\ arrives\ at\ the\ home\ to\ help\ Joe\ to\ train\ in\ order\ to\ defeat\ Rikiishi\.\ When\ Joe\ decides\ to\ seriously\ pursue\ boxing\,\ Danpei\ cannot\ get\ a\ coaching\ licence\ because\ of\ his\ reputation\ as\ a\ drunk\.\\nSource\:\ AnimeNfo');
INSERT INTO animes VALUES(51,'Champion\ Joe\ 2','\あ\し\た\の\ジ\ョ\ー2','Dezaki\ Osamu',1980,9.08,'http://img7.anidb.net/pics/anime/170243.jpg','Yabuki\ Joe\ is\ wandering\ around\ as\ if\ he\ escaped\ from\ the\ death\ of\ Rikiishi\ Toru\.\ During\ his\ wandering\ journey\,\ he\ meets\ Wolf\ Kanagushi\ and\ Goromaki\ Gondo\.\ Their\ meeting\ arouses\ his\ fighting\ sprits\,\ and\ Joe\ comes\ back\ to\ Tange\ Boxing\ Club\.\ However\,\ he\ has\ a\ fatal\ week\ point\.\ Because\ his\ punch\ on\ the\ temple\ killed\ Rikiishi\,\ he\ can\`t\ hit\ on\ the\ temple\.\ To\ make\ him\ recover\,\ Shiraki\ Yoko\ invites\ a\ king\ without\ a\ crown\,\ Carlos\ Rivera\,\ from\ Venezuela\.\\nSource\:\ AnimeNfo');
INSERT INTO animes VALUES(52,'Monster','MONSTER','Kojima\ Masayuki',2004,8.63,'http://img7.anidb.net/pics/anime/181175.jpg','\*\ Based\ on\ the\ manga\ by\ http\:\/\/anidb\.net\/cr875\ \[Urasawa\ Naoki\]\.\\nhttp\:\/\/anidb\.net\/ch4907\ \[Dr\.\ Tenma\ Kenzou\]\ is\ a\ very\ talented\ Japanese\ doctor\ and\ he\`s\ praised\ by\ all\ doctors\ in\ Germany\.\ But\ after\ he\ saw\ how\ a\ woman\ cried\ for\ her\ man\ who\ died\ because\ someone\ else\ got\ more\ priority\,\ he\ changed\.\ He\ decides\ he\ wouldn\`t\ let\ anyone\ pass\;\ everyone\ is\ equal\.\\nBut\ one\ day\,\ Tenma\ has\ to\ work\ on\ a\ little\ boy\ who\ was\ shot\ during\ the\ murder\ of\ his\ parents\.\ He\ decides\ he\ will\ save\ the\ life\ of\ the\ boy\,\ because\ he\ was\ first\ in\ line\.\\nBut\ then\,\ the\ children\ disappear\.\.\.\ and\ the\ murders\ begin\.\ Tenma\,\ feeling\ both\ guilt\ and\ worry\,\ goes\ off\ to\ investigate\ the\ case\ since\ he\ feels\ that\ it\ somehow\ relates\ to\ him\.\.\.\ and\ the\ horror\ begins\,\ for\ both\ Tenma\ and\ everyone\ he\ meets\ in\ search\ for\ the\ children\.\.\.');
INSERT INTO animes VALUES(53,'City\ Hunter\ 2','CITY\ HUNTER\ 2','Kodama\ Kenji',1988,8.12,'http://img7.anidb.net/pics/anime/13081.jpg','The\ City\ Hunter\`s\ adventures\ continue\ with\ a\ complicated\ case\ of\ protecting\ an\ up\-and\-coming\ young\ idol\ from\ a\ stalker\.\ Normally\ this\ would\ be\ like\ letting\ the\ fox\ guard\ the\ hen\ house\,\ but\ fortunately\ even\ an\ infamous\ pervert\ like\ http\:\/\/anidb\.net\/ch1363\ \[Ryou\]\ does\ not\ go\ for\ minors\.\ But\ when\ the\ same\ culprit\ goes\ after\ http\:\/\/anidb\.net\/ch7965\ \[Kaori\]\ as\ well\,\ even\ Ryou\ is\ shaken\.\ He\ finally\ has\ to\ get\ serious\,\ even\ if\ his\ choice\ of\ methods\ is\ characteristically\ unorthodox\.\\nSource\:\ Anime\-Planet');
INSERT INTO animes VALUES(54,'The\ Dog\ of\ Flanders','THE\ DOG\ OF\ FLANDERS','Kuroda\ Yoshio',1997,8.12,'http://img7.anidb.net/pics/anime/36782.jpg','\*\ Based\ on\ the\ Flemish\ novel\ by\ http\:\/\/anidb\.net\/cr10120\ \[Ouida\]\.\\nSet\ in\ 19th\-century\ Belgium\,\ this\ classic\ tale\,\ celebrates\ the\ affectionate\ bond\ between\ an\ innocent\ boy\ and\ his\ faithful\ dog\.\ The\ stunning\ animation\,\ a\ masterful\ combination\ of\ traditional\ and\ computer\-aided\ animation\,\ captures\ the\ natural\ splendor\ of\ the\ Flanders\ countryside\ and\ recreates\ the\ spirit\ of\ this\ classic\ story\ that\ has\ captivated\ audiences\ world\ wide\ for\ more\ than\ 130\ years\.\ In\ fact\,\ the\ popularity\ of\ The\ Dog\ Of\ Flanders\ led\ the\ local\ Belgian\ government\ of\ Flanders\ to\ dedicate\ a\ statue\ to\ Nello\ and\ Patrash\ in\ 1985\,\ immortalizing\ their\ devotion\ to\ each\ other\.');
INSERT INTO animes VALUES(55,'The\ Rose\ of\ Versailles','\ベ\ル\サ\イ\ユ\の\ば\ら','',1979,8.52,'http://img7.anidb.net/pics/anime/3397.jpg','Raised\ from\ birth\ as\ a\ man\,\ http\:\/\/anidb\.net\/ch51681\ \[Lady\ Oscar\]\ commands\ the\ palace\ guards\ at\ Versailles\ in\ the\ years\ before\ the\ French\ Revolution\.\ Her\ beauty\ and\ noble\ spirit\ make\ her\ a\ shining\ figure\ in\ the\ eyes\ of\ both\ men\ and\ women\,\ but\ she\ is\ torn\ between\ her\ chosen\ life\ of\ service\ and\ duty\ to\ class\ and\ country\,\ and\ her\ own\ heart\ and\ desires\.\ She\ lives\ as\ a\ noble\ amidst\ the\ opulence\ of\ Versailles\,\ but\ her\ keen\ senses\ and\ compassion\ are\ not\ blinded\ to\ the\ poverty\ of\ the\ French\ people\.');
INSERT INTO animes VALUES(56,'Great\ Teacher\ Onizuka','GTO\(\グ\レ\ー\ト\・\テ\ィ\ー\チ\ャ\ー\・\オ\ニ\ヅ\カ\)','Abe\ Noriyuki',1999,8.68,'http://img7.anidb.net/pics/anime/2364.gif','Tough\ on\ the\ outside\,\ all\ heart\ on\ the\ inside\,\ http\:\/\/anidb\.net\/ch2\ \[Onizuka\]\ turned\ to\ the\ life\ of\ a\ high\ school\ teacher\ for\ less\ excitement\ and\ action\.\.\.\ or\ so\ he\ thought\.\ GTO\,\ A\.K\.A\.\:\ Great\ Teacher\ Onizuka\,\ is\ the\ racy\ story\ of\ Onizuka\,\ a\ former\ motorcycle\ gang\ member\ who\ becomes\ a\ teacher\ to\ make\ a\ difference\ and\.\.\.\ to\ meet\ girls\?\ Using\ his\ street\ smarts\ to\ deal\ with\ colleagues\,\ students\ and\ troublemakers\,\ Onizuka\ finds\ that\ he\ too\ has\ many\ lessons\ to\ learn\!\\nSource\:\ AnimeNfo');
INSERT INTO animes VALUES(57,'Major\ S1','\メ\ジ\ャ\ー','Kasai\ Ken\`ichi',2004,8.25,'http://img7.anidb.net/pics/anime/23813.jpg','http\:\/\/anidb\.net\/ch2070\ \[Honda\ Shigeharu\]\ is\ a\ Major\ League\ batter\ on\ the\ rise\.\ His\ son\ http\:\/\/anidb\.net\/ch2065\ \[Gorou\]\ is\ a\ Little\ League\ pitcher\ who\ one\ day\ hopes\ to\ follow\ in\ his\ father\`s\ footsteps\.\ Hoshino\ Momoko\ is\ Gorou\`s\ schoolteacher\,\ and\ the\ first\ woman\ Shigeharu\ has\ been\ interested\ in\ since\ the\ death\ of\ Gorou\`s\ mother\.\ The\ destinies\ of\ these\ three\ individuals\ will\ become\ intertwined\ as\ father\ and\ son\ experience\ both\ heartbreak\ and\ triumph\ on\ the\ baseball\ diamond\.\ But\ when\ an\ unspeakable\ tragedy\ visits\ the\ family\,\ it\ will\ take\ everything\ they\ have\ to\ pick\ up\ the\ pieces\ and\ reclaim\ their\ dreams\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(58,'Sword\ of\ the\ Stranger','\ス\ト\レ\ン\ヂ\ア\ \-\無\皇\刃\譚\-','Andou\ Masahiro',2007,8.35,'http://img7.anidb.net/pics/anime/83896.jpg','In\ the\ Sengoku\ period\,\ a\ rounin\ called\ http\:\/\/anidb\.net\/ch8194\ \[Nanashi\]\ \(meaning\ nameless\)\ saves\ a\ young\ boy\ http\:\/\/anidb\.net\/ch8201\ \[Kotarou\]\ and\ his\ dog\ http\:\/\/anidb\.net\/ch8208\ \[Tobimaru\]\ at\ an\ abandoned\ temple\.\ Kotarou\ has\ no\ family\,\ is\ pursued\ by\ a\ mysterious\ militia\ organization\ from\ China\ and\ hires\ Nanashi\ as\ his\ bodyguard\.\ Among\ the\ pursuers\ is\ a\ man\ called\ http\:\/\/anidb\.net\/ch16366\ \[Rarou\]\,\ a\ very\ skilled\ warrior\ with\ blond\ hair\ and\ blue\ eyes\.\ He\ obeys\ an\ old\ man\ called\ Byakuran\ and\ is\ a\ member\ of\ the\ Chinese\ militia\.\ Unlike\ his\ companions\ in\ the\ militia\,\ he\ is\ not\ serving\ any\ Emperor\ and\ just\ wants\ to\ fight\ with\ the\ strong\.\\nSource\:\ Iwa\ ni\ Hana');
INSERT INTO animes VALUES(59,'Cowboy\ Bebop','\カ\ウ\ボ\ー\イ\ビ\バ\ッ\プ','Watanabe\ Shin\`ichirou',1998,8.6,'http://img7.anidb.net/pics/anime/156726.jpg','The\ year\ is\ 2071\ AD\.\ With\ the\ systematic\ collapse\ of\ the\ old\ nation\-states\,\ a\ mixed\ jumble\ of\ races\ and\ peoples\ were\ driven\ out\ of\ their\ terrestrial\ Eden\ and\ spread\ to\ the\ stars\,\ taking\ with\ them\ the\ now\ confused\ concepts\ of\ justice\,\ freedom\,\ violence\,\ and\ love\.\ New\ rules\ were\ established\,\ and\ a\ new\ generation\ of\ bounty\ hunters\ came\ into\ being\.\ People\ referred\ to\ these\ bounty\ hunters\ as\ \"cowboys\"\.\\nMeet\ http\:\/\/anidb\.net\/ch270\ \[Spike\ Spiegel\]\ and\ http\:\/\/anidb\.net\/ch401\ \[Jet\ Black\]\,\ a\ drifter\ and\ a\ retired\ cyborg\ cop\ who\ have\ started\ a\ bounty\ hunting\ partnership\.\ In\ the\ converted\ ship\ The\ Bebop\,\ Spike\ and\ Jet\ search\ the\ galaxy\ for\ criminals\ with\ bounties\ on\ their\ heads\.\ They\ meet\ a\ lot\ of\ interesting\ characters\,\ including\ the\ unusually\ intelligent\ dog\ http\:\/\/anidb\.net\/ch403\ \[Ein\]\,\ the\ bizarre\ hacker\ child\ prodigy\ http\:\/\/anidb\.net\/ch402\ \[Ed\]\,\ and\ the\ voluptuous\ and\ vexing\ femme\ fatale\,\ http\:\/\/anidb\.net\/ch400\ \[Faye\ Valentine\]\.\\nSource\:\ AnimeNfo\\nNote\:\ Originally\ aired\ on\ http\:\/\/anidb\.net\/cr804\ \[TV\ Tokyo\]\,\ but\ after\ 12\ episodes\ the\ show\ was\ cancelled\ due\ to\ the\ violence\ portrayed\ in\ the\ Cowboy\ Bebop\ world\ and\ violence\ in\ Japanese\ schools\.\ The\ final\ and\ also\ the\ 13th\ episode\ on\ TV\ Tokyo\ was\ a\ compilation\ episode\ where\ the\ characters\ provide\ a\ philosophical\ commentary\ and\ end\ with\ the\ words\:\ \"\[i\]This\ Is\ Not\ The\ End\.\ You\ Will\ See\ The\ Real\ \"Cowboy\ Bebop\"\ Someday\!\"\ Four\ months\ later\,\ http\:\/\/anidb\.net\/cr764\ \[WOWOW\]\ started\ to\ broadcast\ all\ 26\ episodes\ of\ Cowboy\ Bebop\.\ The\ ordering\ was\ different\ with\ completely\ new\ episodes\ mixed\ in\ between\ episodes\ previously\ broadcast\ on\ TV\ Tokyo\,\ including\ a\ new\ episode\ 1\.\[\/i\]');
INSERT INTO animes VALUES(60,'Beck\ \-\ Mongolian\ Chop\ Squad','\ベ\ッ\ク','Kobayashi\ Osamu',2004,8.15,'http://img7.anidb.net/pics/anime/23812.jpg','http\:\/\/anidb\.net\/ch4068\ \[Tanaka\ Yukio\]\,\ better\ known\ by\ his\ nickname\ Koyuki\ is\ a\ 14\ year\ old\ who\ feels\ disconnected\ from\ life\ in\ general\.\ Through\ the\ act\ of\ saving\ a\ mismatched\ dog\,\ he\ meets\ guitarist\ http\:\/\/anidb\.net\/ch4071\ \[Minami\ Ryuusuke\]\,\ and\ becomes\ involved\ in\ Ryuusuke\`s\ new\ band\ BECK\.\ Koyuki\`s\ life\ starts\ to\ change\ as\ the\ band\ struggles\ towards\ fame\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(61,'Touch\ TV','\タ\ッ\チ','',1985,8.25,'http://img7.anidb.net/pics/anime/11746.jpg','The\ story\ centers\ around\ three\ characters\ \-\ Uesugi\ Kazuya\,\ his\ twin\ older\ brother\ Tatsuya\,\ and\ Asakura\ Minami\.\ Kazuya\ is\ the\ darling\ of\ his\ town\ as\ he\`s\ talented\,\ hardworking\,\ and\ the\ ace\ pitcher\ for\ his\ middle\ school\ baseball\ team\.\ Tatsuya\ is\ a\ hopeless\ slacker\ who\`s\ been\ living\ the\ life\ of\ giving\ up\ the\ spotlight\ to\ Kazuya\,\ despite\ the\ fact\ that\ he\ may\ be\ more\ gifted\ than\ him\.\ Minami\ is\ the\ beautiful\ childhood\ girlfriend\ and\ for\ all\ intents\,\ sister\ from\ next\ door\ who\ treats\ both\ of\ them\ as\ equals\.\ Society\ largely\ assumes\ Kazuya\ and\ Minami\ will\ become\ the\ perfect\ couple\,\ including\ Tatsuya\.\ Yet\ as\ time\ progresses\,\ Tatsuya\ grows\ to\ realize\ that\ he\`s\ willing\ to\ sacrifice\ anything\ for\ the\ sake\ of\ his\ brother\,\ except\ at\ the\ expense\ of\ giving\ up\ Minami\ to\ Kazuya\.\ And\ thus\ the\ story\ is\ told\ of\ Tatsuya\ trying\ to\ prove\ himself\ over\ his\ established\ younger\ brother\,\ how\ it\ affects\ the\ relationship\ between\ the\ three\,\ and\ both\ brothers\`\ attempts\ to\ make\ Minami\`s\ lifelong\ dreams\ come\ true\.\\n\[Source\:ANN\]');
INSERT INTO animes VALUES(62,'Ghost\ in\ the\ Shell\:\ Stand\ Alone\ Complex','\攻\殻\機\動\隊\ STAND\ ALONE\ COMPLEX','Kamiyama\ Kenji',2002,8.6,'http://img7.anidb.net/pics/anime/130667.jpg','In\ the\ year\ 2030\,\ digital\ networks\ are\ reaching\ out\ everywhere\,\ and\ technology\ pushing\ light\ and\ electrons\ has\ advanced\ to\ a\ state\ where\ it\ almost\ drives\ the\ human\ will\.\.\.\\nInformation\ networks\ continue\ to\ expand\ and\ crimes\ continue\ to\ become\ more\ complex\.\ In\ this\ society\ on\ the\ borderline\ to\ chaos\,\ an\ organization\ that\ specializes\ in\ hunting\ down\ and\ eliminating\ crime\ was\ established\.\ This\ is\ Section\ 9\,\ the\ so\ called\ \"Stand\ Alone\ Complex\"\ \(S\.A\.C\.\)\,\ under\ the\ direct\ supervision\ of\ the\ Ministry\ of\ the\ Interior\.\\nIts\ duties\ include\ a\ wide\ range\ of\ investigations\,\ such\ as\ responding\ to\ critical\ cyber\ crimes\,\ guarding\ VIPs\ within\ the\ country\,\ revealing\ political\ corruption\,\ investigating\ violent\ murder\,\ and\ dealing\ with\ top\ secret\ assassination\ cases\.\ The\ elite\ S\.A\.C\.\ is\ at\ its\ best\ in\ cyber\ confrontations\,\ but\ it\ is\ also\ extremely\ capable\ of\ physical\ confrontations\ by\ utilizing\ high\ quality\ cyborgs\.');
INSERT INTO animes VALUES(63,'The\ Twelve\ Kingdoms','\十\二\国\記','Kobayashi\ Tsuneo',2002,8.26,'http://img7.anidb.net/pics/anime/4993.jpg','http\:\/\/anidb\.net\/ch44\ \[Nakajima\ Youko\]\ is\ class\ president\ and\ an\ honour\ student\.\ At\ home\,\ she\ is\ a\ good\ daughter\,\ always\ obedient\ to\ her\ parents\.\ She\ pleases\ everyone\ around\ her\ to\ the\ extent\ of\ ignoring\ herself\ due\ to\ her\ lack\ of\ confidence\.\ She\ has\ nightmares\ daily\ and\ a\ unique\ hair\ colour\ that\ cause\ some\ friction\ at\ home\ and\ suspicion\ at\ school\.\\nOn\ a\ day\ like\ any\ other\ at\ school\,\ a\ strange\ man\ named\ http\:\/\/anidb\.net\/ch4946\ \[Keiki\]\ appears\ before\ her\.\ He\ kneels\ and\ swears\ allegiance\ to\ her\,\ promising\ to\ protect\ her\ and\ never\ leave\ her\ side\.\ Thereafter\ they\ are\ pursued\ and\ attacked\ by\ demon\-like\ beasts\.\ In\ this\ mix\ enters\ two\ of\ her\ classmates\ who\ unfortunately\ happen\ to\ be\ at\ the\ wrong\ place\ at\ the\ wrong\ time\.\ To\ escape\ the\ onslaught\,\ Keiki\ transports\ them\ to\ his\ world\.\ Unfortunately\ during\ the\ journey\ they\ are\ ambushed\ and\ end\ up\ separated\ from\ one\ another\.\\nNow\ they\ have\ to\ learn\ how\ to\ survive\ in\ a\ new\ land\,\ one\ with\ magic\,\ swords\,\ demon\-like\ beasts\ and\ immortals\.\\nThis\ anime\ is\ based\ on\ text\ novels\ written\ by\ http\:\/\/anidb\.net\/cr1214\ \[Ono\ Fuyumi\]\.\ It\ features\ a\ complex\ fantasy\ world\ with\ a\ rich\ mythology\ behind\ it\.\ The\ series\ tells\ us\ not\ only\ Nakajima\ Youko\`s\ story\,\ but\ also\ stories\ about\ other\ people\ who\ came\ to\ live\ in\ this\ world\.');
INSERT INTO animes VALUES(64,'Nausicaa\ of\ the\ Valley\ of\ the\ Wind','\風\の\谷\の\ナ\ウ\シ\カ','Miyazaki\ Hayao',1984,8.58,'http://img7.anidb.net/pics/anime/63459.png','Humanity\,\ in\ its\ hubris\,\ has\ precipitated\ an\ ecological\ disaster\.\ Flourishing\ industrial\ civilizations\ have\ been\ swallowed\ up\.\ Today\,\ a\ millennium\ after\ the\ collapse\ of\ the\ industrial\ societies\,\ large\ portions\ of\ the\ Earth\ are\ uninhabitable\.\ Among\ those\,\ one\ of\ the\ most\ relevant\ is\ the\ Sea\ of\ Corruption\,\ an\ enormous\ forest\ of\ fungi\ that\ releases\ a\ miasma\ of\ poisonous\ spores\ into\ the\ air\.\\nhttp\:\/\/anidb\.net\/ch7803\ \[Nausicaa\]\,\ a\ gentle\ young\ princess\ from\ a\ village\-sized\ kingdom\,\ has\ an\ empathetic\ bond\ with\ the\ giant\ mutated\ insects\ that\ evolved\ in\ the\ wake\ of\ the\ destruction\ of\ the\ ecosystem\.\ Travelling\ by\ cumbersome\ flying\ ships\,\ on\ the\ backs\ of\ giant\ birds\,\ and\ perched\ atop\ her\ beloved\ glider\,\ Nausicaa\ and\ her\ allies\ must\ appease\ the\ angers\ and\ fears\ of\ nations\ and\ people\ alike\,\ all\ the\ while\ trying\ to\ convince\ the\ belligerents\ of\ the\ truth\ she\ has\ learned\ regarding\ their\ environment\.\.\.');
INSERT INTO animes VALUES(65,'Honey\ and\ Clover','\ハ\チ\ミ\ツ\と\ク\ロ\ー\バ\ー','Kasai\ Ken\`ichi',2005,8.2,'http://img7.anidb.net/pics/anime/133493.jpg','\*\ Based\ on\ a\ manga\ by\ http\:\/\/anidb\.net\/cr3031\ \[Umino\ Chika\]\.\\nhttp\:\/\/anidb\.net\/ch7794\ \[Takemoto\ Yuuta\]\,\ http\:\/\/anidb\.net\/ch7800\ \[Mayama\ Takumi\]\ and\ http\:\/\/anidb\.net\/ch7796\ \[Morita\ Shinobu\]\ are\ three\ art\ school\ students\,\ friends\ and\ flat\-mates\.\ Yuuta\,\ the\ freshman\,\ lives\ in\ terror\ of\ Shinobu\,\ a\ very\ erratic\ sculptor\.\\nTheir\ routine\ is\ disrupted\ when\ their\ teacher\,\ http\:\/\/anidb\.net\/ch10225\ \[Hanamoto\ Shuuji\]\,\ introduces\ them\ to\ his\ cousin\`s\ daughter\,\ http\:\/\/anidb\.net\/ch7798\ \[Hanamoto\ Hagumi\]\.\ Even\ though\ she\ has\ already\ entered\ college\,\ she\ still\ looks\ like\ a\ middle\ school\ student\.\ Yet\ despite\ her\ appearance\,\ she\ is\ a\ talented\ sculptor\ and\ painter\ with\ several\ gallery\ showings\ already\ in\ her\ portfolio\.\ Naturally\,\ all\ the\ men\ around\ her\ fall\ in\ love\ with\ her\.\.\.');
INSERT INTO animes VALUES(66,'Maison\ Ikkoku\ TV','\め\ぞ\ん\一\刻','Annou\ Takashi',1986,8.3,'http://img7.anidb.net/pics/anime/157274.jpg','\*\ Based\ on\ the\ manga\ written\ and\ illustrated\ by\ http\:\/\/anidb\.net\/cr818\ \[Takahashi\ Rumiko\]\ and\ serialised\ in\ the\ manga\ magazine\ Big\ Comic\ Spirits\.\\nThe\ story\ takes\ place\ in\ Maison\ Ikkoku\,\ a\ worn\ and\ aging\ boarding\ house\ where\ http\:\/\/anidb\.net\/ch7254\ \[Godai\ Yuusaku\]\,\ a\ 20\ year\ old\ college\ applicant\ lives\.\ Though\ honest\ and\ good\ natured\,\ he\ is\ weak\ willed\ and\ often\ taken\ advantage\ of\ by\ the\ offbeat\ and\ mischievous\ tenants\ who\ live\ with\ him\.\ As\ he\ is\ about\ to\ move\ out\,\ he\ is\ stopped\ at\ the\ door\ by\ the\ young\ and\ beautiful\ http\:\/\/anidb\.net\/ch7253\ \[Otonashi\ Kyouko\]\,\ who\ announces\ she\ will\ be\ taking\ over\ as\ landlord\.\ Godai\ immediately\ falls\ in\ love\ with\ her\ and\ decides\ to\ stay\.\\nLater\,\ Godai\ and\ the\ other\ tenants\ find\ out\ that\ despite\ her\ young\ age\,\ she\ is\ a\ widow\,\ as\ she\ married\ her\ high\ school\ teacher\,\ but\ he\ died\ shortly\ after\ their\ marriage\.\ Godai\ empathizes\ with\ her\ and\ endeavors\ to\ free\ her\ from\ her\ sadness\.\\nHe\ manages\ to\ work\ up\ enough\ courage\ to\ confess\ his\ love\ to\ her\,\ and\ it\ begins\ to\ look\ like\ that\ a\ relationship\ between\ them\ might\ actually\ appear\.\.\.\ until\ Kyouko\ meets\ the\ rich\,\ handsome\,\ and\ charming\ http\:\/\/anidb\.net\/ch7255\ \[Mitaka\ Shun\]\.\ Mitaka\ quickly\ declares\ his\ intention\ to\ court\ Kyouko\ and\ states\ that\ he\ is\ very\ patient\,\ and\ can\ wait\ until\ her\ heart\ is\ ready\.');
INSERT INTO animes VALUES(67,'Hanada','\花\田\少\年\史','Kojima\ Masayuki',2002,8.35,'http://img7.anidb.net/pics/anime/23820.jpg','The\ story\ revolves\ around\ a\ 9\-year\ old\ boy\ by\ the\ name\ of\ Hanada\ Ichiro\ living\ in\ a\ small\-town\ in\ rural\ Japan\.\ He\ is\ a\ menace\ in\ the\ area\ in\ which\ he\ lives\ in\ and\ one\ day\,\ he\ gets\ knocked\ down\ by\ a\ car\ when\ he\`s\ up\ to\ his\ dirty\ pranks\.\ After\ that\ accident\,\ apart\ from\ getting\ a\ nasty\ scar\ and\ going\ bald\,\ he\ is\ able\ to\ see\ ghosts\ and\ monsters\.\ They\ usually\ have\ some\ requests\ for\ him\ to\ fulfill\ which\ annoys\ Ichiro\,\ but\ he\ does\ fulfill\ them\ willingly\ or\ unwillingly\.\ He\ is\ accompanied\ in\ his\ adventures\ by\ his\ friends\ Souta\ and\ Kei\-chan\,\ and\ his\ dog\ Jiro\.\ The\ story\ is\ poignant\ and\ very\ touching\.\\nPartly\ taken\ from\ AnimeNfo');
INSERT INTO animes VALUES(68,'Glass\ Mask\ \(2005\)','\ガ\ラ\ス\の\仮\面\ \(2005\)','Hamatsu\ Mamoru',2005,8.29,'http://img7.anidb.net/pics/anime/4408.jpg','\*\ A\ new\ adaptation\ of\ http\:\/\/anidb\.net\/cr1017\ \[Suzue\ Miuchi\]\`s\ manga\ Glass\ No\ Kamen\.\ The\ original\ story\ dates\ back\ 1976\ when\ Miuchi\ serialised\ it\ in\ Hakusensha\`s\ Hana\ to\ Yume\ Magazine\.\ Mask\ Of\ Glass\ was\ made\ into\ a\ TV\ anime\ in\ 1984\ and\ then\ later\ into\ an\ OAV\ series\ in\ 1998\.\\nHer\ father\ passed\ away\ very\ early\ and\ her\ mother\ lives\ and\ works\ in\ a\ crowded\ Chinese\ restaurant\.\ Kitajima\ Maya\,\ a\ 13\-year\ old\ girl\,\ has\ to\ carry\ the\ burden\ of\ making\ ends\ meet\ as\ she\ fights\ against\ her\ ill\ fate\.\ However\,\ she\ is\ able\ to\ overcome\ the\ trials\ and\ tribulations\ in\ her\ life\ with\ her\ passion\ and\ enthusiasm\.\ She\ happens\ to\ encounter\ the\ reclusive\ actress\ Tsukikage\ who\ decides\ to\ train\ and\ mould\ her\ into\ the\ foremost\ actress\ of\ her\ generation\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(69,'My\ Neighbor\ Totoro','\と\な\り\の\ト\ト\ロ','Miyazaki\ Hayao',1988,8.39,'http://img7.anidb.net/pics/anime/133494.jpg','http\:\/\/anidb\.net\/ch2482\ \[Totoro\]\ is\ a\ forest\ spirit\ that\ little\ http\:\/\/anidb\.net\/ch2481\ \[Mei\]\,\ and\ later\ her\ older\ sister\ http\:\/\/anidb\.net\/ch2480\ \[Satsuki\]\,\ encounter\ in\ a\ giant\ camphor\ tree\ near\ their\ new\ home\ in\ the\ countryside\.\ Although\ their\ father\ http\:\/\/anidb\.net\/ch2479\ \[Kusakabe\ Tatsuo\]\,\ a\ university\ professor\,\ is\ with\ them\ when\ they\ move\,\ their\ mother\ http\:\/\/anidb\.net\/ch2478\ \[Yasuko\]\ is\ in\ the\ hospital\,\ recovering\ from\ some\ unnamed\ illness\.\ When\ Mei\ hears\ that\ her\ mother\`s\ condition\ may\ be\ getting\ worse\,\ she\ resolves\ to\ visit\ her\ all\ by\ herself\.\ When\ everyone\ realizes\ she\ is\ missing\,\ only\ Totoro\ knows\ how\ to\ find\ her\!');
INSERT INTO animes VALUES(70,'Hellsing\ Ultimate','HELLSING','Tokoro\ Tomokazu',2006,8.14,'http://img7.anidb.net/pics/anime/57943.jpg','http\:\/\/anidb\.net\/ch7475\ \[Hellsing\]\,\ a\ secret\ organization\ of\ the\ British\ government\,\ have\ long\ been\ battling\ supernatural\ threats\ to\ keep\ the\ people\ safe\ from\ the\ creatures\ of\ the\ night\.\ The\ current\ leader\,\ http\:\/\/anidb\.net\/ch7468\ \[Integra\ Wingates\ Hellsing\]\ controls\ her\ own\ personal\ army\ to\ eliminate\ the\ undead\ beings\,\ but\ even\ her\ highly\ trained\ soldiers\ pale\ in\ comparison\ to\ her\ most\ trusted\ vampire\ exterminator\,\ a\ man\ by\ the\ name\ of\ http\:\/\/anidb\.net\/ch7466\ \[Alucard\]\,\ who\ is\ actually\ a\ powerful\ vampire\ himself\.\ Along\ with\ Integra\`s\ mysterious\ butler\ and\ Alucard\`s\ new\ vampire\ minion\,\ http\:\/\/anidb\.net\/ch7469\ \[Seras\ Victoria\]\,\ The\ Hellsing\ Organization\ must\ face\ not\ only\ regular\ ghouls\ and\ vampires\,\ but\ a\ rivalling\ secret\ organization\ from\ the\ Vatican\,\ and\ Millennium\,\ an\ enigmatic\ group\ of\ madmen\ spawned\ by\ a\ certain\ war\ over\ 50\ years\ ago\.\.\.\\nA\ bloody\ battle\ between\ monsters\ is\ about\ to\ begin\,\ the\ dead\ are\ dancing\,\ and\ all\ hell\ is\ singing\.\.\.');
INSERT INTO animes VALUES(71,'Future\ Boy\ Conan','\未\来\少\年\コ\ナ\ン','Miyazaki\ Hayao',1978,8.34,'http://img7.anidb.net/pics/anime/144404.jpg','July\ 2008\.\ Mankind\ was\ faced\ with\ the\ threat\ of\ extinction\.\ An\ ultra\-magnetic\ weapon\,\ far\ more\ devastating\ than\ any\ nuclear\ weapon\ known\,\ had\ destroyed\ half\ the\ world\ in\ a\ single\ instant\.\ The\ earth\`s\ crust\ was\ rocked\ by\ massive\ movements\,\ the\ earth\ was\ thrown\ of\ its\ axis\,\ and\ the\ five\ continents\ were\ torn\ completely\ apart\ and\ sank\ deep\ below\ the\ sea\.\.\.\\nThe\ attempt\ by\ a\ number\ of\ people\ to\ free\ \[sic\]\ to\ outer\ space\ failed\.\ Their\ spaceships\ were\ forced\ back\ to\ the\ earth\ and\ vanished\ with\ their\ hopes\ shattered\.\\nBut\ one\ of\ the\ spaceships\ narrowly\ escaped\ destruction\ and\ crashlanded\ on\ a\ small\ island\ which\ had\ miraculously\ survived\ the\ devastation\.\ The\ crew\ members\ of\ the\ spaceship\ settled\ there\,\ as\ if\ they\ were\ seeds\ sown\ on\ the\ island\.\\nAfter\ years\,\ a\ boy\ was\ born\.\ He\ was\ a\ new\ life\ in\ the\ desert\,\ a\ ray\ of\ light\ in\ the\ darkness\ of\ the\ annihilated\ earth\.\.\.\\nAnd\ there\ this\ story\ begins\.');
INSERT INTO animes VALUES(72,'Laputa\:\ Castle\ in\ the\ Sky','\天\空\の\城\ラ\ピ\ュ\タ','Miyazaki\ Hayao',1986,8.19,'http://img7.anidb.net/pics/anime/133583.jpg','A\ young\ girl\,\ http\:\/\/anidb\.net\/ch13889\ \[Sheeta\]\,\ is\ kidnapped\ by\ secret\ agents\ working\ for\ a\ government\.\ Rescued\ by\ the\ boy\ http\:\/\/anidb\.net\/ch13891\ \[Pazu\]\,\ together\ they\ must\ try\ to\ reach\ the\ legendary\ floating\ island\ Laputa\,\ while\ avoiding\ both\ the\ pirates\ and\ the\ army\.');
INSERT INTO animes VALUES(73,'Grave\ of\ the\ Fireflies','\火\垂\る\の\墓','Takahata\ Isao',1988,8.5,'http://img7.anidb.net/pics/anime/144721.jpg','In\ the\ latter\ part\ of\ World\ War\ II\,\ http\:\/\/anidb\.net\/ch8315\ \[Seita\]\ and\ his\ sister\ http\:\/\/anidb\.net\/ch8320\ \[Setsuko\]\,\ orphaned\ when\ their\ http\:\/\/anidb\.net\/ch20056\ \[mother\]\ is\ killed\ in\ the\ firebombing\ of\ Tokyo\,\ are\ left\ to\ survive\ on\ their\ own\ in\ what\ remains\ of\ civilian\ life\ in\ Japan\.\ The\ unfortunate\ siblings\ do\ their\ best\ to\ survive\ in\ the\ Japanese\ countryside\,\ battling\ hunger\,\ prejudice\,\ and\ pride\ in\ their\ own\ quiet\,\ personal\ battle\.');
INSERT INTO animes VALUES(74,'Whisper\ of\ the\ Heart','\耳\を\す\ま\せ\ば','Kondou\ Yoshifumi',1995,8.29,'http://img7.anidb.net/pics/anime/154853.jpg','\*\ Based\ on\ Mimi\ o\ Sumaseba\ \(Whisper\ of\ the\ Heart\)\ by\ http\:\/\/anidb\.net\/cr5645\ \[Hiiragi\ Aoi\]\.\\nMimi\ o\ Sumaseba\,\ which\ literally\ means\ If\ You\ Listen\ Closely\,\ tells\ the\ story\ of\ http\:\/\/anidb\.net\/ch11781\ \[Tsukishima\ Shizuku\]\,\ a\ junior\-high\ school\ student\ who\ is\ struggling\ to\ find\ out\ who\ she\ is\.\ The\ movie\ takes\ you\ on\ a\ journey\ through\ her\ imagination\ and\ daily\ life\ as\ she\ makes\ decisions\ that\ will\ ultimately\ decide\ her\ future\.\\nNote\:\ Screened\ as\ a\ double\ feature\ with\ http\:\/\/anidb\.net\/a754\ \[On\ Your\ Mark\]\.');
INSERT INTO animes VALUES(75,'major2','\メ\ジ\ャ\ー\ \(2005\)','Kasai\ Ken\`ichi',2005,8.15,'http://img7.anidb.net/pics/anime/82957.jpg','The\ story\ stars\ when\ Gorou\ is\ in\ the\ 3rd\ grade\ in\ junior\ high\,\ he\ comes\ back\ to\ Mifune\-cho\.\ Not\ long\ after\ the\ reunion\ of\ childhood\ friend\ including\ Komori\,\ Gorou\ learns\ that\ the\ baseball\ club\ of\ the\ school\ is\ about\ to\ cease\ to\ exist\.\ Noticing\ Komori\,\ who\ is\ the\ leader\ of\ the\ club\,\ works\ hard\ to\ continue\ the\ club\,\ Gorou\ joins\ the\ soccer\ club\.\\nSource\:\ AnimeNfo');
INSERT INTO animes VALUES(76,'Ghost\ in\ the\ Shell\:\ Stand\ Alone\ Complex\ \-\ The\ Laughing\ Man','\攻\殻\機\動\隊\ STAND\ ALONE\ COMPLEX\ The\ Laughing\ Man','Kamiyama\ Kenji',2005,8.38,'http://img7.anidb.net/pics/anime/47675.jpg','In\ 2024\,\ the\ terrorist\ incident\ known\ as\ \"The\ Laughing\ Man\ Incident\"\ occurred\ in\ which\ http\:\/\/anidb\.net\/ch61516\ \[Ernest\ Serano\]\,\ president\ of\ the\ ground\-breaking\ micro\-machine\ company\,\ Sereno\ Genomics\,\ was\ kidnapped\ and\ ransomed\.\\nOne\ day\,\ the\ case\ having\ remained\ unsolved\ for\ six\ years\,\ detective\ http\:\/\/anidb\.net\/ch61506\ \[Yamaguchi\]\,\ who\ has\ been\ investigating\ \"The\ Laughing\ Man\ Incident\"\,\ sends\ word\ that\ he\ wants\ to\ meet\ with\ http\:\/\/anidb\.net\/ch1592\ \[Togusa\]\ from\ Public\ Safety\ Section\ 9\.\ However\,\ soon\ after\ sending\ this\ message\,\ Yamaguchi\,\ crucial\ to\ the\ success\ of\ the\ case\,\ dies\ in\ an\ accident\.\ Many\ days\ pass\ and\ in\ the\ midst\ of\ a\ police\ interview\ relay\ concerning\ suspicions\ behind\ Interceptors\,\ a\ forewarning\ is\ received\ from\ The\ Laughing\ Man\ of\ his\ next\ crime\.\ The\ incorporeal\ hacker\ begins\ to\ move\ once\ again\.\\nSource\:\ ANN\\nNote\:\ This\ is\ a\ 140\ minute\ compilation\ movie\ of\ the\ entire\ Laughing\ Man\ \"complex\"\ stories\ from\ Ghost\ in\ the\ Shell\:\ STAND\ ALONE\ COMPLEX\ season\ 1\ along\ with\ new\ footage\ and\ upgraded\ to\ theatrical\ film\ quality\.');
INSERT INTO animes VALUES(77,'Gintama','\銀\魂\[\ぎ\ん\た\ま\]','Fujita\ Youichi',2006,8.42,'http://img7.anidb.net/pics/anime/64675.jpg','\*\ Based\ on\ the\ popular\ manga\ by\ http\:\/\/anidb\.net\/cr6124\ \[Sorachi\ Hideaki\]\.\\nhttp\:\/\/anidb\.net\/ch1162\ \[Sakata\ Gintoki\]\ is\ a\ samurai\ living\ in\ an\ era\ when\ samurais\ are\ no\ longer\ needed\.\ To\ add\ to\ his\ troubles\,\ oppressive\ aliens\ have\ moved\ in\ to\ invade\.\ Gintoki\ lives\ with\ http\:\/\/anidb\.net\/ch1164\ \[Kagura\]\ and\ http\:\/\/anidb\.net\/ch1163\ \[Shimura\ Shinpachi\]\,\ taking\ on\ odd\ jobs\ to\ make\ the\ world\ a\ better\ place\.\.\.\ and\ to\ pay\ their\ rent\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(78,'The\ Melancholy\ of\ Haruhi\ Suzumiya','\涼\宮\ハ\ル\ヒ\の\憂\鬱','Ishihara\ Tatsuya',2006,8.15,'http://img7.anidb.net/pics/anime/167739.jpg','\*\ Based\ on\ http\:\/\/anidb\.net\/cr536\ \[Tanigawa\ Nagaru\]\`s\ Suzumiya\ Haruhi\ series\ of\ novels\,\ illustrated\ by\ http\:\/\/anidb\.net\/cr518\ \[Itou\ Noizi\]\.\\nhttp\:\/\/anidb\.net\/ch271\ \[Suzumiya\ Haruhi\]\,\ is\ an\ intelligent\ high\ school\ girl\ with\ a\ mischievous\ personality\,\ and\ very\ egocentric\ disposition\,\ and\ upon\ enrolment\ at\ school\ she\ announces\:\\n\"I\ have\ no\ interest\ in\ ordinary\ humans\.\ If\ there\ are\ any\ aliens\,\ beings\ from\ the\ future\,\ or\ super\-humans\,\ come\ see\ me\.\ That\ is\ all\!\"\\nNaturally\,\ this\ did\ raise\ a\ few\ eyebrows\,\ but\ Haruhi\ is\ dead\ serious\.\ Things\ get\ awkward\ when\ everyone\ realises\ just\ how\ serious\ she\ is\ about\ it\ all\ and\ establishes\ the\ SOS\ Brigade\.\ What\ makes\ her\ quite\ ominous\ though\ is\ her\ unimaginable\ power\ to\ actually\ change\ the\ world\,\ but\ she\ is\ totally\ unaware\ of\ her\ own\ power\ and\ so\ she\ is\ also\ unaware\ of\ the\ affect\ of\ her\ power\ on\ the\ outside\ world\.\ The\ cynical\ http\:\/\/anidb\.net\/ch272\ \[Kyon\]\,\ a\ friend\ at\ the\ SOS\ Brigade\,\ is\ among\ the\ few\ who\ knows\ of\ Haruhi\`s\ power\,\ and\ is\ desperately\ trying\ to\ keep\ the\ world\ together\.\\nNote\:\ The\ chronological\ order\ of\ episodes\ is\:\ 2\,\ 3\,\ 5\,\ 10\,\ 13\,\ 14\,\ 4\,\ 7\,\ 6\,\ 8\,\ 1\,\ 12\,\ 11\,\ 9\.');
INSERT INTO animes VALUES(79,'Welcome\ to\ the\ N\.H\.K','NHK\に\よ\う\こ\そ\!','Yamamoto\ Yuusuke',2006,8.42,'http://img7.anidb.net/pics/anime/57839.jpg','\*\ Based\ on\ a\ novel\ by\ http\:\/\/anidb\.net\/cr9201\ \[Takimoto\ Tatsuhiko\]\,\ turned\ into\ a\ manga\ with\ illustration\ by\ http\:\/\/anidb\.net\/cr7424\ \[Ooiwa\ Kenji\]\.\\nhttp\:\/\/anidb\.net\/ch2808\ \[Satou\ Tatsuhiro\]\,\ a\ 22\-year\-old\ socially\ withdrawn\ loner\,\ barricades\ himself\ in\ his\ apartment\,\ subsiding\ on\ a\ meagre\ allowance\ sent\ by\ his\ parents\,\ only\ venturing\ to\ the\ outside\ world\ to\ buy\ food\ under\ cover\ of\ darkness\.\ One\ day\,\ afraid\ he\ might\ miss\ the\ utility\ person\,\ he\ opens\ the\ door\ to\ find\ a\ cute\,\ mysterious\ girl\,\ accompanying\ an\ elderly\ religious\ solicitor\.\\nThrough\ what\ seems\ to\ be\ a\ chain\ of\ coincidences\,\ the\ girl\,\ http\:\/\/anidb\.net\/ch2809\ \[Nakahara\ Misaki\]\,\ enters\ Tatsuhiro\`s\ life\,\ and\ promises\ him\ that\ she\ will\ cure\ him\ of\ his\ anti\-social\ condition\,\ provided\ that\ he\ follows\ the\ rules\ that\ she\ sets\ out\ for\ him\.\\nThis\ takes\ Tatsuhiro\ from\ a\ desperate\ attempt\ at\ creating\ a\ galge\ computer\ game\,\ to\ unwittingly\ joining\ a\ suicide\ cult\,\ to\ participating\ in\ a\ pyramid\ scheme\,\ to\ immersing\ himself\ in\ a\ MMORPG\,\ along\ the\ way\ touching\ upon\ everything\ between\ http\:\/\/anidb\.net\/t876\ \[hikikomori\]\ and\ otaku\ culture\,\ existentialism\,\ solipsism\,\ theology\,\ suicide\,\ sacrifice\ and\ love\.');
INSERT INTO animes VALUES(80,'Nana','\ナ\ナ','Asaka\ Morio',2006,8.3,'http://img7.anidb.net/pics/anime/83987.jpg','One\ day\ http\:\/\/anidb\.net\/ch2763\ \[Komatsu\ Nana\]\ \(Hachi\)\ decides\ to\ go\ to\ Tokyo\ where\ she\ wants\ to\ start\ a\ new\ life\ with\ her\ boyfriend\ http\:\/\/anidb\.net\/ch44455\ \[Shouji\]\.\ There\ are\ only\ a\ few\ seats\ free\ on\ the\ train\ and\ thus\ she\ decides\ to\ sit\ next\ to\ a\ girl\ whose\ name\ is\ http\:\/\/anidb\.net\/ch2762\ \[Oosaki\ Nana\]\.\ As\ a\ vocalist\ Nana\ aims\ for\ a\ debut\ in\ Tokyo\ with\ her\ punk\ band\ Blast\ to\ become\ professional\ musicians\.\ Her\ boyfriend\ http\:\/\/anidb\.net\/ch3999\ \[Ren\]\ already\ made\ it\ as\ a\ guitarist\ for\ the\ famous\ Trapnest\ there\.\\nAfter\ arriving\ in\ Tokyo\ their\ ways\ part\ \—\ or\ so\ it\ seems\.\ When\ searching\ for\ a\ flat\ to\ live\ in\,\ they\ meet\ again\ and\ eventually\ decide\ to\ share\ it\ together\.\ This\ strengthens\ their\ bond\ and\ together\ the\ Nanas\ go\ through\ their\ love\ lives\ and\ career\ in\ Tokyo\.');
INSERT INTO animes VALUES(81,'The\ Girl\ Who\ Leapt\ Through\ Time','\時\を\か\け\る\少\女','Hosoda\ Mamoru',2006,8.67,'http://img7.anidb.net/pics/anime/134156.jpg','Life\ for\ 17\-year\-old\ http\:\/\/anidb\.net\/ch2748\ \[Konno\ Makoto\]\ is\ filled\ with\ fun\ days\ at\ school\ and\ hanging\ out\ with\ her\ two\ best\ friends\,\ http\:\/\/anidb\.net\/ch2749\ \[Chiaki\]\ and\ http\:\/\/anidb\.net\/ch2750\ \[Kousuke\]\.\ But\ then\ she\ finds\ herself\ with\ an\ ominous\ ability\ to\ leap\ back\ in\ time\.\ A\ truly\ strange\ ability\ that\ at\ first\ saves\ her\ life\,\ but\ then\ allows\ her\ to\ not\ be\ late\ at\ school\,\ to\ know\ the\ answers\ on\ any\ surprise\ exams\ and\ to\ avoid\ any\ troublesome\ mishaps\.\ It\ is\ only\ when\ Makoto\ chooses\ to\ use\ this\ ability\ to\ avoid\ some\ of\ the\ more\ personal\ issues\ that\ arise\ with\ her\ friends\,\ that\ events\ become\ both\ complex\ and\ painfully\ difficult\ \—\ the\ simple\ gift\ that\ she\ began\ to\ take\ for\ granted\ suddenly\ becomes\ a\ troublesome\ burden\.\\nNote\:\ Winner\ 6th\ Annual\ Tokyo\ Anime\ Awards\ \(2007\)\ \—\ Anime\ Movie\,\ and\ 2006\ Winner\ of\ Mainichi\ Award\ \(http\:\/\/anidb\.net\/cr5602\ \[Oofuji\ Noburou\]\ Award\)\.');
INSERT INTO animes VALUES(82,'Aria\ the\ Natural','ARIA\ The\ NATURAL','Satou\ Jun\`ichi',2006,8.41,'http://img7.anidb.net/pics/anime/83665.jpg','In\ a\ continuation\ of\ the\ last\ series\,\ http\:\/\/anidb\.net\/ch1286\ \[Mizunashi\ Akari\]\ continues\ her\ job\ as\ a\ gondolier\ along\ with\ her\ friends\ from\ the\ other\ two\ rival\ companies\,\ http\:\/\/anidb\.net\/ch8498\ \[Aika\]\ and\ http\:\/\/anidb\.net\/ch8499\ \[Alice\]\.\ As\ they\ continue\ their\ training\ to\ become\ Undines\,\ they\ continue\ to\ meet\ new\ people\ and\ partake\ on\ mysterious\ adventures\,\ all\ in\ the\ quiet\,\ scenic\,\ and\ peaceful\ city\ of\ Neo\ Venezia\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(83,'Ghost\ in\ the\ Shell\:\ S\.A\.C\.\ 2nd\ GIG\ \-\ Individual\ Eleven','\攻\殻\機\動\隊\ S\.A\.C\.\ 2nd\ GIG\ Individual\ Eleven','Kamiyama\ Kenji',2006,8.28,'http://img7.anidb.net/pics/anime/83850.jpg','Compilation\ movie\ of\ the\ \"Individual\ Eleven\"\ story\ from\ Ghost\ in\ the\ Shell\:\ SAC\ 2nd\ Gig\ series');
INSERT INTO animes VALUES(84,'Den\-noh\ Coil','\電\脳\コ\イ\ル','Iso\ Mitsuo',2007,8.36,'http://img7.anidb.net/pics/anime/12711.jpg','In\ this\ future\,\ a\ mobile\ phone\ like\ technology\ has\ people\ wear\ special\ visors\ to\ superimpose\ coordinated\,\ instant\ virtual\ images\ over\ the\ top\ of\ their\ everyday\ real\ world\.\ This\ cyberspace\ layer\,\ space\,\ interacts\ perfectly\ as\ you\ move\ about\ or\ touch\ things\.\ It\ even\ allows\ children\ to\ have\ advanced\ Tamagotchi\ style\ cyberpets\ \(very\ tidy\!\)\,\ or\ to\ make\ video\ calls\ using\ simple\ hand\ gestures\ alone\.\\nHowever\,\ something\ is\ happening\ in\ Daikoku\ which\ the\ adults\ have\ not\ yet\ noticed\.\ Cyberpets\ go\ missing\,\ dangerous\ spherical\ robots\ patrol\ the\ skies\ and\ a\ mysterious\ gigantic\ character\ named\ Satchii\ seems\ connected\ to\ it\ all\.\\nWhen\ 6th\ grader\ Yasako\ moves\ to\ Daikoku\ to\ be\ with\ family\,\ her\ beloved\ pet\ goes\ missing\ too\,\ and\ she\ is\ drawn\ into\ the\ affairs\ of\ a\ Cyberpet\ Recovery\ Agency\ run\ by\ the\ local\ children\.');
INSERT INTO animes VALUES(85,'Moribito\:\ Guardian\ of\ the\ Spirit','\精\霊\の\守\り\人','Kamiyama\ Kenji',2007,8.48,'http://img7.anidb.net/pics/anime/7809.jpg','\*\ Based\ on\ a\ fantasy\ novel\ by\ http\:\/\/anidb\.net\/cr6977\ \[Uehashi\ Naoko\]\ \&\ Futatsugi\ Saki\.\\nOnce\ every\ 100\ years\,\ a\ water\ spirit\ implants\ an\ egg\ into\ a\ person\ who\ then\ becomes\ the\ Guardian\ of\ the\ Sacred\ Spirit\.\ This\ time\,\ the\ responsibility\ falls\ on\ http\:\/\/anidb\.net\/ch8750\ \[Chagum\]\,\ the\ Second\ Prince\ of\ the\ New\ Yogo\ Empire\.\ The\ Emperor\,\ fearing\ that\ the\ spirit\`s\ possession\ of\ Chagum\ could\ destroy\ the\ prestige\ of\ the\ royal\ family\,\ attempts\ to\ have\ Chagum\ killed\.\ As\ a\ result\,\ the\ Second\ Empress\ secretly\ asks\ a\ female\ bodyguard\,\ http\:\/\/anidb\.net\/ch8748\ \[Balsa\]\,\ to\ abscond\ with\ Chagum\.');
INSERT INTO animes VALUES(86,'Kanon','Kanon\ \(2006\)','Ishihara\ Tatsuya',2006,8.25,'http://img7.anidb.net/pics/anime/167727.jpg','\*\ Based\ on\ http\:\/\/anidb\.net\/cr1046\ \[Visual\ Art\`s\/Key\]\`s\ visual\ novel\ by\ the\ same\ name\.\\n\"One\ snowy\ winter\`s\ day\.\.\.\ I\ sit\ on\ a\ bench\ near\ the\ station\,\ waiting\ to\ meet\ my\ cousin\ http\:\/\/anidb\.net\/ch7910\ \[Minase\ Nayuki\]\;\ it\ has\ been\ seven\ years\ since\ I\ last\ saw\ her\.\ This\ place\ is\ far\ from\ the\ town\ where\ I\ was\ born\ and\ lived\ until\ yesterday\.\ This\ is\ where\ Nayuki\ lives\ with\ her\ mother\,\ who\ has\ offered\ to\ take\ me\ in\,\ now\ that\ I\ am\ forced\ to\ move\ so\ suddenly\.\ And\ this\ is\ the\ town\ in\ which\ my\ faintest\,\ cloudiest\ childhood\ memories\ are\ set\.\.\.\"\ \—\ Yuuichi\\nA\ young\ man\,\ http\:\/\/anidb\.net\/ch7908\ \[Aizawa\ Yuuichi\]\,\ gets\ off\ a\ train\ and\ leaves\ the\ station\ as\ he\ enters\ a\ town\ that\ is\ blanketed\ by\ snow\.\ He\ left\ the\ area\ seven\ years\ ago\ and\ has\ now\ returned\ to\ his\ memories\ that\ he\ left\ behind\.\ Although\ his\ past\ is\ blurry\ in\ his\ mind\,\ the\ girls\ that\ still\ remember\ him\ and\ that\ he\ had\ relationships\ with\ begin\ to\ help\ him\ remember\.\ While\ this\ happens\,\ the\ bad\ memories\ of\ his\ past\ also\ begin\ to\ come\ back\,\ and\ will\ eventually\ haunt\ him\.');
INSERT INTO animes VALUES(87,'Ghost\ in\ the\ Shell\:\ Stand\ Alone\ Complex\ \-\ Solid\ State\ Society','\攻\殻\機\動\隊\ Stand\ Alone\ Complex\ \-\ Solid\ State\ Society','Kamiyama\ Kenji',2006,8.4,'http://img7.anidb.net/pics/anime/47677.jpg','\*\ Directed\ by\ Kamiyama\ Kenji\ and\ with\ the\ participation\ of\ the\ same\ staff\ from\ the\ popular\ series\,\ GitS\:\ SAC\,\ this\ full\-length\ 105\ minute\ feature\ premi\èred\ in\ Japan\ on\ the\ SKYPerfecTV\!\ satellite\ television\ network\ on\ September\ 1st\,\ and\ was\ successively\ released\ on\ DVD\ on\ November\ 24th\.\\nAD\ 2034\.\ It\ has\ been\ two\ years\ since\ Kusanagi\ Motoko\ left\ Section\ 9\.\ Togusa\ is\ now\ the\ new\ leader\ of\ the\ team\,\ that\ has\ considerably\ increased\ its\ appointed\ personnel\.\ The\ expanded\ new\ Section\ 9\ confronts\ a\ rash\ of\ complicated\ incidents\,\ and\ investigations\ reveal\ that\ an\ ultra\-wizard\ hacker\ named\ the\ Puppeteer\ is\ behind\ the\ entire\ series\ of\ events\.\\nIn\ the\ midst\ of\ it\ all\,\ Batou\,\ who\ was\ following\ the\ case\ on\ a\ separate\ track\,\ encounters\ Motoko\.\ But\ after\ saying\,\ \"Stay\ away\ from\ the\ Solid\ State\ Society\"\,\ she\ quickly\ leaves\.\ This\ makes\ Batou\ wonder\:\ Could\ Motoko\ be\ the\ Puppeteer\?\\nThe\ series\ of\ intriguing\ incidents\ that\ Section\ 9\ faces\ gradually\ link\ together\ \—\ almost\ artistically\.\ Who\ is\ the\ Puppeteer\?\ What\ will\ happen\ to\ Batou\`s\ relationship\ with\ Motoko\?\ What\ is\ the\ full\ truth\ behind\ this\ carefully\ planned\ perfect\ crime\?\ And\ what\ will\ the\ outcome\ be\?\ Mysteries\ surround\ the\ Solid\ State\ Society\.\.\.\\nSource\:\ Production\ I\.G\`s\ GitS\:\ SAC\ SSS\ page\ \(www\.productionig\.com\/contents\/works_sp\/47_\)');
INSERT INTO animes VALUES(88,'Honey\ and\ Clover\ II','\ハ\チ\ミ\ツ\と\ク\ロ\ー\バ\ー\ II','Nagai\ Tatsuyuki',2006,8.49,'http://img7.anidb.net/pics/anime/133480.jpg','\*\ Based\ on\ a\ manga\ by\ http\:\/\/anidb\.net\/cr3031\ \[Umino\ Chika\]\.\\nBackground\:\ http\:\/\/anidb\.net\/ch7794\ \[Takemoto\ Yuuta\]\,\ http\:\/\/anidb\.net\/ch7800\ \[Mayama\ Takumi\]\ and\ http\:\/\/anidb\.net\/ch7796\ \[Morita\ Shinobu\]\ are\ three\ art\ school\ students\,\ friends\ and\ flat\-mates\.\ Their\ routine\ is\ disrupted\ when\ the\ very\ talented\ sculptor\ and\ painter\ http\:\/\/anidb\.net\/ch7798\ \[Hanamoto\ Hagumi\]\,\ a\ college\ student\ who\ still\ looks\ like\ a\ middle\ school\ girl\,\ enters\ their\ lives\.\\nThe\ love\ triangles\ and\ tribulations\ they\ face\ continue\,\ and\ eventually\ decide\ the\ paths\ to\ their\ future\.');
INSERT INTO animes VALUES(89,'Code\ Geass\:\ Lelouch\ of\ the\ Rebellion','\コ\ー\ド\ギ\ア\ス\ \反\逆\の\ル\ル\ー\シ\ュ','Taniguchi\ Gorou',2006,8.61,'http://img7.anidb.net/pics/anime/9245.jpg','Japan\ has\ been\ invaded\ and\ conquered\ by\ the\ http\:\/\/anidb\.net\/ch15617\ \[Britannian\ Empire\]\.\ Japan\ is\ now\ known\ as\ Area\ 11\ and\ its\ citizens\ known\ as\ Elevens\.\ The\ Britannian\ Empire\ takes\ away\ Japan\`s\ autonomous\ power\ and\ imposes\ its\ rule\ through\ the\ use\ of\ Knightmares\.\ The\ Empire\`s\ rule\ has\ never\ faltered\,\ but\ cracks\ have\ begun\ to\ show\.\.\.\\nSource\:\ ANN\\nThe\ Britannian\ youth\,\ http\:\/\/anidb\.net\/ch103\ \[Lelouch\]\,\ received\ a\ special\ power\ from\ a\ mysterious\ girl\.\ GEASS\.\ An\ absolute\ power\ which\ allows\ the\ user\ to\ give\ orders\ to\ anyone\.\ Lelouch\ decided\ to\ plan\ the\ destruction\ of\ the\ Britannian\ Empire\ by\ using\ this\ as\ a\ weapon\.\ His\ goals\ are\ to\ take\ revenge\ for\ his\ http\:\/\/anidb\.net\/ch15620\ \[mother\]\,\ and\ to\ create\ a\ world\ in\ which\ his\ little\ sister\,\ http\:\/\/anidb\.net\/ch2000\ \[Nunnally\]\,\ could\ live\ in\ peace\.\ All\ while\ knowing\ that\ what\ lies\ ahead\ is\ his\ http\:\/\/anidb\.net\/ch10629\ \[father\]\,\ the\ Emperor\ of\ Britannia\.');
INSERT INTO animes VALUES(90,'major3','\メ\ジ\ャ\ー\ \(2007\)','Fukushima\ Toshinori',2007,8.15,'http://img7.anidb.net/pics/anime/18309.jpg','After\ leaving\ Kaido\,\ Gorou\ wanted\ to\ go\ back\ to\ Mifune\ in\ order\ to\ challenge\ the\ Kaido\ players\,\ but\ once\ he\ got\ there\ he\ saw\ that\ the\ team\ has\ been\ improving\ greatly\ on\ their\ own\ efforts\.\ Not\ wanting\ to\ disorganize\ the\ team\ he\ dropped\ his\ plan\ on\ enrolling\ back\ to\ Mifune\ and\ turned\ his\ eyes\ to\ Edawara\ High\,\ but\ his\ enrollment\ was\ rejected\ due\ to\ interference\ of\ Kaido\ Asst\.\ Director\ Egashira\.\\nGorou\ finally\ avoided\ Egashira\`s\ interference\ and\ went\ to\ Seishuu\ High\ which\ did\ not\ have\ a\ baseball\ club\ yet\.\ Gorou\ decided\ that\ he\ himself\ will\ put\ up\ a\ team\ consisting\ of\ the\ very\ few\ boys\ of\ Seishuu\ High\ \(previously\ an\ all\-girls\ high\ school\)\.\ Will\ Gorou\ succeed\ in\ establishing\ a\ team\?\ If\ so\,\ will\ the\ team\ be\ able\ to\ make\ it\ to\ Koshien\?\ Will\ they\ face\ Kaido\?\\nSource\:\ AnimeNfo');
INSERT INTO animes VALUES(91,'Death\ Note','DEATH\ NOTE','Araki\ Tetsurou',2006,8.56,'http://img7.anidb.net/pics/anime/59878.jpg','Bored\ with\ his\ deteriorating\ world\ and\ the\ laconic\ way\ of\ his\ fellows\,\ shinigami\ Ryuuk\ drops\ his\ Death\ Note\ on\ Earth\ and\ watches\ to\ see\ if\ it\ stirs\ up\ anything\ interesting\.\ His\ plan\ succeeds\ beyond\ his\ wildest\ expectations\ when\ the\ Death\ Note\ is\ found\ by\ brilliant\ high\ school\ senior\ Light\ Yagami\,\ who\ is\ also\ bored\ with\ a\ world\ he\ considers\ rotten\.\ Although\ initially\ he\ regards\ the\ book\ as\ a\ prank\,\ Light\ soon\ discovers\,\ through\ experimentation\,\ that\ the\ book\`s\ claim\ is\ true\:\ picture\ a\ person\ in\ your\ mind\ as\ you\ write\ the\ person\`s\ name\ in\ the\ Death\ Note\,\ and\ that\ person\ dies\ 40\ seconds\ later\ of\ of\ a\ heart\ attack\ \(although\ a\ different\ time\ frame\ and\ manner\ of\ death\ can\ be\ specified\)\.\ Armed\ with\ that\ power\,\ Light\ sets\ out\ on\ a\ quest\ he\ sees\ as\ noble\:\ make\ the\ world\ a\ better\ place\ by\ eliminating\ all\ its\ criminals\ using\ the\ Death\ Note\.\ Soon\ cast\ as\ the\ mysterious\ \"Kira\"\ \(a\ Japanese\ pronunciation\ of\ the\ English\ \"killer\"\)\ in\ the\ media\ and\ on\ the\ Internet\,\ some\ take\ exception\ to\ his\ playing\ god\,\ most\ notably\ the\ police\ and\ the\ enigmatic\ master\ detective\ L\,\ who\ resolves\ to\ do\ everything\ in\ his\ power\ to\ stop\ Kira\.\ Light\ counters\ by\ doing\ everything\ in\ his\ power\ to\ prevent\ people\ from\ identifying\ or\ interfering\ with\ him\,\ even\ if\ that\ means\ getting\ rid\ of\ people\ investigating\ him\.');
INSERT INTO animes VALUES(92,'5\ Centimeters\ per\ Second','\秒\速5\セ\ン\チ\メ\ー\ト\ル','Shinkai\ Makoto',2007,8.24,'http://img7.anidb.net/pics/anime/22319.jpg','This\ is\ the\ story\ of\ two\ close\ friends\,\ http\:\/\/anidb\.net\/ch4062\ \[Toono\ Takaki\]\ and\ http\:\/\/anidb\.net\/ch4063\ \[Shinohara\ Akari\]\,\ who\ became\ separated\ by\ space\ and\ time\:\\nPart\ 1\ \—\ The\ Chosen\ Cherry\ Blossoms\ \(26\ min\.\)\:\ Because\ of\ family\ relocation\,\ Shinohara\ Akari\ had\ to\ leave\ Tokyo\ after\ graduating\ from\ elementary\ school\.\ The\ strong\ feelings\ between\ Takaki\ and\ Akari\ keep\ them\ in\ contact\,\ but\ they\ worry\ that\ they\ may\ not\ meet\ again\.\ Then\,\ one\ day\,\ Takaki\ learns\ that\ his\ family\ will\ move\ from\ Tokyo\ to\ an\ island\ in\ the\ far\ south\ of\ Japan\,\ so\ he\ decides\ to\ use\ this\ last\ chance\ to\ visit\ Akari\ by\ train\.\.\.\\nPart\ 2\ \—\ Cosmonaut\ \(21\ min\.\)\:\ Years\ have\ passed\,\ and\ Takaki\ still\ writes\ emails\ meant\ for\ Akari\,\ only\ to\ never\ send\ them\ to\ her\.\ Meanwhile\ http\:\/\/anidb\.net\/ch7782\ \[Sumita\ Kanae\]\,\ his\ classmate\,\ has\ feelings\ for\ Takaki\,\ but\ she\ does\ not\ have\ the\ courage\ to\ confess\ her\ love\ to\ him\.\.\.\\nPart\ 3\ \—\ 5\ Centimetres\ per\ Second\ \(16\ min\.\,\ mostly\ a\ music\ clip\)\:\ Takaki\ is\ working\ as\ computer\ programmer\ now\,\ occasionally\ remembering\ his\ former\ life\ \—\ and\ love\.\ And\ one\ day\,\ at\ a\ railroad\ crossing\,\ he\ suddenly\ passes\ by\ a\ woman\ who\ looks\ familiar\ to\ him\.\.\.\\n\—\ written\ by\ DD\ of\ Mikomi\,\ edited');
INSERT INTO animes VALUES(93,'Gurren\ Lagann','\天\元\突\破\ \グ\レ\ン\ラ\ガ\ン','Imaishi\ Hiroyuki',2007,8.68,'http://img7.anidb.net/pics/anime/7808.jpg','In\ the\ distant\ future\,\ people\ build\ their\ homes\ and\ raise\ domestic\ animals\ in\ subterranean\ caverns\ called\ \"pits\"\.\ This\ way\ of\ life\ has\ persisted\ for\ hundreds\ of\ years\,\ and\ yet\,\ the\ people\ are\ still\ powerless\ against\ the\ earthquakes\ and\ cave\-ins\ which\ occasionally\ devastate\ their\ villages\.\ Jeeha\ is\ one\ such\ village\.\.\.\\nOne\ day\,\ while\ digging\ tunnels\ to\ expand\ Jeeha\`s\ edges\,\ a\ boy\ named\ http\:\/\/anidb\.net\/ch469\ \[Simon\]\ happens\ to\ find\ a\ small\,\ shiny\ drill\.\ Meanwhile\,\ http\:\/\/anidb\.net\/ch468\ \[Kamina\]\ \—\ Simon\`s\ soon\-to\-be\ \"bro\"\ \—\ insists\ that\ there\ is\ another\ land\ above\ the\ village\ and\ tries\ to\ break\ through\ the\ ceiling\ in\ order\ to\ leave\ the\ cavern\.\ He\ fails\;\ however\,\ an\ earthquake\ suddenly\ occurs\,\ the\ ceiling\ collapses\,\ and\ a\ gigantic\ robot\ \—\ a\ \"Ganmen\"\ \—\ crashes\ to\ the\ cave\ floor\!\\nKamina\ is\ now\ certain\ that\ there\ is\ a\ world\ above\ their\ tiny\ pit\-village\.\ Encouraged\,\ he\ begins\ to\ fight\ recklessly\ against\ the\ robot\,\ until\ he\ encounters\ another\ person\ who\ has\ arrived\ from\ the\ land\ above\.\ She\ is\ a\ beautiful\ girl\ by\ the\ name\ of\ http\:\/\/anidb\.net\/ch470\ \[Youko\]\,\ who\ has\ come\ from\ a\ neighbouring\ village\ with\ a\ rifle\ in\ hand\.\ She\ has\ been\ hunting\ the\ robot\,\ but\ her\ shots\ only\ seem\ to\ irritate\ it\.\ Desperately\ trying\ to\ escape\ its\ attacks\,\ Simon\ brings\ Kamina\ and\ Youko\ to\ what\ he\ had\ previously\ found\:\ a\ mysterious\ robot\ with\ a\ head\ for\ a\ body\.\\nAnd\ so\ begins\ the\ \"epic\"\ adventure\.\.\.\\nSource\:\ AnimeNfo');
INSERT INTO animes VALUES(94,'Black\ Lagoon\:\ The\ Second\ Barrage','BLACK\ LAGOON\ The\ Second\ Barrage','Katabuchi\ Sunao',2006,8.27,'http://img7.anidb.net/pics/anime/131092.jpg','Okajima\ Rokuro\ \—\ now\ known\ almost\ exclusively\ as\ http\:\/\/anidb\.net\/ch1194\ \[Rock\]\ \—\ was\ once\ a\ typical\,\ put\-upon\ Japanese\ businessman\.\ Then\,\ on\ a\ routine\ business\ trip\,\ he\ was\ kidnapped\ and\ ransomed\ by\ the\ Lagoon\ Company\ \—\ a\ band\ of\ mercenary\ pirates\ operating\ out\ of\ the\ crime\-riddled\ city\ of\ Roanapur\.\ Abandoned\ by\ his\ bosses\,\ he\ joined\ the\ Lagoon\ Company\.\ Now\ he\ must\ try\ and\ stay\ afloat\ amongst\ the\ ever\-shifting\ politics\ of\ the\ criminal\ underworld\,\ while\ simultaneously\ avoiding\ death\ at\ the\ hands\ of\ his\ quick\-tempered\,\ gun\-toting\ co\-worker\,\ \`Two\ Hand\`\ http\:\/\/anidb\.net\/ch1191\ \[Revy\]\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(95,'Nodame\ Cantabile','\の\だ\め\カ\ン\タ\ー\ビ\レ','Kasai\ Ken\`ichi',2007,8.99,'http://img7.anidb.net/pics/anime/84035.jpg','\*\ Based\ on\ the\ awarded\ shoujo\ manga\ by\ http\:\/\/anidb\.net\/cr558\ \[Ninomiya\ Tomoko\]\.\\nhttp\:\/\/anidb\.net\/ch2128\ \[Chiaki\ Shin\`ichi\]\ is\ the\ top\ piano\ student\ at\ his\ university\ and\ an\ excellent\ violinist\,\ but\ Chiaki\ doesn\`t\ care\ about\ playing\ these\ instruments\ as\ much\ as\ he\ dreams\ of\ someday\ being\ a\ conductor\.\ Chiaki\,\ however\,\ has\ several\ deeply\ rooted\ fears\ about\ traveling\,\ and\ so\ finds\ himself\ trapped\ in\ Japan\.\ Because\ he\`s\ trapped\,\ Chiaki\ starts\ to\ question\ exactly\ how\ far\ he\ can\ possibly\ go\ in\ music\,\ especially\ when\ he\`s\ passed\ over\ again\ and\ again\ for\ others\ he\ thinks\ are\ less\ worthy\ of\ musical\ scholarship\ and\ fame\.\\nRecently\ dumped\ by\ his\ girlfriend\ for\ a\ sausage\ looking\ fellow\,\ passed\ over\ for\ a\ chance\ to\ go\ overseas\,\ removed\ from\ his\ star\ spot\ in\ the\ piano\ competition\ because\ he\ walked\ out\ on\ his\ piano\ instructor\,\ Chiaki\ is\ at\ his\ limit\.\ This\ is\ when\ he\ meets\ http\:\/\/anidb\.net\/ch2106\ \[Nodame\]\,\ or\ Noda\ Megumi\.\ Nodame\ is\ a\ free\ \—\ if\ filthy\ \—\ spirit\ who\ reminds\ Chiaki\ that\ music\ can\ be\ fun\.\ She\ reminds\ him\ what\ drew\ him\ to\ be\ a\ conductor\ in\ the\ first\ place\ and\,\ in\ learning\ how\ to\ deal\ with\ Nodame\,\ Chiaki\ learns\ how\ to\ deal\ with\ others\.\ Chiaki\ begins\ to\ realize\ what\ is\ possible\ for\ him\,\ even\ on\ the\ tiny\ island\ of\ Japan\.\\nFor\ Nodame\,\ Chiaki\ is\ everything\ she\ isn\`t\.\ Clean\,\ neat\,\ dedicated\,\ studious\ and\ inherently\ arrogant\ about\ his\ accomplishments\ and\ capabilities\,\ Chiaki\ constantly\ bullies\ her\ into\ being\ more\ serious\ about\ life\.\ He\ sees\ potential\ in\ her\ and\ her\ abilities\ as\ a\ pianist\ that\ she\ doesn\`t\ care\ about\.\ Nodame\ loves\ Chiaki\ and\ wants\ to\ be\ with\ him\,\ but\,\ because\ she\`s\ not\ serious\ about\ her\ piano\ studies\ nor\ her\ personal\ hygiene\,\ Chiaki\ denies\ her\ affections\ again\ and\ again\.\\nBut\ Chiaki\ and\ Nodame\ complete\ each\ other\ in\ ways\ no\ other\ can\,\ a\ musical\ complement\ that\ neither\ of\ them\ can\ completely\ escape\ entirely\.\ Watching\ them\ grow\ as\ people\ and\ musicians\,\ and\ even\ as\ a\ couple\,\ is\ an\ interesting\ ride\.');
INSERT INTO animes VALUES(96,'Emma\:\ A\ Victorian\ Romance\ Season\ 2','\英\國\戀\物\語\エ\マ\ \~\メ\ル\ダ\ー\ス\編\~','Kobayashi\ Tsuneo',2007,8.18,'http://img7.anidb.net/pics/anime/13794.jpg','\*\ Based\ on\ the\ historical\ romance\ manga\ by\ http\:\/\/anidb\.net\/cr9465\ \[Mori\ Kaoru\]\,\ which\ was\ published\ by\ http\:\/\/anidb\.net\/cr1279\ \[Enterbrain\]\ in\ the\ magazine\ Comic\ Beam\.\\nIt\`s\ been\ a\ month\ since\ http\:\/\/anidb\.net\/ch3221\ \[Emma\]\ left\ London\ and\ reluctantly\ ending\ her\ relationship\ with\ http\:\/\/anidb\.net\/ch3222\ \[William\ Jones\]\,\ due\ to\ their\ difference\ in\ class\ status\.\ She\ has\ found\ a\ new\ job\,\ and\ a\ fresh\ start\,\ as\ one\ of\ the\ many\ maids\ working\ in\ the\ Molders\ family\ estate\.\ Her\ presence\ soon\ catches\ the\ eye\ and\ respect\ of\ sullen\ but\ kind\-hearted\ footman\ http\:\/\/anidb\.net\/ch3228\ \[Hans\]\.\ Meanwhile\,\ http\:\/\/anidb\.net\/ch3225\ \[Eleanor\ Campbell\]\ makes\ her\ move\ to\ win\ William\`s\ heart\.\ However\,\ Emma\ and\ William\ have\ yet\ to\ realise\ that\ they\ will\ meet\ again\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(97,'Evangelion\:\ 1\.0\ You\ Are\ \(Not\)\ Alone','\ヱ\ヴ\ァ\ン\ゲ\リ\ヲ\ン\新\劇\場\版\:\序','Masayuki',2007,8.29,'http://img7.anidb.net/pics/anime/48905.jpg','In\ 2015\,\ fifteen\ years\ after\ a\ global\ cataclysm\ known\ as\ the\ Second\ Impact\,\ http\:\/\/anidb\.net\/ch309\ \[Ikari\ Shinji\]\ is\ summoned\ to\ the\ city\ of\ Tokyo\-3\ by\ his\ estranged\ father\ http\:\/\/anidb\.net\/ch5000\ \[Gendou\]\,\ the\ Supreme\ Commander\ of\ http\:\/\/anidb\.net\/ch5009\ \[NERV\]\.\ When\ he\ is\ caught\ in\ the\ crossfire\ between\ UN\ forces\ and\ the\ Fourth\ Angel\,\ Lt\.\ Colonel\ http\:\/\/anidb\.net\/ch5007\ \[Katsuragi\ Misato\]\ rescues\ Shinji\ and\ brings\ him\ to\ NERV\ Headquarters\.\ Gendou\ then\ forces\ Shinji\ into\ piloting\ http\:\/\/anidb\.net\/ch8704\ \[Evangelion\ Unit\-01\]\,\ a\ large\ mecha\,\ against\ the\ Angel\.\ Shinji\ initially\ declines\,\ but\ then\ concedes\ when\ Gendou\ threatens\ to\ send\ http\:\/\/anidb\.net\/ch310\ \[Ayanami\ Rei\]\,\ a\ heavily\ bandaged\ Evangelion\ pilot\,\ into\ battle\.\\nShinji\ pilots\ Unit\-01\ and\ wins\ the\ fight\ after\ it\ goes\ berserk\ and\ destroys\ the\ Angel\.\ Afterwards\,\ Shinji\ is\ taken\ in\ by\ Misato\ as\ her\ new\ housemate\ and\ enrolled\ in\ the\ local\ middle\ school\.\ Shinji\ tries\ to\ settle\ in\ with\ his\ new\-found\ life\ alongside\ Misato\,\ Rei\,\ and\ the\ others\ while\ he\ receives\ training\ to\ defend\ Tokyo\-3\ and\ the\ world\ from\ the\ coming\ Angels\.\.\.\\nSource\:\ Wikipedia');
INSERT INTO animes VALUES(98,'When\ They\ Cry\:\ Kai','\ひ\ぐ\ら\し\の\な\く\頃\に\解','Kon\ Chiaki',2007,8.38,'http://img7.anidb.net/pics/anime/94325.jpg','\*\ Based\ on\ the\ murder\-mystery\ style\ http\:\/\/anidb\.net\/t4207\ \[doujin\]\ visual\ novel\ series\ produced\ by\ http\:\/\/anidb\.net\/cr1339\ \[07th\ Expansion\]\.\\nSounds\ of\ cicadas\ can\ be\ heard\ in\ the\ late\ evening\,\ in\ the\ village\ of\ Hinamizawa\ \—\ with\ a\ population\ of\ 2000\ souls\.\ And\ even\ though\ the\ village\ may\ seem\ normal\ at\ first\ glance\,\ the\ villagers\ try\ to\ hide\ a\ horrible\ secret\ from\ newcomers\:\ The\ curse\ of\ Oyashiro\-sama\.\ Unusual\ murders\ have\ been\ occurring\ ever\ since\ the\ dam\ construction\ plan\.\ Is\ this\ a\ coincidence\ or\ part\ of\ a\ sinister\ plan\ unfolding\?\\nNote\:\ Kai\ \(\解\)\ means\ solution\,\ and\ the\ anime\ will\ consist\ of\ the\ last\ two\ solution\ arcs\ \"Minagoroshi\-hen\ \(Massacre\ Chapter\)\"\ and\ \"Matsuribayashi\-hen\ \(Festival\ Accompanying\ Chapter\)\"\.\ The\ Kai\ series\ will\ also\ consist\ of\ an\ anime\ exclusive\ story\ arc\:\ \"Yakusamashi\-hen\ \(Another\ Increase\ Chapter\)\"\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(99,'Baccano\!','\バ\ッ\カ\ー\ノ\!','Oomori\ Takahiro',2007,8.59,'http://img7.anidb.net/pics/anime/148819.jpg','Baccano\!\ \(which\ translates\ to\ \"ruckus\"\ or\ \"stupid\ commotion\"\)\ focuses\ on\ the\ stories\ of\ different\ characters\ in\ the\ Prohibition\ Era\ of\ America\.\ Originating\ back\ to\ 1711\,\ a\ group\ of\ alchemists\ seeking\ eternal\ youth\ are\ given\ a\ special\ potion\ by\ a\ mysterious\ demon\,\ making\ them\ immortal\.\ However\,\ alchemists\ began\ disappearing\,\ and\ realizing\ the\ danger\ of\ being\ close\ to\ one\ another\ they\ scatter\ around\ the\ world\.\\nNow\ in\ the\ 1930\`s\,\ all\ of\ the\ immortals\ have\ come\ together\ once\ again\.\ Baccano\!\ tells\ the\ stories\ of\ each\ of\ these\ immortals\,\ ranging\ from\ alchemists\,\ street\ gangs\,\ thieves\,\ FBI\ agents\ and\ even\ the\ mafia\.\\nSource\:\ Absolute\ Anime\\nNote\:\ the\ 3\ special\ episodes\ that\ were\ included\ with\ the\ DVD\ releases\ directly\ continue\ the\ story\ of\ the\ TV\ series\.');
INSERT INTO animes VALUES(100,'The\ Garden\ of\ Sinners','\劇\場\版\ \空\の\境\界\ the\ Garden\ of\ sinners','Aoki\ Ei',2007,8.38,'http://img7.anidb.net/pics/anime/93751.jpg','\*\ Based\ on\ a\ novel\ by\ http\:\/\/anidb\.net\/cr2174\ \[Nasu\ Kinoko\]\,\ writer\ for\ http\:\/\/anidb\.net\/cr927\ \[Type\-Moon\]\.\\nFrom\ a\ long\ sleep\,\ Ryougi\ Shiki\ awoke\.\ As\ an\ after\ effect\,\ she\ gained\ the\ power\ to\ perceive\ the\ death\ of\ things\.\ The\ power\ to\ kill\ anything\ with\ just\ a\ knife\ lures\ Shiki\ into\ a\ dark\ world\:\ The\ murderer\ from\ two\ years\ ago\;\ swarms\ of\ floating\ ghosts\;\ a\ girl\ who\ can\ bend\ things\ by\ just\ looking\ at\ them\;\ a\ spiral\ construction\ that\ collects\ people\`s\ death\.\ When\ numerous\ bizarre\ incidents\ collides\ with\ Shiki\`s\ Mystic\ Eyes\,\ her\ lost\ memories\ reawaken\.\\nhttp\:\/\/anidb\.net\/ch1297\ \[Ryougi\ Shiki\]\ was\ involved\ in\ a\ car\ accident\ and\ fell\ into\ a\ deep\ coma\ for\ two\ years\.\ When\ she\ finally\ awoke\ from\ it\,\ she\ had\ gained\ the\ Eyes\ of\ Death\ Perception\ ability\,\ but\ believes\ to\ have\ lost\ something\ else\.\\nThe\ Ryougi\ family\ attempted\ to\ create\ human\ beings\ that\ exceeded\ normal\ humans\,\ and\ to\ accomplish\ this\,\ they\ trained\ their\ children\ in\ various\ martial\ arts\ and\ fencing\,\ and\ also\ made\ them\ split\ their\ personalities\.\ They\ believed\ that\ by\ using\ this\ method\,\ one\ personality\ could\ be\ an\ expert\ in\ one\ subject\ while\ the\ other\ could\ be\ a\ master\ of\ another\.\ Shiki\ was\ no\ exception\ to\ this\,\ and\ she\ had\ a\ masculine\ and\ feminine\ side\ that\ could\ alternately\ become\ the\ dominant\ personality\.\\nAfter\ having\ woken\ up\ from\ the\ accident\,\ Shiki\ believes\ that\ her\ masculine\ personality\ has\ died\ during\ the\ accident\,\ now\ trying\ to\ supplement\ it\ by\ her\ masculine\ tone\.\\nNote\:\ The\ chronological\ order\ of\ the\ movies\ is\ actually\:\ 2\,\ 4\,\ 3\,\ 1\,\ 5\-7\.\ Set\ in\ a\ parallel\ universe\ to\ that\ of\ \[i\]http\:\/\/anidb\.net\/a1015\ \[Shingetsutan\ Tsukihime\]\.\ Considered\ the\ precursor\/inspiration\ for\ the\ story\ of\ Shingetsutan\ Tsukihime\.\[\/i\]');
INSERT INTO animes VALUES(101,'Banner\ of\ the\ Stars\ II','\星\界\の\戦\旗II','Nagaoka\ Yasuchika',2001,8.29,'http://img7.anidb.net/pics/anime/151524.jpg','\*\ Based\ on\ the\ Seikai\ no\ Senki\ sci\-fi\ novel\ series\ by\ http\:\/\/anidb\.net\/cr4495\ \[Morioka\ Hiroyuki\]\.\\nThe\ Abh\ star\ force\ won\ a\ decisive\ battle\ at\ Aptic\ Gate\,\ completely\ breaking\ the\ counter\ offensive\ of\ the\ United\ Mankind\ fleet\.\ Now\ a\ new\ operation\ has\ begun\:\ Operation\ Hunter\ \—\ seek\ and\ completely\ annihilate\ all\ of\ the\ remaining\ scattered\ fleet\.\\nBasroil\,\ part\ of\ 4th\ fleet\,\ was\ sent\ to\ the\ Lobnas\ system\ on\ an\ escort\ mission\.\ http\:\/\/anidb\.net\/ch28\ \[Lafiel\]\ and\ http\:\/\/anidb\.net\/ch4081\ \[Jinto\]\ were\ assigned\ to\ become\ acting\ governor\/vice\ governor\ of\ the\ system\ and\ negotiate\ with\ the\ planet\-side\ government\ to\ establish\ empire\ rule\.\ But\ little\ did\ they\ know\ that\ that\ the\ Lobnas\ system\ is\ a\ prison\ planet\ of\ United\ Mankind\ and\ millions\ of\ prisoners\ are\ just\ about\ to\ start\ a\ rebellion\ to\ overwhelm\ the\ security\ forces\ detached\ there\.');
INSERT INTO animes VALUES(102,'Mononoke','\モ\ノ\ノ\怪','Nakamura\ Kenji',2007,8.22,'http://img7.anidb.net/pics/anime/67285.jpg','Mononoke\ is\ a\ spin\-off\ of\ the\ Bakeneko\ story\ arc\ of\ Ayakashi\ \-\ Japanese\ Classic\ Horror\.\ It\ follows\ the\ Medicine\ Seller\ as\ he\ deals\ with\ various\ spirits\ or\ \"Mononoke\"\ in\ feudal\ Japan\.\ Just\ like\ in\ the\ Bakeneko\ story\,\ he\ combats\ with\ a\ series\ of\ tools\ and\ his\ vast\ knowledge\ of\ the\ supernatural\ on\ his\ side\,\ but\ can\ only\ slay\ the\ Mononoke\ when\ he\ uncovers\ its\ form\ \(Katachi\)\,\ the\ truth\ behind\ its\ appearance\ \(Makoto\)\ and\ the\ reason\ for\ its\ unusual\ behavior\ \(Kotowari\)\.\ In\ other\ words\ \:\ Truth\,\ Form\ and\ Regret\.\\nSource\:\ Wikipedia');
INSERT INTO animes VALUES(103,'Aria\ the\ OVA\:\ Arietta','ARIA\ The\ OVA\ \~ARIETTA\~','Satou\ Jun\`ichi',2007,8.38,'http://img7.anidb.net/pics/anime/83666.jpg','In\ the\ year\ 2301\,\ mankind\ has\ transformed\ Mars\ into\ living\ planet\,\ now\ known\ as\ planet\ Aqua\ due\ to\ its\ vast\ oceans\.\ One\ day\ a\ 15\-year\-old\ girl\ named\ http\:\/\/anidb\.net\/ch1286\ \[Mizunashi\ Akari\]\ visits\ Aqua\ to\ become\ a\ http\:\/\/anidb\.net\/t710\ \[Undine\]\.\.\.\\nNote\:\ Received\ an\ early\ television\ broadcast\ on\ AT\-X\ on\ September\ 3\,\ 2007\ before\ its\ official\ DVD\ release\ on\ September\ 21\,\ 2007\.');
INSERT INTO animes VALUES(104,'Time\ of\ Eve','\イ\ヴ\の\時\間','Yoshiura\ Yasuhiro',2008,8.79,'http://img7.anidb.net/pics/anime/40062.jpg','In\ the\ near\ future\,\ probably\ in\ Japan\,\ long\ after\ robots\ have\ been\ put\ to\ practical\ use\,\ and\ not\ so\ long\ since\ human\-type\ robots\,\ or\ androids\ have\ appeared\.\\nDue\ to\ the\ Robot\ Ethical\ Committee\,\ people\ take\ it\ for\ granted\ to\ treat\ robots\ as\ electronic\ appliances\.\ However\,\ because\ of\ their\ human\ appearance\,\ except\ for\ the\ halos\ above\ their\ heads\,\ some\ humans\ \—\ called\ dori\-kei\ \(android\-style\)\ \—\ are\ becoming\ too\ attracted\ to\ these\ androids\,\ and\ this\ is\ causing\ new\ social\ problems\.\\nhttp\:\/\/anidb\.net\/ch13547\ \[Rikuo\]\ has\ been\ taught\ to\ treat\ androids\ the\ way\ he\ does\ since\ he\ was\ a\ child\.\ He\ does\ not\ think\ of\ androids\ as\ human\ beings\,\ and\ uses\ them\ as\ useful\ tools\.\ One\ day\,\ he\ discovers\ that\ ominous\ words\ were\ recorded\ in\ home\-android\ http\:\/\/anidb\.net\/ch13549\ \[Sammy\]\`s\ activity\ log\:\\n\"Are\ you\ enjoying\ the\ time\ of\ EVE\?\"\\nTracing\ her\ footsteps\ with\ his\ friend\ http\:\/\/anidb\.net\/ch13548\ \[Masaki\]\,\ they\ arrive\ at\ a\ strange\ cafe\ that\ has\ put\ up\ the\ slogan\ not\ to\ discriminate\ between\ human\ beings\ and\ androids\.');
INSERT INTO animes VALUES(105,'Princess\ Tutu','\プ\リ\ン\セ\ス\チ\ュ\チ\ュ','Koumoto\ Shougo',2002,8.27,'http://img7.anidb.net/pics/anime/133250.jpg','\*\ An\ original\ anime\ project\ based\ on\ a\ story\ planned\ by\ http\:\/\/anidb\.net\/cr4280\ \[Itou\ Ikuko\]\.\\nKinkan\-chou\ is\ a\ circular\ shaped\ town\ surrounded\ by\ castle\ walls\.\ With\ its\ calm\ scenery\ including\ a\ park\,\ a\ theatre\,\ lines\ of\ shops\,\ it\ looks\ as\ if\ just\ any\ ordinary\ town\.\.\.\ but\ its\ slightly\ unusual\?\ The\ people\ who\ live\ there\ are\ all\ nice\,\ but\ they\ are\ including\ cats\,\ crocodiles\,\ all\ of\ which\ can\ speak\!\\nIn\ this\ town\,\ there\ is\ a\ large\ performing\ arts\ school\,\ Kinkan\-gakuen\,\ where\ a\ girl\ named\ http\:\/\/anidb\.net\/ch5\ \[Ahiru\]\ learns\ ballet\.\ She\ is\ a\ little\ clumsy\ but\ tries\ as\ hard\ as\ anyone\ else\,\ and\ is\ always\ scolded\ and\ made\ fun\ of\ but\ also\ loved\ by\ her\ friends\,\ Pike\ and\ Ririe\.\\nAhiru\ has\ an\ upperclassman\,\ a\ boy\ whom\ she\ is\ fond\ of\,\ http\:\/\/anidb\.net\/ch8\ \[Mytho\]\.\ He\ is\ very\ good\ at\ dancing\,\ not\ so\ talkative\,\ but\ handsome\;\ he\ is\ Ahiru\`s\ Prince\.\ However\,\ Ahiru\ feels\ Mytho\`s\ eyes\ look\ lonely\.\ Just\ once\,\ she\ would\ love\ to\ see\ her\ Prince\ smile\!\ With\ those\ wishes\ in\ mind\,\ she\ continues\ to\ work\ hard\ with\ her\ ballet\ lessons\.\ But\ Mytho\ has\ a\ very\ beautiful\,\ smart\ girlfriend\,\ http\:\/\/anidb\.net\/ch10\ \[Rue\]\,\ who\ is\ even\ better\ than\ him\ at\ dance\.\ To\ think\ that\ someone\ like\ herself\ would\ be\ able\ to\ dance\ with\ Mytho\ is\ just\ a\ dream\ in\ another\ dream\.\ Will\ Ahiru\ be\ able\ to\ become\ a\ Princess\ and\ dance\ with\ her\ Prince\?\\n\[i\]Note\:\ Princess\ Tutu\ was\ originally\ broadcast\ in\ two\ seasons\.\ The\ first\ season\ \(called\ \"Kapitel\ des\ Eies\"\ \-\ \"Chapter\ of\ the\ Egg\"\)\ consisted\ of\ 13\ half\-hour\ episodes\,\ while\ The\ second\ season\ \-\ called\ \"Kapitel\ des\ Junges\"\ \(\"Chapter\ of\ the\ Chick\"\)\ in\ R2\ DVDs\ and\ \"Kapital\ \(sic\)\ des\ K\üken\"\ \(\"Chapter\ of\ the\ Fledgling\"\)\ in\ R1\ DVDs\)\ \-\ was\ broadcast\ as\ 26\ quarter\-hour\ episodes\,\ to\ conform\ to\ the\ format\ of\ the\ time\ slot\,\ so\ that\ each\ episode\ was\ split\ into\ two\ parts\.\ These\ were\ brought\ back\ together\ in\ the\ DVD\ release\ as\ 13\ complete\ episodes\.\\nNote\ 2\:\ This\ title\ is\ using\ the\ historical\ town\ N\ördlingen\ in\ Bavaria\,\ Germany\,\ as\ a\ model\ for\ the\ storyline\.\[\/i\]');
INSERT INTO animes VALUES(106,'Tsubasa\:\ Tokyo\ Revelations','\ツ\バ\サ\ TOKYO\ REVELATIONS','Tada\ Shunsuke',2007,8.25,'http://img7.anidb.net/pics/anime/23809.jpg','A\ separate\ project\ from\ the\ Tsubasa\ Chronicle\ anime\,\ this\ time\ handled\ by\ Production\ I\.G\.\ and\ Nanase\/Ageha\ Ohkawa\ \(CLAMP\`s\ scriptwriter\)\,\ Tsubasa\ TOKYO\ REVELATIONS\ are\ three\ 25\-minutes\ OVAs\ covering\ the\ Tokyo\ Arc\,\ which\ should\ have\ taken\ place\ in\ the\ anime\ after\ episode\ 42\.\ Each\ of\ the\ three\ DVDs\ will\ only\ be\ sold\ in\ Japan\ in\ a\ special\ limited\ edition\ together\ with\ volumes\ 21\,\ 22\ and\ 23\ of\ the\ manga\.\\nWhen\ Sakura\,\ Syaoran\,\ Fye\,\ Kurogane\ and\ Mokona\ arrive\ in\ a\ strange\ and\ desolate\ desertic\ world\ and\ meet\ a\ mysterious\ hooded\ group\,\ little\ can\ they\ imagine\ that\ the\ inevitable\ events\ that\ will\ take\ place\ in\ this\ world\ will\ make\ their\ journey\ take\ a\ dramatic\ turn\ and\ change\ their\ lives\ forever\.\.\.\\nSummary\ by\ Kathna\/Miyazawa\ Lulu');
INSERT INTO animes VALUES(107,'Code\ Geass\:\ Lelouch\ of\ the\ Rebellion\ R2','\コ\ー\ド\ギ\ア\ス\ \反\逆\の\ル\ル\ー\シ\ュ\ R2','Taniguchi\ Gorou',2008,8.97,'http://img7.anidb.net/pics/anime/27352.jpg','It\`s\ been\ one\ year\ since\ the\ failure\ of\ the\ Black\ Rebellion\ and\ the\ supposed\ death\ of\ http\:\/\/anidb\.net\/ch1697\ \[Zero\]\.\ Britannia\ has\ assigned\ Area\ 11\ a\ correctional\ education\ status\,\ where\ Elevens\ are\ made\ an\ example\ of\ by\ brute\ force\,\ to\ try\ to\ prevent\ any\ future\ uprisings\ and\ suppress\ rebellious\ thoughts\.\ Unsuspecting\ high\ school\ student\ http\:\/\/anidb\.net\/ch103\ \[Lelouch\]\,\ oblivious\ to\ his\ rebellious\ past\ as\ Zero\,\ stumbles\ upon\ a\ scheme\ on\ his\ life\ and\ the\ life\ of\ a\ mysterious\ woman\ known\ as\ http\:\/\/anidb\.net\/ch45\ \[C\.C\.\]\,\ who\ reveals\ to\ him\ his\ forgotten\ purpose\ and\ his\ true\ self\.\ Destroying\ his\ assailants\ and\ declaring\ himself\ Zero\ once\ again\,\ Lelouch\ sets\ out\ to\ finish\ what\ he\ started\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(108,'Spice\ and\ Wolf','\狼\と\香\辛\料','Takahashi\ Takeo',2008,8.33,'http://img7.anidb.net/pics/anime/169771.jpg','\*\ Based\ on\ a\ light\ novel\ series\ written\ by\ http\:\/\/anidb\.net\/cr1432\ \[Hasekura\ Isuna\]\.\\nhttp\:\/\/anidb\.net\/ch2818\ \[Kraft\ Lawrence\]\ \(Spice\)\ is\ a\ travelling\ medieval\ merchant\,\ who\ finds\ a\ 600\-year\-old\ pagan\ harvest\ deity\ named\ http\:\/\/anidb\.net\/ch29\ \[Holo\]\ \(Wolf\)\ in\ his\ wagon\ one\ night\.\ She\ begins\ travelling\ with\ him\,\ and\ her\ wisdom\ helps\ increase\ his\ profits\.\ But\ her\ true\ nature\ draws\ unwanted\ attention\ from\ the\ church\.\.\.\\nNote\:\ The\ novel\ series\ won\ the\ Silver\ Prize\ in\ the\ 12th\ Dengeki\ Novel\ Awards\.\ The\ story\ forgoes\ the\ traditional\ sword\-\&\-sorcery\ adventure\ element\ to\ focus\ on\ how\ people\ lived\ and\ did\ business\ in\ the\ Middle\ Ages\.');
INSERT INTO animes VALUES(109,'Aria\ the\ Origination','ARIA\ The\ ORIGINATION','Satou\ Jun\`ichi',2008,9.11,'http://img7.anidb.net/pics/anime/83670.jpg','\*\ Based\ on\ the\ seinen\ manga\ Aria\ and\ Aqua\ by\ http\:\/\/anidb\.net\/cr5611\ \[Amano\ Kozue\]\.\\nAqua\ and\ Aria\ take\ place\ in\ the\ twenty\-fourth\ century\,\ on\ the\ planet\ Aqua\ \(formerly\ Mars\)\,\ which\ has\ been\ terraformed\ into\ a\ habitable\ planet\ covered\ in\ oceans\ and\ seas\.\\nThe\ series\ is\ the\ story\ of\ Akari\,\ an\ apprentice\ gondolier\ with\ Aria\ Company\,\ one\ of\ the\ three\ most\ popular\ gondola\ companies\ in\ the\ city\.\ She\ is\ training\ to\ become\ a\ full\-time\ gondolier\,\ or\ undine\,\ as\ they\ are\ called\ in\ Neo\-Venezia\.');
INSERT INTO animes VALUES(110,'xxxholic2','xxxHOLiC\◆\継','Mizushima\ Tsutomu',2008,8.22,'http://img7.anidb.net/pics/anime/84021.jpg','Still\ working\ to\ get\ his\ wish\ complete\,\ http\:\/\/anidb\.net\/ch860\ \[Watanuki\]\ finds\ himself\ into\ more\ mess\ than\ he\ can\ handle\ when\ certain\ facts\ about\ his\ everyday\ life\ gets\ revealed\ and\ when\ he\ needs\ to\ learn\ the\ lesson\ of\ http\:\/\/anidb\.net\/ch859\ \[Yuuko\]\ the\ hard\ way\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(111,'Detroit\ Metal\ City','\デ\ト\ロ\イ\ト\・\メ\タ\ル\・\シ\テ\ィ','Nagahama\ Hiroshi',2008,8.42,'http://img7.anidb.net/pics/anime/23253.jpg','\*\ Based\ on\ the\ seinen\ manga\ by\ http\:\/\/anidb\.net\/cr7121\ \[Wakasugi\ Kiminori\]\ serialised\ in\ Young\ Animal\.\\nSouichi\ Negishi\ is\ a\ shy\ young\ man\ who\ came\ from\ the\ rural\ Ota\ Prefecture\ to\ Tokyo\ for\ college\ and\ wished\ to\ become\ a\ kindergarten\ teacher\.\ However\,\ for\ some\ reason\ he\ became\ the\ singer\ and\ songwriter\ of\ a\ metal\ band\ named\ \"Detroit\ Metal\ City\,\"\ with\ a\ stage\ name\ \"Johannes\ Krauser\ II\.\"\ Whenever\ he\ wears\ the\ heavy\ makeup\,\ Negishi\ becomes\ a\ completely\ different\ person\,\ shouting\ the\ most\ vulgar\ profanities\ beyond\ anyone\`s\ imagination\.\ With\ the\ popularity\ of\ DMC\ increases\,\ Negishi\ starts\ worrying\ his\ double\ personalities\ can\ have\ negative\ effects\ on\ his\ \(romantic\)\ life\ off\ stage\.');
INSERT INTO animes VALUES(112,'Kaiba','\カ\イ\バ','Yuasa\ Masaaki',2008,8.25,'http://img7.anidb.net/pics/anime/18142.jpg','\*\ Original\ series\ directed\ by\ http\:\/\/anidb\.net\/cr49\ \[Yuasa\ Masaaki\]\,\ and\ animated\ by\ http\:\/\/anidb\.net\/cr731\ \[Madhouse\]\.\\nA\ sci\-fi\ love\ story\ set\ in\ a\ world\ where\ digitization\ of\ memory\ made\ physical\ death\ obsolete\.\ A\ world\ where\ memories\ can\ be\ stolen\ and\ altered\,\ and\ replaced\ in\ a\ new\ human\ body\.\\nhttp\:\/\/anidb\.net\/ch5489\ \[Kaiba\]\ wakes\ up\ in\ a\ room\ without\ knowing\ who\ he\ is\.\ He\ has\ a\ pendant\ with\ the\ photograph\ of\ a\ woman\ he\ does\ not\ remember\.\ After\ being\ attacked\ all\ of\ a\ sudden\,\ he\ has\ to\ flee\ to\ space\,\ meet\ various\ people\,\ and\ rediscover\ the\ world\.\\n\"Even\ without\ my\ memories\,\ I\ love\ you\.\.\.\"');
INSERT INTO animes VALUES(113,'Millennium\ Actress','\千\年\女\優','Kon\ Satoshi',2001,8.26,'http://img7.anidb.net/pics/anime/6462.jpg','From\ critically\ acclaimed\ director\ http\:\/\/anidb\.net\/cr54\ \[Kon\ Satoshi\]\ \(Perfect\ Blue\)\,\ comes\ the\ award\-winning\ masterpiece\,\ Millennium\ Actress\.\ Known\ for\ his\ remarkable\ visual\ style\,\ Kon\ seamlessly\ blends\ fantasy\ and\ reality\ into\ an\ exciting\ epic\ adventure\ of\ fate\ and\ destiny\.\ Past\ and\ present\ collide\ as\ a\ film\ director\ discovers\ a\ mysterious\ key\ that\ unlocks\ the\ secrets\ of\ a\ legendary\ actress\ who\ vanished\ at\ the\ height\ of\ her\ brilliant\ career\.\\nIt\ is\ based\ on\ the\ lives\ of\ Hara\ Setsuko\ and\ Takamine\ Hideko\.\\nNote\:\ Premiered\ at\ the\ Fantasia\ International\ Film\ Festival\.\ Japanese\ premiere\ took\ place\ on\ 14\.09\.2002\.');
INSERT INTO animes VALUES(114,'Kino\`s\ Journey\:\ The\ Beautiful\ World','\キ\ノ\の\旅\ \-the\ Beautiful\ World\-','Nakamura\ Ryuutarou',2003,8.53,'http://img7.anidb.net/pics/anime/4953.jpg','\*\ Based\ on\ a\ light\ novel\ series\ by\ http\:\/\/anidb\.net\/cr5617\ \[Shigusawa\ Keiichi\]\.\\nComposed\ in\ the\ form\ of\ a\ series\ of\ short\ stories\,\ this\ is\ the\ story\ of\ the\ travels\ and\ observations\ of\ the\ human\ Kino\ and\ the\ talking\ motorbike\ Hermes\.\ http\:\/\/anidb\.net\/ch7856\ \[Kino\]\ and\ http\:\/\/anidb\.net\/ch7857\ \[Hermes\]\ visit\ various\ fantastic\ countries\ \-\ a\ country\ that\ can\`t\ coexist\ with\ others\ due\ to\ the\ development\ of\ telepathy\ \(thus\,\ a\ country\ that\ understands\ people\`s\ pain\)\;\ a\ country\ striving\ to\ make\ everything\ equal\,\ whose\ residents\ are\ extremely\ united\ \(i\.e\.\,\ ruled\ by\ majority\)\;\ and\ so\ on\.\\nSmall\ ripples\ are\ formed\ in\ the\ everyday\ lives\ of\ the\ people\ living\ in\ the\ various\ countries\ by\ the\ appearances\ of\ the\ unusual\ Kino\.\ These\ ripples\ gradually\ become\ a\ major\ influence\,\ rattling\ the\ foundations\ of\ their\ normal\ lives\.\\nWhat\ will\ Kino\ and\ Hermes\ see\ in\ their\ travels\?\ And\ what\ will\ be\ left\ in\ the\ hearts\ and\ minds\ of\ the\ people\ they\ encounter\?\\nSource\:\ AnimeNfo\,\ edited\ by\ 5plada0');
INSERT INTO animes VALUES(115,'Natsume\`s\ Book\ of\ Friends','\夏\目\友\人\帳','Oomori\ Takahiro',2008,8.12,'http://img7.anidb.net/pics/anime/8997.jpg','http\:\/\/anidb\.net\/ch1806\ \[Natsume\ Takashi\]\ has\ the\ ability\ to\ see\ spirits\,\ which\ he\ has\ long\ kept\ secret\.\ However\,\ once\ he\ inherits\ a\ strange\ book\ that\ belonged\ to\ his\ deceased\ grandmother\,\ http\:\/\/anidb\.net\/ch1808\ \[Reiko\]\,\ he\ discovers\ the\ reason\ why\ spirits\ surround\ him\.\ Containing\ the\ names\ of\ these\ spirits\,\ a\ binding\ contract\ was\ formed\ between\ the\ spirits\ and\ the\ owner\ of\ the\ book\.\ Now\,\ Natsume\ is\ determined\ to\ free\ the\ spirits\ and\ dissolve\ the\ contracts\.\ With\ the\ help\ of\ a\ spirit\ cat\,\ his\ days\ are\ filled\ trying\ to\ return\ the\ names\ to\ these\ spirits\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(116,'gineiden','Heldensagen\ vom\ Kosmosinsel\ \銀\河\英\雄\伝\説','',1988,9.53,'http://img7.anidb.net/pics/anime/129196.jpg','\*\ Based\ on\ http\:\/\/anidb\.net\/cr991\ \[Tanaka\ Yoshiki\]\`s\ series\ of\ science\ fiction\ novels\ by\ the\ same\ name\.\\nIt\ is\ late\ into\ the\ 36th\ century\ in\ the\ ancient\ Christian\ calendar\;\ mankind\,\ having\ developed\ the\ technology\ to\ travel\ faster\ than\ light\ speed\ and\ colonize\ many\ planets\,\ has\ taken\ a\ hold\ of\ space\,\ to\ the\ point\ of\ abandoning\ Earth\ almost\ entirely\.\ Two\ superpowers\ comprising\ almost\ all\ the\ human\ population\ have\ now\ for\ one\ and\ a\ half\ centuries\ waged\ to\ a\ long\ stalemate\ a\ war\ for\ interstellar\ supremacy\:\ the\ http\:\/\/anidb\.net\/ch1534\ \[Galactic\ Empire\]\ and\ the\ http\:\/\/anidb\.net\/ch1535\ \[Free\ Planets\ Alliance\]\.\\nWhen\ he\ was\ young\ and\ poor\,\ http\:\/\/anidb\.net\/ch186\ \[Count\ Reinhard\ von\ Lohengramm\]\,\ a\ military\ genius\ born\ a\ noble\ in\ name\ only\,\ saw\ his\ sister\,\ http\:\/\/anidb\.net\/ch205\ \[Countess\ Annerose\ von\ Grunewald\]\,\ turned\ into\ an\ Imperial\ concubine\;\ having\ once\ helplessly\ watched\ her\ being\ practically\ sold\ to\ http\:\/\/anidb\.net\/ch206\ \[Kaiser\ Friedrich\ IV\]\ as\ merchandise\,\ he\ now\ seeks\ to\ crush\ the\ Emperor\ and\ free\ her\.\ Meanwhile\,\ http\:\/\/anidb\.net\/ch737\ \[Yang\ Wenli\]\,\ an\ Alliance\ commander\ of\ similar\ calibre\ who\ really\ wanted\ to\ be\ a\ historian\ and\ not\ a\ soldier\,\ wishes\ only\ for\ some\ peace\ and\ quiet\;\ yet\,\ as\ he\ unwillingly\ grows\ in\ relevance\,\ he\`ll\ see\ himself\ duty\-bound\ to\ protect\ the\ Alliance\`s\ democracy\ from\ the\ threat\ of\ the\ autocratic\ Empire\.\ The\ collision\ of\ those\ two\ masters\ of\ tactics\ and\ strategy\ may\ bring\ the\ war\ to\ a\ close\,\ provided\,\ of\ course\,\ that\ they\ aren\`t\ first\ backstabbed\ by\ their\ respective\ countries\`\ rotten\ internal\ politics\.\.\.\\n\—\ written\ by\ Hinoe\\n\[i\]Note\:\ The\ original\ OVA\ release\ of\ mail\-order\ VHS\ tapes\ were\ grouped\ into\ seasons\ as\ follows\:\\nSeason\ 1\:\ 01\-26\ \(21\.12\.1988\ to\ 20\.06\.1989\)\\nSeason\ 2\:\ 27\-54\ \(21\.06\.1991\ to\ 20\.02\.1992\)\\nSeason\ 3\:\ 55\-86\ \(20\.07\.1994\ to\ 16\.01\.1995\)\\nSeason\ 4\:\ 87\-110\ \(\?\?\.09\.1996\ to\ 14\.03\.1997\)\[\/i\]');
INSERT INTO animes VALUES(117,'Clannad\:\ After\ Story','CLANNAD\ \~AFTER\ STORY\~','Ishihara\ Tatsuya',2008,9.26,'http://img7.anidb.net/pics/anime/83807.jpg','\*\ Based\ on\ a\ visual\ novel\ by\ http\:\/\/anidb\.net\/cr1046\ \[Visual\ Art\`s\/Key\]\.\ After\ Story\ is\ a\ path\ that\ opens\ in\ the\ original\ visual\ novel\ after\ all\ the\ other\ paths\ have\ been\ cleared\.\\nLife\ continues\ on\ for\ http\:\/\/anidb\.net\/ch1113\ \[Okazaki\ Tomoya\]\.\ A\ few\ months\ have\ passed\ since\ he\ confessed\ his\ love\ to\ http\:\/\/anidb\.net\/ch1116\ \[Furukawa\ Nagisa\]\.\ Now\ entering\ the\ second\ semester\,\ he\ continues\ to\ meet\ a\ variety\ of\ different\ people\,\ expanding\ his\ own\ world\ in\ the\ process\.\ As\ well\,\ Tomoya\ and\ Nagisa\`s\ relationship\ begins\ to\ enter\ a\ level\ of\ intimacy\ unlike\ before\.\ Through\ his\ relationship\ with\ Nagisa\,\ and\ his\ various\ encounters\,\ Tomoya\ begins\ to\ understand\ the\ meaning\ and\ importance\ of\ family\.\ Unfortunately\,\ as\ Tomoya\ and\ Nagisa\ begin\ their\ own\ family\ together\,\ they\ are\ faced\ with\ many\ hardships\ and\ challenges\ along\ the\ way\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(118,'nodame2','\の\だ\め\カ\ン\タ\ー\ビ\レ\ \巴\里\編','Kon\ Chiaki',2008,8.33,'http://img7.anidb.net/pics/anime/196146.jpg','Nodame\ and\ Chiaki\ arrive\ in\ Paris\ and\ their\ story\ continues\ with\ new\ friends\,\ challenges\,\ more\ beautiful\ music\ and\,\ of\ course\,\ lots\ of\ Nodame\ gaffes\ and\ gyabos\!\ Chiaki\ wants\ to\ make\ his\ presence\ known\ to\ Vieira\ Sensei\ by\ winning\ a\ competition\ for\ conductors\,\ while\ homesick\ Nodame\ has\ her\ hands\ full\ coming\ to\ terms\ with\ her\ new\ surroundings\.');
INSERT INTO animes VALUES(119,'Major\ 5th','\メ\ジ\ャ\ー\ \(2009\)','Fukushima\ Toshinori',2009,8.4,'http://img7.anidb.net/pics/anime/23808.jpg','Goro\ returns\ home\ just\ in\ time\ to\ find\ out\ that\ Japan\ will\ be\ participating\ in\ the\ Baseball\ World\ Cup\ to\ be\ held\ in\ the\ US\.\ It\ so\ happens\ that\ his\ stepfather\ is\ also\ a\ member\ of\ the\ coaching\ staff\ for\ the\ national\ team\.\ Confident\ in\ the\ abilities\ he\ gained\ in\ the\ minor\ league\,\ Goro\ hopes\ to\ weasel\ himself\ into\ the\ team\ \.\.\.');
INSERT INTO animes VALUES(120,'Ghost\ in\ the\ Shell','GHOST\ IN\ THE\ SHELL','Oshii\ Mamoru',1995,8.24,'http://img7.anidb.net/pics/anime/36738.jpg','In\ the\ year\ 2029\,\ the\ world\ is\ made\ borderless\ by\ the\ net\;\ augmented\ humans\ live\ in\ virtual\ environments\,\ watched\ over\ by\ law\ enforcement\ that\ is\ able\ to\ download\ themselves\ into\ super\-powered\,\ crime\ busting\ mecha\.\\nThe\ ultimate\ secret\ agent\ of\ the\ future\ is\ not\ human\,\ has\ no\ physical\ body\ and\ can\ freely\ travel\ the\ information\ highways\ of\ the\ world\,\ hacking\ and\ manipulating\ whatever\ and\ whenever\ required\.');
INSERT INTO animes VALUES(121,'Skip\ Beat','\ス\キ\ッ\プ\・\ビ\ー\ト\!','Sayama\ Kiyoko',2008,8.2,'http://img7.anidb.net/pics/anime/40459.jpg','Kyoko\ has\ devoted\ her\ life\ to\ Shotaro\.\ When\ Shotaro\ came\ to\ Tokyo\ to\ debut\ as\ a\ singer\,\ she\ followed\ him\ and\ worked\ to\ provide\ for\ him\.\ But\ one\ day\,\ Kyoko\ overhears\ Shota\ telling\ his\ manager\ that\ Kyoko\ means\ nothing\ to\ him\.\ She\`s\ just\ convenient\,\ a\ housekeeper\.\ This\ makes\ Kyoko\ furious\,\ and\ she\ vows\ revenge\ on\ Shotaro\.\ But\ Shotaro\ just\ laughs\ at\ her\,\ saying\ she\ won\`t\ be\ able\ to\ touch\ him\ because\ he\`s\ now\ a\ popular\ singer\ and\ she\`s\ a\ nobody\.\ So\ Kyoko\ decides\ to\ get\ into\ showbiz\ and\ become\ even\ more\ popular\ than\ Shotaro\ to\ humiliate\ him\.\ Unfortunately\,\ Shotaro\ has\ destroyed\ Kyoko\`s\ ability\ to\ love\,\ and\ she\ discovers\ that\ it\ is\ a\ prerequisite\ for\ her\ to\ debut\ from\ her\ chosen\ company\,\ LME\.\ The\ president\ of\ LME\ puts\ her\ into\ a\ new\ section\ made\ for\ those\ who\ caught\ his\ eye\ but\ have\ something\ missing\.\ It\`s\ name\.\.\.\ Love\ Me\ Section\.\ On\ her\ way\ to\ become\ a\ pro\ actress\ she\`s\ meeting\ new\ people\ like\ Kanae\ Kotonami\,\ Maria\ Takarada\,\ Yukihito\ Yashiro\ and\ the\ important\ person\ in\ this\ story\ \-\ Ren\ Tsuruga\.');
INSERT INTO animes VALUES(122,'Fullmetal\ Alchemist\:\ Brotherhood','\鋼\の\錬\金\術\師\ FULLMETAL\ ALCHEMIST\ \(2009\)','Irie\ Yasuhiro',2009,9.5,'http://img7.anidb.net/pics/anime/31500.jpg','Two\ brothers\ lose\ their\ mother\ to\ an\ incurable\ disease\.\ With\ the\ power\ of\ alchemy\,\ they\ use\ taboo\ knowledge\ to\ resurrect\ her\.\ The\ process\ fails\,\ and\ as\ a\ toll\ for\ using\ this\ type\ of\ alchemy\,\ the\ older\ brother\,\ Edward\ Elric\ loses\ his\ left\ leg\ while\ the\ younger\ brother\,\ Alphonse\ Elric\ loses\ his\ entire\ body\.\ To\ save\ his\ brother\,\ Edward\ sacrifices\ his\ right\ arm\ and\ is\ able\ to\ affix\ his\ brother\`s\ soul\ to\ a\ suit\ of\ armor\.\ With\ the\ help\ of\ a\ family\ friend\,\ Edward\ receives\ metal\ limbs\ \-\ automail\ \-\ to\ replace\ his\ lost\ ones\.\ With\ that\,\ Edward\ vows\ to\ search\ for\ the\ Philosopher\`s\ Stone\ to\ return\ the\ brothers\ to\ their\ original\ bodies\,\ even\ if\ it\ means\ becoming\ a\ State\ Alchemist\,\ one\ who\ uses\ their\ alchemy\ for\ the\ military\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(123,'Ghost\ in\ the\ Shell\ 2\.0','GHOST\ IN\ THE\ SHELL\ \(2008\)','Oshii\ Mamoru',2008,8.31,'http://img7.anidb.net/pics/anime/16613.jpg','In\ the\ year\ 2029\,\ the\ world\ is\ made\ borderless\ by\ the\ net\;\ augmented\ humans\ live\ in\ virtual\ environments\,\ watched\ over\ by\ law\ enforcement\ that\ is\ able\ to\ download\ themselves\ into\ super\-powered\,\ crime\ busting\ mecha\.\\nThe\ ultimate\ secret\ agent\ of\ the\ future\ is\ not\ human\,\ has\ no\ physical\ body\,\ and\ can\ freely\ travel\ the\ information\ highways\ of\ the\ world\,\ hacking\ and\ manipulating\ whatever\ and\ whenever\ required\.\\nNote\:\ Ghost\ in\ the\ Shell\ 2\.0\ is\ a\ renewed\ version\ of\ the\ 1995\ film\ produced\ as\ part\ of\ celebration\ for\ the\ release\ of\ The\ Sky\ Crawlers\ in\ 2008\.\ For\ the\ Version\ 2\.0\,\ all\ the\ animation\ was\ re\-produced\ using\ latest\ technology\ such\ as\ 3D\-CGI\,\ and\ the\ soundtrack\ was\ also\ remastered\.\ All\ the\ voices\ were\ re\-recorded\.\ Notably\,\ the\ voice\ actor\ of\ the\ \"Puppet\ Master\"\ was\ changed\ from\ Kayumi\ Iemasa\ to\ that\ of\ Sakakibara\ Yoshiko\,\ and\ some\ dialogues\ were\ changed\ from\ the\ original\.\ Kawai\ Kenji\ remixed\ the\ music\ with\ 6\.1\ Channel\ Surround\,\ and\ Randy\ Thom\ of\ Skywalker\ Sound\ joined\ as\ Sound\ Designer\ to\ improve\ the\ sound\.');
INSERT INTO animes VALUES(124,'oo\!','\ワ\ン\ナ\ウ\ツ','Satou\ Yuuzou',2008,8.34,'http://img7.anidb.net/pics/anime/52858.jpg','The\ story\ begins\ when\ http\:\/\/anidb\.net\/ch2535\ \[Kojima\ Hiromichi\]\,\ the\ star\ batter\ of\ the\ fictional\ Lycaons\ in\ Japan\`s\ Pacific\ League\,\ heads\ to\ the\ southern\ Japanese\ island\ of\ Okinawa\ to\ train\ and\ bring\ himself\ out\ of\ a\ slump\.\ There\,\ he\ meet\ http\:\/\/anidb\.net\/ch2534\ \[Tokuchi\ Toua\]\,\ a\ 134\-kmph\ \(83\ miles\ per\ hour\)\ pitcher\ and\ the\ undisputed\ king\ of\ a\ gambling\ form\ of\ baseball\ called\ One\ Out\.\ At\ Kojima\`s\ urging\,\ Tokuchi\ signs\ up\ with\ the\ Lycaons\ under\ an\ unusual\ contract\:\ he\ gets\ 5\,000\,000\ yen\ \(about\ US\$\ 46\,000\)\ for\ every\ out\ he\ pitches\,\ but\ loses\ 50\,000\,000\ yen\ \(US\$\ 460\,000\)\ for\ every\ point\ he\ gives\ up\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(125,'HNI2','\は\じ\め\の\一\歩\ The\ Fighting\!\ New\ Challenger','Shishido\ Jun',2009,8.85,'http://img7.anidb.net/pics/anime/15960.jpg','http\:\/\/anidb\.net\/ch23\ \[Makunouchi\ Ippo\]\ continues\ his\ boxing\ career\ still\ in\ search\ of\ what\ it\ means\ to\ be\ strong\ and\ fueled\ by\ the\ desire\ to\ fight\ his\ idol\ http\:\/\/anidb\.net\/ch24\ \[Miyata\ Ichirou\]\.\ Along\ for\ the\ ride\ are\ pro\ boxers\ http\:\/\/anidb\.net\/ch3\ \[Takamura\]\,\ http\:\/\/anidb\.net\/ch106\ \[Aoki\]\ and\ http\:\/\/anidb\.net\/ch107\ \[Kimura\]\,\ each\ one\ aspiring\ to\ their\ own\ dreams\.\\nEdited\ Source\:\ ANN');
INSERT INTO animes VALUES(126,'Spice\ and\ Wolf\ II','\狼\と\香\辛\料II','Takahashi\ Takeo',2009,8.48,'http://img7.anidb.net/pics/anime/18701.jpg','\*\ Based\ on\ a\ light\ novel\ series\ written\ by\ http\:\/\/anidb\.net\/cr1432\ \[Hasekura\ Isuna\]\,\ continuation\ of\ the\ first\ season\:\ http\:\/\/anidb\.net\/a5406\ \[Ookami\ to\ Koushinryou\]\.\\nFollowing\ http\:\/\/anidb\.net\/ch2818\ \[Kraft\ Lawrence\]\ \(Spice\)\ an\ experienced\ travelling\ merchant\ and\ his\ sharp\-tongued\ 600\-year\-old\ pagan\ deity\ companion\ http\:\/\/anidb\.net\/ch29\ \[Holo\]\ \(Wolf\)\ on\ their\ journey\ to\ return\ to\ Yoitsu\,\ Holo\`s\ home\ in\ the\ north\.\ A\ tender\ relationship\ has\ blossomed\ between\ the\ characters\,\ as\ they\ make\ deals\,\ travel\ between\ cities\,\ encounter\ religious\ fanatics\,\ overcoming\ the\ daily\ toils\ of\ a\ travelling\ merchant\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(127,'Evangelion\:\ 2\.0\ You\ Can\ \(Not\)\ Advance','\ヱ\ヴ\ァ\ン\ゲ\リ\ヲ\ン\新\劇\場\版\:\破','Masayuki',2009,9.08,'http://img7.anidb.net/pics/anime/13522.jpg','The\ resuscitated\ skeleton\ of\ the\ Third\ Angel\ escapes\ its\ confinement\ and\ tries\ to\ break\ out\ of\ http\:\/\/anidb\.net\/ch5009\ \[NERV\]\`s\ Arctic\ Bethany\ Base\,\ but\ http\:\/\/anidb\.net\/ch7701\ \[Makinami\ Mari\ Illustrious\]\,\ a\ new\ pilot\,\ launches\ http\:\/\/anidb\.net\/ch8640\ \[Evangelion\ Provisional\ Unit\-05\]\ and\ destroys\ the\ Angel\ by\ self\-destructing\ the\ EVA\ and\ safely\ ejecting\ at\ the\ last\ moment\.\\nMeanwhile\,\ http\:\/\/anidb\.net\/ch309\ \[Ikari\ Shinji\]\ and\ his\ father\ http\:\/\/anidb\.net\/ch5000\ \[Gendou\]\ visit\ http\:\/\/anidb\.net\/ch9620\ \[Yui\]\`s\ grave\.\ Shortly\ after\,\ the\ Seventh\ Angel\ attacks\,\ but\ is\ quickly\ dispatched\ by\ the\ newly\ arrived\ http\:\/\/anidb\.net\/ch8705\ \[Unit\-02\]\ and\ its\ headstrong\ pilot\,\ http\:\/\/anidb\.net\/ch7713\ \[Shikinami\ Asuka\ Langley\]\.\ http\:\/\/anidb\.net\/ch8301\ \[Kaji\ Ryouji\]\ delivers\ to\ Gendou\ a\ suitcase\ containing\ the\ mysterious\ \"Key\ of\ Nebuchadnezzar\"\ and\ notes\ that\ the\ destruction\ of\ http\:\/\/anidb\.net\/ch8640\ \[Unit\-05\]\ went\ as\ planned\.\\nGendou\ and\ http\:\/\/anidb\.net\/ch8642\ \[Fuyutsuki\ Kouzou\]\ then\ visit\ NERV\`s\ lunar\ compound\,\ Tabgha\ Base\,\ to\ view\ the\ construction\ of\ http\:\/\/anidb\.net\/ch8639\ \[Evangelion\ Mark\.06\]\,\ which\ is\ noted\ as\ being\ different\ from\ the\ other\ EVAs\.\ They\ are\ denied\ permission\ to\ land\,\ but\ briefly\ see\ http\:\/\/anidb\.net\/ch7960\ \[Nagisa\ Kaworu\]\ sitting\ in\ space\ without\ a\ space\ suit\.\ During\ Gendou\`s\ absence\,\ the\ Eighth\ Angel\ attacks\ Tokyo\-3\.\ Shinji\,\ Asuka\,\ and\ http\:\/\/anidb\.net\/ch310\ \[Rei\]\ kill\ it\ in\ an\ improvised\ plan\ devised\ by\ http\:\/\/anidb\.net\/ch5007\ \[Katsuragi\ Misato\]\.\ Both\ http\:\/\/anidb\.net\/ch8703\ \[Unit\-00\]\ and\ http\:\/\/anidb\.net\/ch8704\ \[Unit\-01\]\ are\ damaged\.\ Gendou\ returns\ and\ asks\ to\ have\ them\ both\ repaired\,\ but\ http\:\/\/anidb\.net\/ch7187\ \[SEELE\]\ only\ allows\ the\ repair\ of\ Unit\-01\.\.\.\\nSource\:\ Wikipedia');
INSERT INTO animes VALUES(128,'Natsume\`s\ Book\ of\ Friends\ \(2\)','\続\ \夏\目\友\人\帳','Oomori\ Takahiro',2009,8.58,'http://img7.anidb.net/pics/anime/148630.jpg','http\:\/\/anidb\.net\/ch1806\ \[Natsume\ Takashi\]\,\ with\ the\ help\ of\ http\:\/\/anidb\.net\/ch1807\ \[Nyanko\-sensei\]\,\ continues\ his\ adventures\ to\ free\ spirits\ contracted\ by\ his\ grandmother\ http\:\/\/anidb\.net\/ch1808\ \[Natsume\ Reiko\]\ in\ the\ \"Book\ of\ Friends\"\.');
INSERT INTO animes VALUES(129,'Erin','\獣\の\奏\者\ \エ\リ\ン','Hamana\ Takayuki',2009,8.3,'http://img7.anidb.net/pics/anime/49377.jpg','\*\ Based\ on\ the\ fantasy\ novel\ series\ written\ by\ http\:\/\/anidb\.net\/cr6977\ \[Uehashi\ Nahoko\]\.\\nKemono\ no\ Souja\ Erin\ is\ about\ a\ young\ woman\ who\ is\ drawn\ into\ a\ war\ between\ kingdoms\.\\n10\-year\-old\ http\:\/\/anidb\.net\/ch7452\ \[Erin\]\ is\ a\ young\ girl\ who\ lives\ with\ her\ mother\ in\ the\ Tai\ Koh\ Region\ in\ the\ small\ Village\ of\ Ake\.\ She\ has\ a\ big\ love\ for\ animals\,\ especially\ the\ Touda\,\ dragon\-like\ creatures\ used\ in\ the\ war\.\\nHer\ mother\ http\:\/\/anidb\.net\/ch7453\ \[Soyon\]\ was\ originally\ of\ the\ Mist\ People\,\ an\ ancient\ clan\ who\ have\ members\ with\ green\ hair\ and\ eyes\,\ and\ is\ rumored\ to\ follow\ in\ the\ ancient\ ways\,\ practice\ magic\,\ and\ hide\ in\ the\ mist\.\ But\ despite\ her\ genealogy\,\ they\ stay\ in\ the\ village\ because\ Erin\`s\ late\ father\ was\ the\ son\ of\ the\ village\ chief\ and\ Soyon\ is\ the\ head\ Touda\ doctor\.\\nOne\ day\ however\ a\ tragedy\ happens\ which\ changes\ Erin\`s\ life\ forever\.');
INSERT INTO animes VALUES(130,'Detective\ Conan\:\ The\ Raven\ Chaser','\名\探\偵\コ\ナ\ン\ \漆\黒\の\追\跡\者\(\チ\ェ\イ\サ\ー\)','Yamamoto\ Yasuichirou',2009,8.12,'http://img7.anidb.net/pics/anime/39862.jpg','http\:\/\/anidb\.net\/ch2263\ \[Kudou\ Shin\`ichi\]\ is\ living\ his\ life\ as\ http\:\/\/anidb\.net\/ch2260\ \[Edogawa\ Conan\]\,\ but\ those\ days\ might\ end\ pretty\ soon\.\ http\:\/\/anidb\.net\/ch8215\ \[Kuro\ no\ Soshiki\]\,\ the\ Black\ Syndicate\ is\ coming\ dangerously\ close\ to\ learning\ the\ truth\ about\ Shin\`ichi\ having\ survived\.\ Conan\ and\ everybody\ around\ him\ may\ end\ up\ dead\ if\ he\ does\ not\ manage\ to\ find\ http\:\/\/anidb\.net\/ch12363\ \[Irish\]\ \—\ a\ member\ of\ the\ black\ organisation\,\ who\ has\ infiltrated\ the\ police\ force\,\ currently\ investigating\ a\ big\ serial\ murder\ case\.');
INSERT INTO animes VALUES(131,'Summer\ Wars','\サ\マ\ー\ウ\ォ\ー\ズ','Hosoda\ Mamoru',2009,8.18,'http://img7.anidb.net/pics/anime/75738.jpg','http\:\/\/anidb\.net\/ch7045\ \[Koiso\ Kenji\]\,\ a\ eleventh\-grade\ math\ genius\ who\ works\ in\ the\ summer\ as\ a\ part\-time\ computer\ technician\ for\ the\ Virtual\ World\ of\ Oz\,\ is\ invited\ by\ http\:\/\/anidb\.net\/ch7046\ \[Shinohara\ Natsuki\]\,\ the\ most\ popular\ girl\ at\ his\ high\ school\ to\ her\ expansive\ family\`s\ home\ for\ a\ summer\ job\.\ In\ the\ middle\ of\ their\ trip\,\ a\ hacker\ infiltrates\ the\ network\ and\ takes\ control\ of\ Oz\,\ plunging\ humanity\ into\ absolute\ chaos\.\\nNote\:\ 2010\ \—\ Japan\ Academy\ Prize\ for\ Animation\ of\ the\ Year');
INSERT INTO animes VALUES(132,'Gurren\ Lagann\ the\ Movie\:\ The\ Lights\ in\ the\ Sky\ Are\ Stars','\劇\場\版\ \天\元\突\破\グ\レ\ン\ラ\ガ\ン\ \螺\巌\篇','Imaishi\ Hiroyuki',2009,8.63,'http://img7.anidb.net/pics/anime/160933.jpg','\*\ Based\ on\ the\ re\-edited\ second\ part\ of\ the\ story\ from\ the\ television\ series\ http\:\/\/anidb\.net\/a4575\ \[Tengen\ Toppa\ Gurren\ Lagann\]\.\\nBackground\:\ In\ the\ distant\ future\,\ people\ build\ their\ homes\ and\ raise\ domestic\ animals\ in\ subterranean\ caverns\ called\ pits\.\ A\ boy\ named\ http\:\/\/anidb\.net\/ch469\ \[Simon\]\ happens\ to\ find\ a\ small\,\ shiny\ drill\ that\ unlocks\ not\ only\ a\ more\ promising\,\ but\ also\ a\ quite\ dangerous\ future\ for\ humankind\.\ Together\ with\ the\ reckless\,\ charismatic\ leader\ http\:\/\/anidb\.net\/ch468\ \[Kamina\]\ and\ the\ trigger\-happy\ http\:\/\/anidb\.net\/ch470\ \[Youko\]\,\ they\ battle\ against\ ever\ more\ powerful\ gigantic\ robots\ \—\ the\ Gunmen\ \—\ on\ the\ planet\`s\ surface\.\ The\ Spiral\ King\`s\ Four\ Supreme\ Generals\ are\ merciless\ in\ their\ quest\ to\ wipe\ mankind\ from\ the\ surface\ of\ the\ planet\ though\.\ One\ such\ fierce\ battle\ costs\ Kamina\`s\ life\.\ Simon\ is\ crushed\ by\ this\,\ but\ saving\ http\:\/\/anidb\.net\/ch471\ \[Nia\ Teppelin\]\,\ a\ discarded\ daughter\ of\ the\ Spiral\ King\,\ gives\ Simon\ hope\ again\.\.\.\\nAfter\ destroying\ the\ Four\ Supreme\ Generals\,\ Simon\ and\ his\ many\ human\ followers\ confront\ http\:\/\/anidb\.net\/ch1561\ \[Lordgenome\]\,\ the\ Spiral\ King\,\ and\ defeat\ him\.\ The\ parting\ words\ of\ the\ 1000\-year\-old\ Lordgenome\,\ who\ calls\ himself\ the\ guardian\ of\ mankind\,\ have\ an\ ominous\ ring\ to\ them\ though\,\ for\ he\ warns\ the\ humans\ about\ leaving\ the\ planet\ for\ space\ where\ far\ greater\ danger\ awaits\.\ Never\-the\-less\ mankind\ thrives\ in\ the\ following\ years\,\ rebuilding\ civilization\ on\ the\ planet\`s\ surface\.\ A\ time\ of\ prosperity\.\ The\ warning\ to\ avoid\ conquering\ space\ has\ been\ forgotten\.\.\.\\n\—\ written\ by\ foo2');
INSERT INTO animes VALUES(133,'Bakemonogatari','\化\物\語','Oishi\ Tatsuya',2009,8.44,'http://img7.anidb.net/pics/anime/79083.jpg','\*\ Based\ on\ a\ series\ of\ light\ novels\ written\ by\ http\:\/\/anidb\.net\/cr5970\ \[Nishio\ Ishin\]\ and\ illustrated\ by\ http\:\/\/anidb\.net\/cr6436\ \[Vofan\]\.\\nhttp\:\/\/anidb\.net\/ch8962\ \[Araragi\ Koyomi\]\ is\ a\ third\ year\ high\ school\ student\ who\ is\ almost\ human\ again\ after\ having\ briefly\ become\ a\ vampire\.\ One\ day\,\ a\ classmate\ named\ http\:\/\/anidb\.net\/ch8963\ \[Senjougahara\ Hitagi\]\,\ who\ infamously\ never\ talks\ to\ anyone\,\ falls\ down\ the\ stairs\ into\ Koyomi\`s\ arms\.\ He\ discovers\ that\ Hitagi\ weighs\ next\ to\ nothing\,\ in\ defiance\ of\ physics\ and\ common\ sense\ alike\.\ Despite\ being\ threatened\ by\ her\,\ Koyomi\ offers\ her\ help\,\ and\ introduces\ her\ to\ http\:\/\/anidb\.net\/ch8967\ \[Oshino\ Meme\]\,\ a\ middle\-aged\ homeless\ man\ who\ helped\ him\ stop\ being\ a\ vampire\.\\nNote\:\ Episodes\ 13\-15\ \(Tsubasa\ Cat\ parts\ 3\-5\)\ were\ not\ part\ of\ the\ initial\ TV\ broadcast\ and\ premiered\ on\ the\ anime\`s\ official\ website\.');
INSERT INTO animes VALUES(134,'La\ Maison\ en\ Petits\ Cubes','\つ\み\き\の\い\え','Katou\ Kunio',2008,8.53,'http://img7.anidb.net/pics/anime/19510.jpg','An\ old\ man\ lives\ in\ a\ town\ that\ has\ become\ submerged\ in\ water\.\ As\ the\ water\ rises\,\ he\`s\ forced\ to\ build\ additional\ levels\ onto\ his\ home\ with\ bricks\ \(cubes\)\ in\ order\ to\ stay\ above\ water\.\ One\ day\,\ the\ old\ man\ accidentally\ drops\ his\ favourite\ pipe\ into\ the\ lower\ levels\ of\ his\ home\,\ and\ decides\ to\ rent\ scuba\ diving\ equipment\ in\ order\ to\ go\ searching\ for\ his\ pipe\.\ As\ he\ descends\ through\ his\ sunken\ home\,\ the\ old\ man\ recalls\ memories\ of\ the\ past\ in\ each\ room\.\\nSource\:\ ANN\\nNote\:\ Tsumiki\ no\ Ie\ won\ the\ Best\ Animated\ Short\ Film\ category\ at\ the\ 81st\ Annual\ Academy\ Awards\.');
INSERT INTO animes VALUES(135,'Cross\ Game','\ク\ロ\ス\ゲ\ー\ム','Sekita\ Osamu',2009,9.06,'http://img7.anidb.net/pics/anime/68290.jpg','\*\ Based\ on\ a\ shounen\ manga\ by\ http\:\/\/anidb\.net\/cr859\ \[Adachi\ Mitsuru\]\,\ serialised\ in\ http\:\/\/anidb\.net\/cr23232\ \[Weekly\ Shounen\ Sunday\]\.\\nCross\ Game\ is\ the\ story\ of\ http\:\/\/anidb\.net\/ch5809\ \[Kitamura\ Kou\]\ and\ the\ four\ Tsukishima\ sisters\,\ http\:\/\/anidb\.net\/ch5812\ \[Ichiyou\]\,\ http\:\/\/anidb\.net\/ch5811\ \[Wakaba\]\,\ http\:\/\/anidb\.net\/ch5810\ \[Aoba\]\,\ and\ http\:\/\/anidb\.net\/ch5813\ \[Momiji\]\.\ The\ Tsukushima\ family\ runs\ a\ batting\ center\ with\ an\ attached\ coffee\ shop\,\ and\ Kou\`s\ father\ runs\ a\ neighbouring\ sporting\ good\ store\.\ Wakaba\ and\ Kou\ were\ born\ on\ the\ same\ day\ in\ the\ same\ hospital\,\ and\ have\ been\ close\ friends\ since\ childhood\ \—\ close\ enough\ that\ Wakaba\ treats\ Kou\ as\ her\ boyfriend\,\ even\ though\ nothing\ is\ officially\ declared\.\ Aoba\,\ who\ is\ one\ year\ younger\ than\ Wakaba\ and\ Kou\,\ doesn\`t\ like\ how\ Kou\ is\ taking\ her\ sister\ away\ from\ her\ and\ claims\ she\ hates\ him\.');
INSERT INTO animes VALUES(136,'Mobile\ Suit\ Gundam\ UC','\機\動\戦\士\ガ\ン\ダ\ムUC\ \(\ユ\ニ\コ\ー\ン\)','Furuhashi\ Kazuhiro',2010,8.22,'http://img7.anidb.net/pics/anime/37626.jpg','\*\ Adapted\ from\ the\ Gundam\ Ace\ novel\ series\ of\ the\ same\ name\,\ authored\ by\ bestselling\ Japanese\ writer\ http\:\/\/anidb\.net\/cr3117\ \[Fukui\ Harutoshi\]\.\\nThe\ story\ is\ located\ in\ a\ colony\ \"Industrial\ 7\"\ in\ UC\ \(Universal\ Century\)\ 0096\.\ It\ depicts\ an\ encounter\ of\ a\ 16\ years\ old\ student\ http\:\/\/anidb\.net\/ch13498\ \[Banagher\ Links\]\ and\ the\ pure\ white\ mobile\ suit\ \"Unicorn\ Gundam\"\,\ and\ also\ depicts\ the\ global\ basis\ war\ over\ the\ forbidden\ box\ \"Laplace\"\.\\nNote\:\ The\ first\ episode\ was\ shown\ as\ a\ premiere\ review\ in\ theaters\ on\ 20\.02\.2010\ with\ BD\ and\ DVD\ available\ as\ advance\ sales\,\ also\ starting\ from\ the\ same\ day\ it\ was\ available\ for\ purchase\ from\ Sony\`s\ Playstation\ Store\.\ Sales\ of\ the\ first\ episode\ in\ other\ stores\ started\ on\ 12\.03\.2010\.');
INSERT INTO animes VALUES(137,'Redline','REDLINE','Koike\ Takeshi',2009,8.26,'http://img7.anidb.net/pics/anime/154086.jpg','The\ most\ dangerous\ and\ exciting\ car\ race\ in\ the\ universe\ is\ held\ only\ once\ every\ five\ years\.\ And\ that\`s\ tonight\.\ The\ competitors\ are\ lined\ up\ at\ the\ starting\ block\.\ In\ his\ vehicle\,\ http\:\/\/anidb\.net\/ch25067\ \[JP\]\,\ the\ most\ daredevil\ driver\ on\ the\ circuit\,\ is\ ready\ for\ the\ green\ light\.\ Female\ driver\ http\:\/\/anidb\.net\/ch25068\ \[Sonoshee\]\,\ with\ whom\ he\ is\ secretly\ in\ love\,\ is\ also\ on\ the\ starting\ line\.\ She\ will\ stop\ at\ nothing\ to\ get\ on\ to\ that\ podium\.\ In\ this\ race\,\ not\ only\ is\ anything\ possible\,\ but\ also\ anything\ is\ allowed\.\ In\ fact\,\ their\ adversaries\ have\ modified\ their\ vehicles\ to\ equip\ them\ with\ highly\ destructive\ weapons\;\ with\ such\ participants\,\ it\ is\ hardly\ surprising\ that\ Redline\ is\ forbidden\ by\ the\ authorities\,\ who\ will\ try\ anything\ to\ halt\ the\ proceedings\.\ These\ speed\ addicts\ have\ to\ put\ themselves\ in\ mortal\ danger\ to\ achieve\ their\ aim\:\ eternal\ glory\ for\ those\ who\ finally\ mount\ the\ podium\.\\nhttp\:\/\/anidb\.net\/cr5160\ \[Takeshi\ Koike\]\`s\ first\ animated\ feature\ Redline\ was\ presented\ as\ an\ international\ premiere\ on\ the\ Piazza\ Grande\ \(Locarno\ International\ Film\ Festival\)\.\\nOpened\ in\ Japanese\ cinemas\ more\ than\ a\ year\ later\,\ on\ the\ 9th\ of\ October\ 2010\.');
INSERT INTO animes VALUES(138,'One\ Piece\ Film\:\ Strong\ World','ONE\ PIECE\ FILM\ STRONG\ WORLD','Sakai\ Munehisa',2009,8.16,'http://img7.anidb.net/pics/anime/64931.jpg','20\ years\ after\ his\ escape\ from\ Impel\ Down\,\ the\ legendary\ pirate\ http\:\/\/anidb\.net\/ch18690\ \[Shiki\]\,\ the\ Golden\ Lion\,\ reappears\ causing\ massive\ upheaval\ to\ the\ Marines\.\ During\ his\ long\ seclusion\,\ he\ was\ able\ to\ come\ up\ with\ a\ scheme\ to\ bring\ the\ World\ Government\ to\ his\ knees\.\ On\ his\ way\ to\ execute\ the\ plan\,\ http\:\/\/anidb\.net\/ch18690\ \[Shiki\]\ crosses\ paths\ with\ the\ Straw\ Hat\ Pirates\ and\ becomes\ so\ impressed\ with\ http\:\/\/anidb\.net\/ch476\ \[Nami\]\`s\ knowledge\ of\ meteorology\ that\ he\ abducts\ her\ to\ forcedly\ enlist\ her\ into\ his\ crew\.\ http\:\/\/anidb\.net\/ch474\ \[Luffy\]\ and\ the\ gang\ end\ up\ on\ a\ strange\ land\ populated\ with\ monstrous\ beasts\ as\ they\ desperately\ search\ for\ http\:\/\/anidb\.net\/ch18690\ \[Shiki\]\ and\ http\:\/\/anidb\.net\/ch476\ \[Nami\]\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(139,'Katanagatari','\刀\語','Motonaga\ Keitarou',2010,8.47,'http://img7.anidb.net/pics/anime/28668.jpg','\*\ Based\ on\ a\ light\ novel\ series\ by\ http\:\/\/anidb\.net\/cr5970\ \[Nishio\ Ishin\]\.\\nThe\ legendary\ swordsmith\ Shikizaki\ Kiki\ made\ 1000\ swords\ in\ his\ career\.\ The\ more\ of\ these\ swords\ a\ state\ had\,\ the\ greater\ the\ success\ in\ battle\.\ When\ the\ Shogun\ emerged\ victorious\,\ he\ collected\ 988\ of\ the\ swords\.\.\.\ but\ those\ were\ only\ the\ swordsmith\`s\ inferior\ practice\ pieces\.\ For\ the\ final\ twelve\ swords\ were\ the\ pinnacle\ of\ his\ career\.\ Each\ of\ them\ has\ powers\ so\ extraordinary\,\ that\ one\ man\ wielding\ one\ of\ them\ could\ defeat\ a\ small\ army\.\\nShogunate\ strategist\ http\:\/\/anidb\.net\/ch13123\ \[Togame\]\ has\ been\ ordered\ to\ recover\ all\ of\ them\.\ She\ first\ hired\ a\ ninja\.\.\.\ but\ the\ worth\ of\ the\ swords\ is\ so\ great\ the\ entire\ ninja\ clan\ defected\ the\ moment\ they\ recovered\ one\.\ Then\ she\ hired\ a\ swordsman\.\.\.\ though\ bound\ by\ honour\,\ he\ felt\ he\ should\ keep\ the\ sword\ for\ himself\.\\nHer\ last\ hope\ is\ http\:\/\/anidb\.net\/ch13122\ \[Shichika\]\,\ the\ seventh\ and\ last\ practitioner\ of\ the\ Kyotoryuu\ \—\ the\ No\ Sword\ School\.\ He\ and\ his\ sister\ live\ on\ an\ island\ cut\ off\ from\ civilization\ \—\ so\ they\ have\ no\ need\ or\ use\ for\ money\.\ His\ sword\ school\ does\ not\ use\ swords\ either\ \—\ so\ he\ would\ not\ want\ the\ swords\ for\ himself\.\\nSo\ why\ should\ he\ help\ Togame\?\\n\"Because\ you\ will\ fall\ in\ love\ with\ me\.\"\\nSource\:\ EasternStandard\.pbworks\.com');
INSERT INTO animes VALUES(140,'sunred2','\天\体\戦\士\サ\ン\レ\ッ\ド\ 2','Matsumoto\ Takehiko',2009,8.48,'http://img7.anidb.net/pics/anime/32765.jpg','While\ http\:\/\/anidb\.net\/ch6716\ \[Vamp\]\ continues\ to\ pose\ very\ little\ threat\ to\ the\ world\,\ http\:\/\/anidb\.net\/ch6713\ \[Sunred\]\ is\ able\ to\ maintain\ his\ carefree\ life\ of\ beating\ the\ living\ daylights\ out\ of\ Florsheim\ and\ freeloading\ off\ of\ his\ girlfriend\,\ http\:\/\/anidb\.net\/ch6714\ \[Kayoko\]\.\ In\ the\ meantime\,\ with\ the\ animal\ soldiers\ failing\ to\ fight\ off\ the\ local\ bullies\ and\ http\:\/\/anidb\.net\/ch6724\ \[Khamenman\]\ finally\ dragging\ himself\ into\ the\ 21st\ century\ by\ buying\ himself\ a\ car\,\ Vamp\`s\ comrades\ carry\ on\ with\ their\ mundane\ day\-to\-day\ lives\.\ With\ more\ monsters\ joining\ the\ Florsheim\ family\,\ including\ the\ amphibious\ ramen\ restaurant\ hobbyist\ http\:\/\/anidb\.net\/ch12717\ \[Goolgege\]\ and\ a\ Peeled\ Shrimp\ with\ tempura\ issues\;\ Vamp\ expecting\ an\ inspection\ from\ the\ mysterious\ Philip\;\ and\ the\ Pudding\ Empire\ planning\ an\ invasion\ on\ Earth\,\ it\ seems\ that\ Sunred\ will\ never\ be\ able\ to\ live\ a\ quiet\ life\!\\nSource\:\ Anime\-Planet');
INSERT INTO animes VALUES(141,'One\ Piece','ONE\ PIECE','Uda\ Kounosuke',1999,8.44,'http://img7.anidb.net/pics/anime/145627.jpg','It\ was\ a\ time\ when\ pirates\ ruled\ the\ seas\.\ Several\ bands\ of\ pirates\ were\ battling\ over\ the\ great\ hidden\ treasure\,\ One\ Piece\,\ which\ was\ left\ by\ the\ now\ legendary\ pirate\ captain\,\ Gold\ Roger\.\ There\ was\ a\ young\ boy\ who\ admired\ the\ pirates\,\ his\ name\ was\ http\:\/\/anidb\.net\/ch474\ \[Monkey\ D\.\ Luffy\]\.\ One\ day\,\ he\ mistakenly\ eats\ the\ devil\`s\ fruit\ and\ turns\ himself\ into\ a\ rubber\ human\ being\.\\nTen\ years\ have\ passed\ since\ that\ incident\.\ Luffy\ sets\ out\ to\ sail\ all\ alone\.\ He\ sets\ out\ to\ become\ a\ great\ pirate\ captain\ and\ that\`s\ when\ his\ great\ adventure\ begins\.\ \"I\`m\ going\ to\ be\ the\ Pirate\ King\!\ I\`m\ going\ to\ get\ One\ Piece\!\"\.');
INSERT INTO animes VALUES(142,'Princess\ Mononoke','\も\の\の\け\姫','Miyazaki\ Hayao',1997,8.7,'http://img7.anidb.net/pics/anime/13197.jpg','While\ fighting\ to\ save\ his\ village\ from\ the\ attack\ of\ a\ demon\-god\ http\:\/\/anidb\.net\/ch8724\ \[Ashitaka\]\ comes\ in\ contact\ with\ it\ and\ is\ inflicted\ with\ a\ deadly\ curse\.\ In\ his\ search\ for\ a\ cure\ he\ is\ forced\ to\ leave\ his\ village\ forever\ and\ journey\ to\ the\ forest\ inhabited\ by\ animal\ gods\.\ There\ he\ finds\ himself\ in\ the\ middle\ of\ a\ war\ between\ the\ forest\ gods\ and\ a\ village\ led\ by\ lady\ http\:\/\/anidb\.net\/ch8725\ \[Eboshi\]\.');
INSERT INTO animes VALUES(143,'NC3','\の\だ\め\カ\ン\タ\ー\ビ\レ\ \フ\ィ\ナ\ー\レ','Kon\ Chiaki',2010,8.63,'http://img7.anidb.net/pics/anime/84034.jpg','The\ musical\ love\-story\ continues\ between\ Noda\ Megumi\,\ the\ talented\ yet\ distracted\ \(almost\ childish\)\ piano\ player\,\ and\ Chiaki\ Shinichi\,\ the\ prodigious\,\ always\ focused\ on\ advancing\ forward\,\ orchesta\ conductor\.\ How\ love\ will\ finally\ find\ its\ way\ for\ these\ two\.\ Will\ it\ be\ able\ to\ surpass\ the\ challenges\ ahead\ or\ will\ it\ die\ prematurely\.\ Paris\,\ the\ city\ of\ light\,\ is\ the\ more\ accurate\ place\ to\ find\ out\ how\ this\ \"love\ musical\"\ will\ reach\ its\ finale\.');
INSERT INTO animes VALUES(144,'Hidamari\ Sketch\ x\ Hoshimittsu','\ひ\だ\ま\り\ス\ケ\ッ\チ\×\☆\☆\☆\(\ほ\し\み\っ\つ\)','Ishikura\ Ken\`ichi',2010,8.23,'http://img7.anidb.net/pics/anime/172978.jpg','\*\ Based\ on\ a\ 4\-koma\ manga\ by\ http\:\/\/anidb\.net\/cr1530\ \[Aoki\ Ume\]\,\ serialised\ in\ Manga\ Time\ Kirara\ Carat\.\\nA\ year\ later\,\ the\ daily\ life\ of\ the\ students\ of\ the\ http\:\/\/anidb\.net\/ch19195\ \[Hidamari\ Sou\]\ at\ Yamabuki\ High\ School\ continues\:\ http\:\/\/anidb\.net\/ch7056\ \[Yuno\]\ and\ http\:\/\/anidb\.net\/ch7057\ \[Miyako\]\ are\ second\ years\,\ http\:\/\/anidb\.net\/ch7059\ \[Sae\]\ and\ http\:\/\/anidb\.net\/ch7058\ \[Hiro\]\ are\ third\ years\,\ and\ two\ new\ students\,\ http\:\/\/anidb\.net\/ch13987\ \[Nori\]\ and\ http\:\/\/anidb\.net\/ch13986\ \[Nazuna\]\,\ move\ into\ the\ Hidamari\ Sou\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(145,'Gintama\:\ The\ Movie','\劇\場\版\ \銀\魂\ \新\訳\紅\桜\篇','Takamatsu\ Shinji',2010,8.21,'http://img7.anidb.net/pics/anime/59371.jpg','Odd\ Jobs\ Gin\ has\ taken\ on\ a\ lot\ of\ odd\ work\ in\ the\ past\,\ and\ when\ you\`re\ a\ Jack\ of\ All\ Trades\ agency\ based\ in\ a\ feudal\ Japan\ that\`s\ been\ conquered\ and\ colonized\ by\ aliens\,\ the\ term\ Odd\ Jobs\ means\ REALLY\ ODD\ jobs\.\ But\ when\ some\ more\ than\ slightly\ suspicious\ secrets\ from\ the\ shadows\ of\ OJG\ founder\ http\:\/\/anidb\.net\/ch1162\ \[Sakata\ Gintoki\]\`s\ somewhat\ shady\ former\ samurai\ past\ and\ a\ new\ pair\ of\ odd\ jobs\ collide\,\ the\ action\ is\ bound\ to\ get\ so\ wild\ and\ demented\ that\ only\ a\ feature\ film\ will\ do\ it\ justice\!\\nSo\ if\ you\`ve\ had\ the\ good\ fortune\ to\ see\ Gintama\,\ Japan\`s\ most\ popular\ science\ fiction\ samurai\ series\ before\,\ get\ ready\ for\ more\ of\ the\ same\ on\ an\ epic\ scale\!\ And\ if\ you\ haven\`t\ seen\ Gintama\ before\,\ well\,\ this\ is\ your\ quick\ and\ easy\ introduction\ to\ why\ Gintama\ \(the\ series\)\ is\ the\ hottest\ thing\ to\ hit\ the\ Land\ of\ the\ Rising\ Sun\ since\ a\ certain\ large\,\ green\ reptile\ whose\ name\ we\ can\`t\ use\ due\ to\ certain\ litigious\ lawyers\!\\nSo\ sit\ down\,\ strap\ yourself\ in\ and\ make\ sure\ you\`re\ not\ wearing\ anything\ too\ tight\ or\ constricting\ as\ the\ junior\ half\ of\ OJG\ takes\ on\ the\ task\ of\ tracking\ down\ a\ tenacious\ terrorist\ while\ their\ silver\-haired\ slickster\ of\ a\ partner\ seeks\ out\ a\ certain\ sword\ in\ the\ side\-splittingly\ silly\ Gintama\ \-\ The\ Movie\!\\nSource\:\ Sentai\ Filmworks');
INSERT INTO animes VALUES(146,'xxxHOLiC\ Rou','xxxHOLiC\・\籠','Mizushima\ Tsutomu',2010,8.2,'http://img7.anidb.net/pics/anime/40508.jpg','http\:\/\/anidb\.net\/ch859\ \[Yuuko\]\`s\ time\ flow\ finally\ starts\ moving\ again\.\ After\ being\ alive\ for\ an\ unknown\ number\ of\ years\,\ she\ must\ depart\ now\ since\ she\ can\`t\ be\ held\ by\ the\ world\ of\ the\ living\ any\ longer\.\ In\ her\ last\ moments\,\ she\ faces\ http\:\/\/anidb\.net\/ch860\ \[Watanuki\]\ and\ makes\ her\ final\ wish\:\ \"Stay\ alive\"\.\ In\ response\,\ Watanuki\ makes\ the\ promise\ to\ remain\ in\ the\ shop\ of\ wishes\ until\ they\ meet\ again\.\ Many\ years\ later\,\ he\ still\ keeps\ that\ promise\ and\ performs\ the\ duties\ of\ a\ shopkeeper\,\ granting\ wishes\ of\ those\ who\ come\ to\ him\.\\nSource\:\ ANN\\nNote\:\ The\ first\ episode\ was\ bundled\ with\ limited\ edition\ copies\ of\ XXXHOLiC\ manga\ volume\ 17\ \(originally\ announced\ for\ release\ with\ the\ 16th\ manga\ volume\)\,\ and\ the\ second\ episode\ with\ the\ limited\ edition\ of\ volume\ 19\,\ which\ was\ also\ the\ last\ volume\ of\ the\ manga\.');
INSERT INTO animes VALUES(147,'No\ Longer\ Human\:\ Director\`s\ Cut\ Edition','\人\間\失\格\ \デ\ィ\レ\ク\タ\ー\ズ\カ\ッ\ト\版','Asaka\ Morio',2009,8.17,'http://img7.anidb.net/pics/anime/40735.jpg','A\ theatrical\ film\ version\ of\ Madhouse\`s\ http\:\/\/anidb\.net\/a7056\ \[Aoi\ Bungaku\ Series\]\ anime\.\ The\ film\ will\ re\-edit\ the\ four\ episodes\ based\ on\ Osamu\ Dazai\`s\ No\ Longer\ Human\ \(Ningen\ Shikkaku\)\ novel\,\ which\ have\ character\ designs\ inspired\ by\ manga\ artist\ and\ novel\ illustrator\ Takeshi\ Obata\.\ This\ \"director\`s\ cut\"\ will\ include\ new\ \"navigation\"\ footage\ which\ is\ being\ created\ specifically\ for\ the\ film\ with\ narrator\ Masato\ Sakai\.');
INSERT INTO animes VALUES(148,'The\ Disappearance\ of\ Haruhi\ Suzumiya','\涼\宮\ハ\ル\ヒ\の\消\失','Takemoto\ Yasuhiro',2010,9.4,'http://img7.anidb.net/pics/anime/133464.jpg','\*\ Adaptation\ of\ http\:\/\/anidb\.net\/cr536\ \[Tanigawa\ Nagaru\]\`s\ fourth\ Suzumiya\ Haruhi\ light\ novel\.\\nIt\ is\ mid\-December\,\ and\ SOS\ Brigade\ chief\ http\:\/\/anidb\.net\/ch271\ \[Suzumiya\ Haruhi\]\ announces\ that\ the\ brigade\ is\ going\ to\ hold\ a\ Christmas\ party\ in\ their\ clubroom\,\ with\ Japanese\ hotpot\ for\ dinner\.\ The\ brigade\ members\ http\:\/\/anidb\.net\/ch272\ \[Kyon\]\,\ http\:\/\/anidb\.net\/ch274\ \[Nagato\ Yuki\]\,\ http\:\/\/anidb\.net\/ch278\ \[Asahina\ Mikuru\]\ and\ http\:\/\/anidb\.net\/ch349\ \[Koizumi\ Itsuki\]\ start\ preparing\ everything\ for\ the\ party\,\ such\ as\ costumes\ and\ decorations\.\ But\ a\ couple\ of\ days\ later\,\ Kyon\ arrives\ at\ school\ only\ to\ find\ that\ Haruhi\ is\ missing\.\ Not\ only\ that\,\ but\ Mikuru\ claims\ she\ has\ never\ known\ Kyon\ before\,\ Koizumi\ is\ also\ missing\,\ and\ Yuki\ has\ become\ the\ sole\ member\ of\ the\ literature\ club\.\ The\ SOS\ Brigade\ seems\ to\ have\ never\ existed\,\ nor\ has\ Suzumiya\ Haruhi\.\ No\ one\ in\ the\ school\ has\ ever\ heard\ about\ her\.\.\.\ except\ for\ Kyon\.\\nNow\ it\ is\ up\ to\ him\ to\ travel\ back\ through\ time\ to\ find\ Haruhi\ and\ correct\ the\ temporal\ anomaly\.');
INSERT INTO animes VALUES(149,'major6','\メ\ジ\ャ\ー\ \(2010\)','Fukushima\ Toshinori',2010,8.17,'http://img7.anidb.net/pics/anime/40033.jpg','The\ sixth\ season\ begins\ after\ the\ \"Baseball\ World\ Cup\"\ has\ ended\.\ Goro\ regained\ his\ passion\ for\ baseball\ in\ Japan\ thanks\ to\ his\ friends\,\ and\ left\ to\ join\ the\ Hornets\ baseball\ team\ in\ preperation\ to\ the\ new\ season\.\ When\ he\ arrives\ in\ America\ he\ starts\ to\ celebrate\ his\ role\ as\ a\ Major\ League\ pitcher\ at\ last\!\ Goro\`s\ family\ and\ friends\ gathers\ in\ groups\ in\ Japan\ to\ watch\ Goro\`s\ debut\ in\ the\ Major\ League\.\ However\,\ Goro\`s\ debut\ is\ the\ beginning\ of\ a\ line\ of\ surprising\ happenings\,\ that\ has\ an\ outcome\ no\ one\ expected\.\.\.');
INSERT INTO animes VALUES(150,'The\ Tatami\ Galaxy','\四\畳\半\神\話\大\系','Yuasa\ Masaaki',2010,8.72,'http://img7.anidb.net/pics/anime/48683.jpg','\*\ Based\ on\ a\ novel\ by\ http\:\/\/anidb\.net\/cr11105\ \[Morimi\ Tomihiko\]\.\\nThe\ story\ of\ The\ Tatami\ Galaxy\ follows\ an\ http\:\/\/anidb\.net\/ch15129\ \[unnamed\ third\ year\ university\ student\]\ in\ Kyoto\,\ Japan\ and\ what\ he\ views\ as\ his\ wasted\ time\ in\ a\ particular\ club\ \(also\ called\ circle\)\ at\ his\ university\.\ He\ meets\ http\:\/\/anidb\.net\/ch15126\ \[Ozu\]\,\ another\ student\,\ whose\ encouragement\ sets\ him\ on\ a\ mission\ of\ dubious\ morality\.\ He\ contemplates\ his\ affection\ for\ a\ second\ year\ engineering\ student\,\ http\:\/\/anidb\.net\/ch15127\ \[Akashi\]\,\ and\ makes\ promises\ to\ her\,\ usually\ of\ and\ within\ a\ romantic\ subtext\.\ The\ culmination\ of\ his\ dubious\ missions\ often\ conflict\ with\ his\ interest\ in\ her\ in\ some\ way\.\ The\ story\ is\ one\ of\ a\ number\ that\ draw\ on\ the\ author\`s\ experience\ in\ Kyoto\ University\.\\nSource\:\ Wikipedia');
INSERT INTO animes VALUES(151,'Time\ of\ Eve\:\ The\ Movie','\イ\ヴ\の\時\間\ \劇\場\版','Yoshiura\ Yasuhiro',2010,9.06,'http://img7.anidb.net/pics/anime/53146.jpg','\*\ A\ theatrical\ feature\-length\ version\ of\ the\ http\:\/\/anidb\.net\/a5132\ \[six\-part\ web\ series\ Eve\ no\ Jikan\]\,\ with\ additional\ new\ scenes\.\\nIn\ the\ near\ future\,\ probably\ in\ Japan\,\ long\ after\ robots\ have\ been\ put\ to\ practical\ use\,\ and\ not\ so\ long\ since\ human\-type\ robots\,\ or\ androids\ have\ appeared\.\\nDue\ to\ the\ Robot\ Ethical\ Committee\,\ people\ take\ it\ for\ granted\ to\ treat\ robots\ as\ electronic\ appliances\.\ However\,\ because\ of\ their\ human\ appearance\,\ except\ for\ the\ halos\ above\ their\ heads\,\ some\ humans\ \—\ called\ dori\-kei\ \(android\-style\)\ \—\ are\ becoming\ too\ attracted\ to\ these\ androids\,\ and\ this\ is\ causing\ new\ social\ problems\.\\nhttp\:\/\/anidb\.net\/ch13547\ \[Rikuo\]\ has\ been\ taught\ to\ treat\ androids\ the\ way\ he\ does\ since\ he\ was\ a\ child\.\ He\ does\ not\ think\ of\ androids\ as\ human\ beings\,\ and\ uses\ them\ as\ useful\ tools\.\ One\ day\,\ he\ discovers\ that\ ominous\ words\ were\ recorded\ in\ home\-android\ http\:\/\/anidb\.net\/ch13549\ \[Sammy\]\`s\ activity\ log\:\\n\"Are\ you\ enjoying\ the\ time\ of\ EVE\?\"\\nTracing\ her\ footsteps\ with\ his\ friend\ http\:\/\/anidb\.net\/ch13548\ \[Masaki\]\,\ they\ arrive\ at\ a\ strange\ cafe\ that\ has\ put\ up\ the\ slogan\ not\ to\ discriminate\ between\ human\ beings\ and\ androids\.');
INSERT INTO animes VALUES(152,'The\ Secret\ World\ of\ Arrietty','\借\り\ぐ\ら\し\の\ア\リ\エ\ッ\テ\ィ','Yonebayashi\ Hiromasa',2010,8.15,'http://img7.anidb.net/pics/anime/59881.jpg','\*\ Based\ on\ the\ children\`s\ fantasy\ novel\ The\ Borrowers\ by\ http\:\/\/anidb\.net\/cr11189\ \[Mary\ Norton\]\,\ which\ received\ the\ Carnegie\ Medal\ in\ 1952\.\\nA\ family\ of\ little\ people\ lives\ under\ the\ floorboards\ of\ an\ old\ house\ far\ out\ in\ the\ countryside\,\ surviving\ by\ secretly\ borrowing\ items\ from\ the\ humans\ who\ inhabit\ it\.\ One\ day\,\ their\ existence\ is\ discovered\ by\ a\ kind\ young\ boy\ named\ http\:\/\/anidb\.net\/ch18460\ \[Shou\]\,\ who\ is\ visiting\ his\ grandmother\,\ to\ find\ some\ quiet\ before\ his\ upcoming\ heart\ operation\.\.\.\\nNote\:\ Although\ the\ original\ novel\ was\ set\ in\ England\ during\ the\ 1950s\,\ the\ http\:\/\/anidb\.net\/cr729\ \[Ghibli\]\ version\ takes\ place\ in\ present\-day\ Japan\.');
INSERT INTO animes VALUES(153,'Samurai\ X\:\ Trust\ \&\ Betrayal','\る\ろ\う\に\剣\心\ \-\明\治\剣\客\浪\漫\譚\-\ \追\憶\編','Furuhashi\ Kazuhiro',1999,9.05,'http://img7.anidb.net/pics/anime/49378.jpg','Taken\ by\ slavers\ when\ he\ was\ a\ child\,\ http\:\/\/anidb\.net\/ch443\ \[Himura\ Kenshin\]\ is\ rescued\ only\ when\ an\ encounter\ with\ bandits\ kills\ off\ everyone\ but\ him\.\ He\ is\ found\ by\ a\ master\ of\ the\ Divine\ Justice\ School\ of\ Swordmanship\,\ a\ school\ so\ deadly\ that\ to\ train\ in\ it\,\ means\ death\ for\ either\ the\ master\ or\ student\,\ there\ can\ only\ be\ one\ master\.\ Taken\ by\ the\ master\,\ Kenshin\ is\ trained\ in\ this\ school\,\ only\ to\ leave\ before\ finishing\ so\ that\ he\ may\ join\ the\ Meiji\ restoration\ and\ help\ prevent\ further\ tragedies\ like\ his\ own\.\\nThus\ is\ born\ the\ Battousai\,\ the\ greatest\ strength\ of\ the\ Ishin\ Patriots\,\ a\ boy\ of\ 15\ who\ kills\ for\ the\ sake\ of\ building\ a\ new\,\ better\ world\.\ One\ night\,\ he\ comes\ across\ a\ mysterious\ woman\,\ http\:\/\/anidb\.net\/ch446\ \[Tomoe\]\.\ He\ must\ hide\ with\ her\ when\ the\ revolution\ stumbles\.\ They\ marry\ for\ appearances\,\ but\ soon\ fall\ in\ love\.\ Tomoe\ has\ another\ reason\ to\ be\ with\ Kenshin\,\ one\ she\ regrets\ but\ cannot\ stop\.\ Revenge\ must\ be\ satisfied\,\ and\ only\ blood\ can\ do\ that\.\\nSource\:\ ANN\\nNote\:\ Tsuioku\ Hen\ was\ later\ collected\ into\ a\ two\ hour\ feature\-length\ motion\ picture\ with\ new\ animated\ sequences\.');
INSERT INTO animes VALUES(154,'Heart\ and\ Yummie','\お\ま\え\う\ま\そ\う\だ\な','Fujimori\ Masaya',2010,8.25,'http://img7.anidb.net/pics/anime/67958.jpg','A\ female\ Maiasaura\ finds\ a\ lost\ egg\ and\ decides\ to\ take\ care\ of\ it\ along\ with\ her\ own\ baby\.\ Much\ to\ everyone\`s\ surprise\,\ the\ child\ born\ from\ the\ stray\ egg\ is\ a\ Tyrannosaurus\.\ Although\ the\ baby\ is\ a\ carnivore\ and\ his\ adoptive\ mother\ a\ herbivore\,\ she\ is\ determined\ not\ to\ leave\ the\ newborn\ behind\,\ so\ she\ abandons\ the\ pack\ and\ raises\ the\ two\ kids\ by\ herself\.\\nNamed\ Heart\ by\ his\ mother\,\ the\ Tyrannosaurus\ grows\ up\ together\ with\ his\ Maiasaura\ brother\,\ Light\.\ Soon\ enough\,\ Heart\ realizes\ the\ difference\ between\ carnivores\ and\ herbivores\;\ as\ a\ result\,\ he\ makes\ the\ tough\ decision\ of\ leaving\ the\ family\ and\ discovering\ where\ he\ belongs\.\\nOne\ day\,\ Heart\ stumbles\ upon\ a\ baby\ Ankylosaurus\.\ The\ baby\ mistakes\ him\ for\ his\ father\,\ and\ accepts\ the\ word\ \"umasou\"\,\ which\ means\ \"you\ seem\ delicious\"\,\ as\ his\ actual\ name\.\ Originally\ intending\ to\ eat\ him\,\ Heart\ comes\ to\ be\ genuinely\ concerned\ for\ Umasou\`s\ well\-being\ as\ a\ familial\ bond\ develops\ between\ them\.');
INSERT INTO animes VALUES(155,'Steins\;Gate','Steins\;Gate','Kobayashi\ Tomoki',2011,9.34,'http://img7.anidb.net/pics/anime/68889.jpg','\*\ Based\ on\ a\ visual\ novel\ by\ http\:\/\/anidb\.net\/cr1334\ \[5pb\]\ and\ http\:\/\/anidb\.net\/cr1354\ \[Nitroplus\]\.\\nIn\ Akihabara\ a\ group\ of\ friends\ have\ managed\ to\ customize\ their\ microwave\ into\ a\ device\ that\ can\ send\ text\ messages\ into\ the\ past\.\ As\ they\ perform\ different\ experiments\,\ an\ organization\ named\ http\:\/\/anidb\.net\/ch38123\ \[SERN\]\ who\ has\ been\ doing\ their\ own\ research\ on\ time\ travel\ tracks\ them\ down\ and\ now\ the\ friends\ have\ to\ find\ a\ way\ to\ avoid\ being\ captured\ by\ them\.\\nNote\:\ The\ first\ episode\ received\ a\ preview\ screening\ in\ Tokyo\ on\ Sunday\,\ March\ 6\,\ 2011\.\ Participants\ were\ chosen\ through\ an\ email\ lottery\ held\ until\ Monday\,\ February\ 28\.\ Two\ other\ preview\ screenings\ were\ held\ in\ Aichi\,\ Nagoya\`s\ Gamers\ branch\ on\ Saturday\,\ March\ 12\ and\ Osaka\,\ Namba\`s\ Gamers\ branch\ on\ Sunday\,\ March\ 13\.\ Tickets\ for\ those\ two\ events\ were\ given\ out\ to\ people\ who\ pre\-ordered\ and\ paid\ either\ the\ opening\ or\ ending\ single\.\ The\ regular\ television\ broadcast\ started\ on\ April\ 6\,\ 2011\.');
INSERT INTO animes VALUES(156,'Puella\ Magi\ Madoka\ Magica','\魔\法\少\女\ま\ど\か\★\マ\ギ\カ\ PUELLA\ MAGI\ MADOKA\ MAGICA','Miyamoto\ Yukihiro',2011,8.55,'http://img7.anidb.net/pics/anime/65491.jpg','Having\ a\ loving\ family\,\ close\ friends\,\ experiencing\ times\ of\ joy\ and\ times\ of\ sadness\.\ These\ are\ the\ things\ that\ make\ up\ an\ ordinary\ life\.\\nhttp\:\/\/anidb\.net\/ch24746\ \[Kaname\ Madoka\]\ is\ a\ normal\ 2nd\ year\ middle\-schoolgirl\ who\ lives\ such\ an\ ordinary\ life\.\ Until\,\ that\ is\,\ a\ strange\ encounter\ occurs\.\ She\ does\ not\ know\ if\ this\ encounter\ is\ coincidence\,\ or\ the\ vagaries\ of\ fate\,\ but\ two\ things\ are\ certain\.\.\.\\nThis\ is\ the\ moment\ when\ her\ destiny\ changes\.\.\.\\nThis\ is\ the\ start\ of\ a\ new\ magical\ girl\ story\!\\n\~\ translated\ and\ adapted\ from\ the\ official\ site\ by\ Cranston\\nNote\:\ Won\ the\ Television\ Award\ at\ the\ 16th\ Animation\ Kobe\ Awards\ \(2011\)\,\ 12\ NewType\ Anime\ Awards\,\ including\ Best\ Anime\ Series\,\ Director\,\ Screenplay\,\ and\ Design\,\ and\ the\ Grand\ Prize\ in\ the\ animation\ category\ at\ the\ 15th\ Japan\ Media\ Arts\ Festival\.');
INSERT INTO animes VALUES(157,'Gintama\`\ \(2011\)','\銀\魂\´','Fujita\ Youichi',2011,9.37,'http://img7.anidb.net/pics/anime/68925.jpg','Gintama\`\ starts\ off\ 2\ years\ after\ the\ original\ series\ and\ pretty\ much\ continues\ the\ legacy\ of\ Gintama\.\\nSomehow\ Shinpachi\ and\ Hijikata\ feel\ to\ have\ been\ \"left\ behind\"\ because\ everybody\ but\ themselves\ changed\ in\ those\ 2\ years\ that\ they\ didn\`t\ realize\ had\ been\ passed\.\.\.\ or\ did\ they\?\\nNote\:\ Clarified\ by\ the\ man\ Gintoki\ himself\ at\ the\ beginning\ of\ episode\ 5\,\ the\ title\`s\ pronounciation\ is\ neither\ Gintama\ Dash\ or\ Gintama\ Dot\,\ it\`s\ simply\ Gintama\.\ The\ little\ dot\ is\ just\ there\ for\ grown\ up\ reasons\,\ because\ they\ grow\ hair\ down\ there\ and\ so\ on\.\.\.');
INSERT INTO animes VALUES(158,'Bakuman\.\ \(2011\)','\バ\ク\マ\ン\.\ \(2011\)','Akitaya\ Noriaki',2011,8.34,'http://img7.anidb.net/pics/anime/78598.jpg','After\ the\ decision\ to\ serialise\ Moritaka\ and\ Akito\ has\ been\ made\,\ they\ are\ introduced\ to\ Miura\,\ their\ new\ manager\.\ At\ first\,\ the\ two\ thought\ it\ was\ a\ joke\,\ but\ Hattori\ gives\ them\ a\ pep\ talk\ before\ leaving\.\ While\ Miura\ does\ not\ seem\ like\ a\ bad\ person\,\ he\ is\ given\ to\ rudeness\,\ and\ the\ duo\ worry\ about\ their\ future\.\ In\ addition\,\ the\ duo\ are\ given\ 3\ assistants\ to\ work\ on\ their\ manuscript\,\ and\ with\ the\ assistance\ of\ Ozawa\,\ an\ experienced\ assistant\,\ their\ work\ progresses\ well\.\\nAt\ the\ start\ of\ the\ new\ year\,\ Moritaka\ and\ Akito\ both\ attend\ Shounen\ Jack\`s\ New\ Year\ Party\.\ There\,\ they\ meet\ Hiramaru\ Kazuya\,\ said\ to\ be\ a\ genius\ of\ a\ whole\ different\ level\ from\ Eiji\.\\n\~\ translated\ and\ adapted\ from\ official\ site\ by\ Cranston');
INSERT INTO animes VALUES(159,'Fate\/Zero','Fate\/Zero','Aoki\ Ei',2011,8.68,'http://img7.anidb.net/pics/anime/61322.jpg','\*\ Based\ on\ http\:\/\/anidb\.net\/cr2442\ \[Urobuchi\ Gen\]\ and\ http\:\/\/anidb\.net\/cr927\ \[Type\-Moon\]\`s\ 2006\-2007\ Fate\/Zero\ novel\,\ a\ prequel\ to\ Type\-Moon\`s\ much\ acclaimed\ Fate\/Stay\ Night\ 2004\ visual\ novel\.\\nThe\ Holy\ Grail\ War\ is\ a\ death\-match\ between\ 7\ magi\ \(Masters\)\ and\ their\ summoned\ heroic\ spirits\ \(Servants\)\.\ In\ this\ battle\ royale\,\ the\ prize\ is\ the\ legendary\ Holy\ Grail\,\ said\ to\ be\ an\ omnipotent\ wish\-granting\ device\ which\ will\ produce\ any\ sort\ of\ miracle\ in\ order\ to\ bend\ reality\ to\ accommodate\ the\ wishes\ it\ grants\.\ The\ winning\ Master\ and\ Servant\ shall\ be\ granted\ one\ wish\ each\,\ after\ which\ the\ Holy\ Grail\ will\ not\ be\ activated\ until\ the\ next\ War\.\\nThe\ 4th\ Holy\ Grail\ War\ is\ about\ to\ take\ place\,\ and\ the\ 3\ preceding\ Wars\ had\ ended\ without\ a\ victor\.\ In\ pursuit\ of\ their\ individual\ goals\ and\ ambitions\,\ the\ competing\ magi\ congregate\ at\ a\ Japanese\ city\ called\ Fuyuki\.\ All\ the\ magi\ will\ do\ anything\,\ rationalize\ away\ any\ atrocity\,\ in\ pursuit\ of\ the\ Holy\ Grail\.\ All\ of\ them\,\ but\ one\.\\nhttp\:\/\/anidb\.net\/ch1916\ \[Kotomine\ Kirei\]\ is\ a\ Master\,\ but\ one\ without\ a\ reason\ to\ fight\.\ Unable\ to\ release\ himself\ from\ the\ threads\ of\ Fate\,\ he\ is\ reluctantly\ drawn\ into\ the\ War\.\ To\ enter\ the\ War\,\ he\ even\ had\ to\ stray\ from\ his\ path\ in\ the\ Holy\ Church\ and\ join\ the\ ranks\ of\ the\ Mage\`s\ Association\,\ an\ organization\ with\ which\ the\ Church\ is\ not\ on\ good\ terms\,\ but\ which\ it\ has\ to\ tolerate\ and\ sometimes\ even\ cooperate\ with\.\\nHowever\,\ as\ Fate\ would\ ironically\ have\ it\,\ one\ of\ his\ rival\ Masters\,\ http\:\/\/anidb\.net\/ch1919\ \[Emiya\ Kiritsugu\]\,\ is\ a\ man\ more\ merciless\ than\ anyone\ else\,\ an\ assassin\ who\ killed\ many\ people\ and\ intervened\ in\ many\ conflicts\,\ for\ reasons\ no\ one\ is\ able\ to\ understand\.\ Kirei\`s\ fight\ against\ this\ interesting\ yet\ strange\ sort\ of\ enemy\ might\ prove\ to\ be\ his\ most\ troubling\ task\ so\ far\.\ Kiritsugu\ is\ equally\ puzzled\ by\ Kirei\,\ and\ both\ of\ them\ still\ have\ the\ other\ Masters\ and\ Servants\ to\ take\ care\ of\.\\n\—\ written\ by\ Hinoe');
INSERT INTO animes VALUES(160,'Anohana\:\ The\ Flower\ We\ Saw\ That\ Day','\あ\の\日\見\た\花\の\名\前\を\僕\達\は\ま\だ\知\ら\な\い\.','Nagai\ Tatsuyuki',2011,8.49,'http://img7.anidb.net/pics/anime/65553.jpg','When\ http\:\/\/anidb\.net\/ch28416\ \[Yadomi\ Jinta\]\ was\ a\ child\,\ he\ was\ a\ central\ piece\ in\ a\ group\ of\ close\ friends\.\ In\ time\,\ however\,\ these\ childhood\ friends\ drifted\ apart\,\ and\ when\ they\ became\ high\ school\ students\,\ they\ had\ long\ ceased\ to\ think\ of\ each\ other\ as\ friends\.\\nOne\ of\ the\ friends\ from\ that\ group\,\ http\:\/\/anidb\.net\/ch28417\ \[Honma\ Meiko\]\,\ now\ has\ a\ wish\ she\ asks\ Jinta\ to\ fulfil\.\ The\ problem\ is\,\ she\ can\`t\ remember\ what\ her\ wish\ is\ anymore\.\ As\ Meiko\ won\`t\ cease\ to\ bother\ Jinta\ about\ it\,\ he\ gives\ in\ and\ decides\ to\ try\ to\ grant\ this\ wish\ he\ knows\ nothing\ of\;\ for\ that\,\ however\,\ the\ help\ of\ his\ other\ former\ friends\,\ now\ all\ very\ estranged\ from\ himself\ and\ from\ each\ other\,\ may\ turn\ out\ to\ be\ necessary\.\ He\ hasn\`t\ spoken\ to\ http\:\/\/anidb\.net\/ch28415\ \[Anjou\ Naruko\]\,\ http\:\/\/anidb\.net\/ch28418\ \[Matsuyuki\ Atsumu\]\,\ http\:\/\/anidb\.net\/ch28419\ \[Tsurumi\ Chiriko\]\,\ or\ http\:\/\/anidb\.net\/ch28414\ \[Hisakawa\ Tetsudou\]\ in\ a\ long\ time\;\ as\ he\ struggles\ to\ grant\ Meiko\`s\ wish\ and\ gathers\ his\ old\ friends\ together\ in\ the\ process\,\ all\ the\ old\ feelings\ that\ still\ exist\ between\ them\ and\ have\ long\ been\ stashed\ away\ are\ bound\ to\ come\ up\ again\.\\n\—\ written\ by\ Hinoe\\nNote\:\ The\ first\ episode\ was\ scheduled\ to\ receive\ a\ preview\ screening\ as\ part\ of\ an\ event\ at\ Animecontents\ Expo\`s\ Makuhari\ Messe\ Red\ Stage\ on\ Saturday\,\ 26th\ March\,\ 2011\.\ However\,\ the\ Animecontents\ Expo\ was\ cancelled\ following\ the\ Great\ Tohoku\ Earthquake\.');
INSERT INTO animes VALUES(161,'Bunny\ Drop','\う\さ\ぎ\ド\ロ\ッ\プ','Kamei\ Kanta',2011,9.23,'http://img7.anidb.net/pics/anime/72003.jpg','\*\ Based\ on\ josei\ manga\ series\ Usagi\ Drop\ by\ http\:\/\/anidb\.net\/cr12075\ \[Unita\ Yumi\]\,\ serialised\ in\ Feel\ Young\ magazine\.\\nGoing\ home\ for\ his\ grandfather\`s\ funeral\,\ thirty\-year\-old\ bachelor\ http\:\/\/anidb\.net\/ch32124\ \[Daikichi\]\ is\ floored\ to\ discover\ that\ the\ old\ man\ had\ an\ illegitimate\ child\ with\ a\ younger\ lover\.\ The\ rest\ of\ his\ family\ is\ equally\ shocked\ and\ embarrassed\ by\ this\ surprise\ development\,\ and\ not\ one\ of\ them\ wants\ anything\ to\ do\ with\ the\ silent\ little\ girl\,\ http\:\/\/anidb\.net\/ch32125\ \[Rin\]\.\ In\ a\ fit\ of\ angry\ spontaneity\,\ Daikichi\ decides\ to\ take\ her\ in\ himself\.\ But\ will\ living\ with\ this\ overgrown\ teenager\ of\ man\ help\ Rin\ come\ out\ of\ her\ shell\?\ And\ will\ not\ this\ turn\ of\ events\ spell\ doom\ for\ Daikichi\`s\ love\ life\?');
INSERT INTO animes VALUES(162,'Out\ of\ Sight','Out\ of\ Sight','',2010,8.41,'http://img7.anidb.net/pics/anime/65862.jpg','\*\ Graduation\ production\ made\ by\ three\ students\ graduated\ from\ the\ National\ Taiwan\ University\ of\ Arts\.\\nThe\ purse\ of\ a\ little\ blind\ girl\ named\ http\:\/\/anidb\.net\/ch32817\ \[Chico\]\ is\ stolen\ in\ broad\ daylight\.\ As\ her\ guide\ dog\ http\:\/\/anidb\.net\/ch32818\ \[Gogo\]\ follows\ the\ robber\ she\ strays\ from\ the\ road\ she\ is\ familiar\ with\.\ After\ passing\ through\ a\ hole\ a\ wooden\ fence\,\ she\ enters\ an\ unknown\ world\ and\ unfolds\ a\ magical\ adventure\ depending\ on\ senses\ other\ than\ vision\ and\ her\ imagination\.');
INSERT INTO animes VALUES(163,'Natsume\`s\ Book\ of\ Friends\ \(3\)','\夏\目\友\人\帳\ \参','Oomori\ Takahiro',2011,8.72,'http://img7.anidb.net/pics/anime/68399.jpg','\*\ Based\ on\ a\ manga\ by\ http\:\/\/anidb\.net\/cr3542\ \[Midorikawa\ Yuki\]\ serialised\ in\ http\:\/\/anidb\.net\/cr23820\ \[LaLa\ DX\]\ in\ 2005\,\ before\ switching\ to\ LaLa\ in\ 2008\.\\nhttp\:\/\/anidb\.net\/ch1806\ \[Natsume\ Takashi\]\ has\ been\ able\ to\ see\ yokai\ since\ his\ early\ days\.\ His\ grandmother\,\ http\:\/\/anidb\.net\/ch1808\ \[Reiko\]\,\ possessed\ the\ Yujin\-chou\,\ a\ list\ of\ names\ of\ yokai\ sworn\ to\ fealty\.\ Ever\ since\ Takashi\ inherited\ the\ list\,\ he\ has\ been\ constantly\ attacked\ by\ yokai\.\\nTakashi\,\ however\,\ has\ decided\ to\ return\ to\ the\ yokai\ their\ names\.\ Together\ with\ his\ self\-proclaimed\ bodyguard\ http\:\/\/anidb\.net\/ch1807\ \[Nyanko\]\,\ Takashi\ has\ met\ and\ come\ to\ know\ many\ yokai\.\\n\~\ adapted\ and\ translated\ from\ official\ site\ by\ Cranston');
INSERT INTO animes VALUES(164,'Hotarubi\ no\ Mori\ he','\蛍\火\の\杜\へ','Oomori\ Takahiro',2011,8.45,'http://img7.anidb.net/pics/anime/46099.jpg','One\ hot\ summer\ day\ http\:\/\/anidb\.net\/ch31642\ \[Hotaru\]\,\ a\ little\ girl\,\ gets\ lost\ in\ an\ enchanted\ forest\ of\ the\ mountain\ god\ where\ spirits\ reside\.\ A\ young\ boy\,\ http\:\/\/anidb\.net\/ch31641\ \[Gin\]\,\ appears\ before\ Hotaru\,\ but\ she\ cannot\ touch\ him\ for\ fear\ of\ making\ him\ disappear\.\ And\ so\ a\ wondrous\ adventure\ awaits\ Hotaru\.\.\.');
INSERT INTO animes VALUES(165,'Mobile\ Suit\ Gundam\:\ The\ Origin','\機\動\戦\士\ガ\ン\ダ\ムTHE\ ORIGIN','Imanishi\ Takashi',2015,8.87,'http://img7.anidb.net/pics/anime/155664.jpg','A\ re\-imagining\ of\ http\:\/\/anidb\.net\/cr147\ \[Tomino\ Yoshiyuki\]\`s\ and\ http\:\/\/anidb\.net\/cr726\ \[Sunrise\]\`s\ first\ http\:\/\/anidb\.net\/a715\ \[Gundam\]\ TV\ series\ by\ its\ character\ designer\,\ http\:\/\/anidb\.net\/cr5230\ \[Yasuhiko\ Yoshikazu\]\.');
INSERT INTO animes VALUES(166,'Chihaya\ Furu','\ち\は\や\ふ\る','Asaka\ Morio',2011,8.14,'http://img7.anidb.net/pics/anime/121499.jpg','\*\ Based\ on\ a\ manga\ written\ and\ illustrated\ by\ http\:\/\/anidb\.net\/cr28499\ \[Suetsugu\ Yuki\]\,\ serialised\ in\ Be\ Love\ and\ published\ by\ http\:\/\/anidb\.net\/cr748\ \[Kodansha\]\.\\n6th\-year\ grade\-schooler\ http\:\/\/anidb\.net\/ch35739\ \[Ayase\ Chihaya\`s\]\ dream\ is\ for\ her\ sister\ to\ be\ Japan\`s\ top\ model\.\ However\,\ transfer\ student\ http\:\/\/anidb\.net\/ch35741\ \[Wataya\ Arata\]\ admonishes\ her\ that\ a\ dream\ must\ be\ about\ one\`s\ own\ self\.\ Thus\,\ she\ takes\ up\ karuta\,\ a\ Japanese\ card\ game\,\ competitively\.\ Together\ with\ Arata\ and\ http\:\/\/anidb\.net\/ch35740\ \[Mashima\ Taichi\]\,\ Chihaya\`s\ childhood\ friend\,\ they\ have\ great\ fun\ playing\ each\ other\,\ but\ separate\ after\ graduation\.\\n4\ years\ later\,\ Chihaya\ returns\ to\ town\.\ Although\ Arata\ no\ longer\ plays\ the\ game\,\ she\ believes\ that\ they\ will\ eventually\ reunite\ as\ long\ as\ she\ continues\ karuta\.\ Together\ with\ Taichi\,\ she\ establishes\ the\ Mizusawa\ High\-school\ Karuta\ Club\.\\n\~\ translated\ and\ adapted\ from\ official\ site\ by\ Cranston');
INSERT INTO animes VALUES(167,'Hunter\ x\ Hunter\ \(2011\)','HUNTERxHUNTER\ \(2011\)','Koujina\ Hiroshi',2011,9.03,'http://img7.anidb.net/pics/anime/76654.jpg','A\ remake\ of\ the\ original\ series\ with\ different\ staff\ and\ cast\.\\nGon\ is\ a\ youth\ who\ lives\ on\ Kujira\ Isle\.\ His\ dream\ is\ to\ become\ a\ Hunter\ like\ his\ father\,\ to\ search\ out\ lost\ treasures\,\ artefacts\,\ and\ mythical\ creatures\.\\nDetermined\ to\ become\ a\ professional\ Hunter\ willing\ to\ stake\ his\ life\ in\ challenging\ the\ unknown\,\ he\ sets\ off\ on\ a\ journey\ and\ meets\ fellow\ Hunter\ wannabes\ Killua\,\ Kurapika\,\ and\ Leorio\.\\n\~\ translated\ and\ adapted\ from\ official\ site\ by\ Cranston');
INSERT INTO animes VALUES(168,'Steins\;Gate\:\ The\ Movie\ \-\ Load\ Region\ of\ Deja\ Vu','\劇\場\版\ \シ\ュ\タ\イ\ン\ズ\･\ゲ\ー\ト\ \負\荷\領\域\の\デ\ジ\ャ\ヴ','Wakabayashi\ Kanji',2013,8.32,'http://img7.anidb.net/pics/anime/145667.jpg','\*\ Based\ on\ a\ visual\ novel\ by\ http\:\/\/anidb\.net\/cr1334\ \[5pb\]\ and\ http\:\/\/anidb\.net\/cr1354\ \[Nitroplus\]\.\\nThe\ film\ takes\ place\ one\ year\ after\ the\ events\ of\ the\ anime\ series\.\ After\ going\ through\ a\ painstaking\ journey\ across\ multiple\ World\ Lines\ due\ to\ the\ invention\ of\ D\-Mail\,\ text\ messages\ that\ can\ be\ sent\ to\ the\ past\,\ http\:\/\/anidb\.net\/ch23266\ \[Okabe\ Rintarou\]\ has\ apparently\ landed\ in\ the\ Steins\ Gate\ World\ Line\,\ in\ which\ none\ of\ his\ friends\ would\ have\ to\ die\ and\ a\ future\ ruled\ by\ SERN\ due\ to\ the\ invention\ of\ a\ time\ machine\ no\ longer\ exists\.\ However\,\ Rintarou\ soon\ starts\ feeling\ the\ side\ effects\ of\ his\ constant\ time\ travelling\ across\ multiple\ World\ Lines\,\ which\ soon\ builds\ up\ and\ causes\ Rintarou\ to\ suddenly\ vanish\ from\ existence\,\ with\ only\ http\:\/\/anidb\.net\/ch23271\ \[Makise\ Kurisu\]\,\ the\ girl\ who\ he\ had\ saved\ thanks\ to\ his\ efforts\,\ remembering\ him\ through\ d\éj\à\ vu\.\ It\ is\ now\ up\ to\ Kurisu\ to\ find\ a\ way\ to\ get\ Rintarou\ back\.\\nSource\:\ Wikipedia');
INSERT INTO animes VALUES(169,'Natsume\`s\ Book\ of\ Friends\ \(4\)','\夏\目\友\人\帳\ \肆','Oomori\ Takahiro',2012,8.87,'http://img7.anidb.net/pics/anime/77535.jpg','\*\ Based\ on\ a\ manga\ by\ http\:\/\/anidb\.net\/cr3542\ \[Midorikawa\ Yuki\]\,\ serialised\ in\ http\:\/\/anidb\.net\/cr23820\ \[LaLa\ DX\]\ in\ 2005\,\ before\ switching\ to\ http\:\/\/anidb\.net\/cr30454\ \[LaLa\]\ in\ 2008\.\\nhttp\:\/\/anidb\.net\/ch1806\ \[Natsume\ Takashi\]\ has\ been\ able\ to\ see\ yokai\ since\ his\ early\ days\.\ His\ grandmother\,\ http\:\/\/anidb\.net\/ch1808\ \[Reiko\]\,\ possessed\ the\ Yujin\-chou\,\ a\ list\ of\ names\ of\ yokai\ sworn\ to\ fealty\.\ Ever\ since\ Takashi\ inherited\ the\ list\,\ he\ has\ been\ constantly\ attacked\ by\ yokai\.\\nTakashi\,\ however\,\ has\ decided\ to\ return\ to\ the\ yokai\ their\ names\.\ Together\ with\ his\ self\-proclaimed\ bodyguard\ http\:\/\/anidb\.net\/ch1807\ \[Nyanko\]\,\ Takashi\ has\ met\ and\ come\ to\ know\ many\ yokai\.\\n\~\ translated\ and\ adapted\ from\ official\ site\ by\ Cranston');
INSERT INTO animes VALUES(170,'Major\:\ World\ Series','\メ\ジ\ャ\ーWorld\ Series','Fukushima\ Toshinori',2011,8.19,'http://img7.anidb.net/pics/anime/78187.jpg','\"Truly\ the\ last\"\ original\ video\ anime\ project\ of\ Mitsuda\ Takuya\`s\ Major\ baseball\ manga\.\ The\ OVA\ project\ adapted\ the\ thus\-far\-unanimated\ World\ Series\ arc\ and\ the\ story\`s\ illusive\ final\ matchup\,\ while\ the\ new\ book\ lets\ fans\ see\ the\ last\ pitch\ in\ the\ manga\.\ The\ project\ gives\ us\ the\ return\ of\ the\ \"Golden\ Battery\"\ in\ America\.\\nNote\:\ While\ originally\ released\ together\ with\ the\ manga\ books\,\ both\ episodes\ also\ received\ a\ stand\-alone\ release\ on\ 05\.10\.2012\.');
INSERT INTO animes VALUES(171,'Puella\ Magi\ Madoka\ Magica\ the\ Movie','\劇\場\版\ \魔\法\少\女\ま\ど\か\☆\マ\ギ\カ','Miyamoto\ Yukihiro',2012,8.66,'http://img7.anidb.net/pics/anime/90253.jpg','Beginnings\ \—\ In\ the\ city\ of\ Mitakihara\,\ http\:\/\/anidb\.net\/ch25644\ \[Kaname\ Madoka\]\,\ along\ with\ her\ friend\,\ http\:\/\/anidb\.net\/ch25643\ \[Miki\ Sayaka\]\,\ encounter\ a\ creature\ named\ http\:\/\/anidb\.net\/ch25645\ \[Kyuubee\]\ and\ are\ saved\ from\ witches\ by\ magical\ girl\ http\:\/\/anidb\.net\/ch25163\ \[Tomoe\ Mami\]\.\ Kyuubee\ offers\ Madoka\ and\ Sayaka\ the\ chance\ to\ have\ any\ one\ wish\ granted\ in\ exchange\ for\ becoming\ a\ magical\ girl\ and\ fighting\ witches\,\ whilst\ http\:\/\/anidb\.net\/ch25024\ \[Akemi\ Homura\]\,\ another\ magical\ girl\ and\ recent\ transfer\ student\,\ is\ strongly\ against\ Madoka\ becoming\ one\.\ Before\ Madoka\ can\ make\ a\ decision\,\ however\,\ Mami\ is\ killed\ by\ a\ witch\,\ leaving\ Madoka\ too\ afraid\ to\ become\ a\ magical\ girl\.\ Sayaka\,\ however\,\ decides\ to\ become\ a\ magical\ girl\ herself\ in\ order\ to\ heal\ the\ hand\ of\ her\ childhood\ friend\,\ http\:\/\/anidb\.net\/ch27647\ \[Kamijou\ Kyousuke\]\.\ As\ Sayaka\ soon\ comes\ into\ conflict\ with\ another\ magical\ girl\ named\ http\:\/\/anidb\.net\/ch27945\ \[Sakura\ Kyouko\]\,\ they\,\ along\ with\ Madoka\,\ learn\ the\ shocking\ truth\ that\ their\ Soul\ Gems\,\ the\ source\ of\ their\ magical\ powers\,\ literally\ contain\ their\ souls\.\\nEternal\ \—\ Madoka\ learns\ from\ Kyuubee\,\ whose\ real\ identity\ is\ Incubator\,\ that\ his\ species\ makes\ contracts\ to\ make\ girls\ into\ magical\ girls\ that\ inevitably\ become\ witches\ in\ order\ to\ use\ the\ energy\ that\ spawns\ from\ their\ despair\ to\ counter\ entropy\ in\ the\ universe\.\ Kyouko\,\ hoping\ for\ a\ chance\ that\ Sayaka\ can\ be\ made\ human\ again\,\ takes\ Madoka\ with\ her\ to\ try\ and\ reach\ her\ humanity\.\ This\ ultimately\ fails\,\ with\ Kyouko\ choosing\ to\ sacrifice\ herself\ to\ destroy\ Sayaka\ with\ her\.\ Meanwhile\,\ it\ is\ revealed\ that\ Homura\ comes\ from\ another\ timeline\,\ having\ relived\ the\ same\ month\ several\ times\ in\ the\ hope\ of\ saving\ Madoka\ from\ a\ grim\ fate\ at\ the\ hands\ of\ the\ ultimate\ witch\,\ Walpurgisnacht\.\ Homura\ attempts\ to\ face\ Walpurgisnacht\,\ but\ is\ ultimately\ defeated\ and\ draws\ close\ to\ despair\,\ feeling\ her\ efforts\ have\ become\ pointless\.\ Just\ then\,\ Madoka\ appears\ and\ uses\ the\ built\ up\ energy\ from\ several\ timelines\ to\ become\ a\ powerful\ magical\ girl\ capable\ of\ eliminating\ witches\ before\ they\ are\ born\.\\nRebellion\ \—\ Madoka\ used\ to\ be\ a\ normal\ girl\ living\ happily\.\ This\ all\ ended\ when\ she\ sacrificed\ herself\ in\ order\ to\ save\ other\ magical\ girls\ from\ the\ utterly\ cruel\ fate\ that\ awaited\ them\.\ Unable\ to\ let\ her\ memories\ of\ Madoka\ die\,\ Homura\ continues\ to\ fight\ alone\ in\ the\ world\ that\ Madoka\ left\ behind\ for\ humanity\ in\ order\ to\ see\ her\ smile\ once\ more\.\\nSource\:\ ANN\\nNote\:\ The\ first\ two\ films\ are\ a\ compilation\ of\ the\ http\:\/\/anidb\.net\/a8069\ \[television\ series\]\ and\ the\ third\ film\ is\ an\ all\-new\ story\.\ http\:\/\/anidb\.net\/cr2442\ \[Urobuchi\ Gen\]\ said\ that\ the\ third\ film\`s\ story\ coincidentally\ matches\ the\ lyrics\ to\ http\:\/\/anidb\.net\/cr3034\ \[Kalafina\]\`s\ television\ ending\ theme\ song\ http\:\/\/anidb\.net\/s39375\ \[Magia\]\ if\ one\ examines\ them\ carefully\.');
INSERT INTO animes VALUES(172,'Star\ Blazers\ 2199','\宇\宙\戦\艦\ヤ\マ\ト2199','',2012,8.81,'http://img7.anidb.net/pics/anime/81735.jpg','The\ year\ is\ 2199\.\ The\ human\ race\ has\ been\ crushed\ in\ their\ war\ with\ the\ Gamilos\,\ driven\ into\ underground\ cities\ by\ the\ invader\`s\ assault\.\ Scientists\ estimate\ they\ have\ only\ a\ year\ left\.\ The\ young\ officers\ Susumu\ Kodai\ and\ Daisuke\ Shima\ receive\ a\ mysterious\ capsule\ from\ a\ ship\ that\ made\ an\ emergency\ landing\ on\ Mars\ and\ return\ with\ it\ to\ Earth\.\ It\ contains\ humanity\`s\ last\ hope\:\ the\ planet\ Iscandar\ on\ the\ other\ side\ of\ the\ Magellan\ Galaxy\ has\ the\ technology\ to\ defeat\ the\ Gamilos\ and\ restore\ the\ planet\.\ The\ space\ battleship\ Yamato\ is\ entrusted\ with\ this\ task\,\ but\ they\ have\ only\ one\ year\ before\ humanity\ ends\.\\n\[i\]Note\:\ The\ first\ episode\ received\ a\ special\ preview\ on\ the\ TV\ channel\ Family\ Gekijou\ on\ 6th\ of\ April\,\ 2012\.\ A\ day\ later\,\ on\ 7th\ of\ April\,\ 2012\,\ the\ first\ 2\ episodes\ were\ combined\ for\ a\ theatrical\ screening\ shown\ in\ 10\ theatres\ across\ Japan\ until\ 20\.04\.2012\.\ Episodes\ 3\-6\ received\ the\ same\ type\ of\ theatrical\ screening\ on\ 30\.06\.2012\.\ Episodes\ 23\-26\ received\ the\ same\ type\ of\ theatrical\ screening\ on\ 24\.08\.2013\.\\nThe\ first\ DVD\/BD\ volume\ contained\ 2\ episodes\,\ subsequent\ volumes\ contained\ 4\ episodes\.\[\/i\]');
INSERT INTO animes VALUES(173,'nam2','Magical\ Girl\ Lyrical\ NANOHA\ The\ MOVIE\ 2nd\ A\`s','Kusakawa\ Keizou',2012,8.35,'http://img7.anidb.net/pics/anime/79027.jpg','Six\ months\ have\ passed\ since\ the\ events\ of\ the\ http\:\/\/anidb\.net\/a6075\ \[previous\ movie\]\.\ http\:\/\/anidb\.net\/ch1316\ \[Fate\ Testarossa\]\ has\ returned\ to\ Uminari\ City\ with\ http\:\/\/anidb\.net\/ch2800\ \[Lindy\ Harlaown\]\ as\ her\ legal\ guardian\ and\ is\ living\ the\ life\ of\ a\ normal\ elementary\ schoolgirl\ along\ with\ http\:\/\/anidb\.net\/ch1306\ \[Takamachi\ Nanoha\]\ and\ her\ friends\.\ The\ reunion\ between\ the\ two\ new\-found\ friends\ is\ cut\ short\ however\,\ when\ they\ are\ assaulted\ by\ four\ ancient\ magic\ users\ who\ identify\ themselves\ as\ the\ Wolkenritter\.\ As\ the\ motives\ behind\ the\ actions\ of\ the\ Wolkenritter\ become\ clear\,\ Nanoha\ and\ Fate\ find\ themselves\ in\ a\ race\ against\ time\ to\ stop\ the\ reactivation\ of\ a\ highly\ dangerous\ artifact\ known\ as\ The\ Book\ of\ Darkness\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(174,'Wolf\ Children','\お\お\か\み\こ\ど\も\の\雨\と\雪','Hosoda\ Mamoru',2012,9.02,'http://img7.anidb.net/pics/anime/78405.jpg','The\ theme\ of\ the\ film\ is\ the\ love\ between\ parents\ and\ children\.\ The\ story\ covers\ 13\ years\ and\ begins\ with\ a\ 19\-year\-old\ college\ student\ named\ Hana\ who\ encounters\ and\ falls\ in\ \"fairy\ tale\-like\"\ love\ with\ a\ \"wolf\ man\.\"\ After\ marrying\ the\ wolf\ man\,\ Hana\ gives\ birth\ and\ raises\ two\ wolf\ children\ \—\ an\ older\ sister\ named\ Yuki\ \(\"snow\"\)\ who\ was\ born\ on\ a\ snowy\ day\,\ and\ a\ younger\ brother\ named\ Ame\ \(\"rain\"\)\ who\ was\ born\ on\ a\ rainy\ day\.\\nThe\ four\ quietly\ lived\ in\ a\ corner\ of\ a\ city\ to\ conceal\ the\ fact\ that\ the\ children\ are\ \"wolf\ children\.\"\ However\,\ when\ the\ wolf\ man\ suddenly\ dies\,\ Hana\ decides\ to\ move\ to\ a\ rural\ town\ far\ removed\ from\ the\ city\.\\nSource\:\ ANN\\nNote\:\ The\ film\ received\ a\ world\ premiere\ at\ UGC\ Cin\é\ Cit\é\ Les\ Halles\ in\ Paris\,\ France\ on\ June\ 25\,\ 2012\.\ It\ premiered\ in\ Japanese\ theatres\ on\ July\ 21\,\ 2012\.');
INSERT INTO animes VALUES(175,'Bakuman\.\ \(2012\)','\バ\ク\マ\ン\.\ \(2012\)','Akitaya\ Noriaki',2012,8.64,'http://img7.anidb.net/pics/anime/126361.jpg','\*\ Based\ on\ a\ shounen\ manga\ by\ http\:\/\/anidb\.net\/cr1498\ \[Ooba\ Tsugumi\]\ and\ http\:\/\/anidb\.net\/cr1499\ \[Obata\ Takeshi\]\ serialised\ in\ http\:\/\/anidb\.net\/cr5372\ \[Weekly\ Shounen\ Jump\]\.\\nhttp\:\/\/anidb\.net\/ch16785\ \[Mashiro\ Moritaka\]\ and\ http\:\/\/anidb\.net\/ch16787\ \[Takagi\ Akito\]\ have\ come\ a\ long\ way\ since\ they\ started\ making\ manga\ in\ middle\ school\,\ but\ trials\ still\ await\ them\ as\ they\ head\ towards\ their\ goal\ of\ getting\ an\ anime\ adaption\ for\ one\ of\ their\ manga\.\ As\ they\ continue\ to\ grow\ as\ artists\ and\ as\ people\,\ they\ will\ be\ faced\ with\ new\ friends\,\ new\ rivals\,\ and\ new\ hurdles\ to\ overcome\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(176,'Black\ Jack\ Final','\ブ\ラ\ッ\ク\・\ジ\ャ\ッ\ク\ FINAL','',2011,8.35,'http://img7.anidb.net/pics/anime/78711.jpg','In\ the\ first\ OVA\ Pinoko\ suffers\ from\ an\ inexplicable\ pain\ attack\,\ but\ tests\ are\ inconclusive\.\ Black\ Jack\ is\ stimied\ until\ he\ learns\ the\ mother\ of\ the\ child\ is\ Yuri\ Saionji\.\ He\ operated\ her\ long\ ago\ and\ had\ a\ brief\ relation\ with\ her\.\ After\ meeting\ Yuri\ BJ\ decides\ to\ try\ to\ help\ her\ and\ in\ that\ way\ also\ help\ Pinoko\.\ Long\ repressed\ emotions\ surface\ again\.\.\.\\nIn\ the\ second\ OVA\ Black\ Jack\ gets\ kidnapped\ whilst\ returning\ home\ by\ plane\.\ The\ dictator\ of\ an\ extremely\ totalaritan\ regime\ suffers\ from\ a\ seemingly\ inoperable\ brain\ tumor\ and\ wants\ BJ\ to\ operate\ him\,\ which\ has\ to\ be\ done\ without\ anaesthesia\.\ This\ against\ a\ background\ of\ a\ country\ in\ uproar\ where\ the\ resistance\ decides\ now\ is\ the\ time\ for\ an\ uprising\.\ Love\ and\ betrayal\ play\ a\ big\ part\,\ that\`s\ for\ sure\.\\nSource\:\ BakaBT');
INSERT INTO animes VALUES(177,'Space\ Brothers','\宇\宙\兄\弟','Watanabe\ Ayumu',2012,8.19,'http://img7.anidb.net/pics/anime/80910.jpg','\*\ Based\ on\ a\ seinen\ manga\ by\ http\:\/\/anidb\.net\/cr29882\ \[Koyama\ Chuuya\]\,\ serialised\ in\ Weekly\ Morning\.\\nIn\ the\ year\ 2006\ the\ kid\ brothers\ http\:\/\/anidb\.net\/ch40993\ \[Mutta\]\ and\ http\:\/\/anidb\.net\/ch40994\ \[Hibito\]\,\ on\ a\ nightly\ hunt\ for\ animal\ sounds\ in\ the\ local\ woods\,\ unexpectedly\ see\ a\ blazingly\ bright\ rotating\ flying\ object\ in\ the\ sky\,\ right\ above\ their\ home\ town\.\ After\ a\ short\ moment\ the\ UFO\ accelerates\ towards\ the\ surface\ of\ the\ Moon\.\ Witnessing\ this\,\ the\ two\ youngsters\ vow\ to\ become\ astronauts\ and\ some\ day\ travel\ into\ space\.\\nNow\ in\ 2025\ younger\ brother\ Hibito\,\ as\ the\ first\ Japanese\,\ made\ it\ into\ the\ NASA\ team\ that\ will\ set\ foot\ on\ the\ Moon\ again\.\ Mutta\,\ on\ the\ other\ hand\,\ defending\ his\ brothers\ honour\,\ gets\ fired\ from\ his\ car\ designer\ job\.\ The\ older\ of\ the\ two\ brothers\ has\ not\ forgotten\ about\ their\ dream\ from\ back\ then\ though\.\.\.\ and\ on\ a\ fateful\ day\ his\ life\ changes\.\\n\—\ written\ by\ foo2');
INSERT INTO animes VALUES(178,'Kids\ on\ the\ Slope','\坂\道\の\ア\ポ\ロ\ン\ KIDS\ ON\ THE\ SLOPE','Watanabe\ Shin\`ichirou',2012,8.44,'http://img7.anidb.net/pics/anime/80592.jpg','\*\ Based\ on\ a\ josei\ manga\ by\ http\:\/\/anidb\.net\/cr29907\ \[Kodama\ Yuki\]\,\ serialised\ in\ Monthly\ Flowers\.\\nDuring\ the\ late\ 1960s\,\ in\ the\ town\ of\ Sasebo\ in\ Nagasaki\ Prefecture\.\.\.\\nIn\ the\ early\ summer\ of\ 1966\,\ http\:\/\/anidb\.net\/ch41399\ \[Kaoru\]\ transfers\ to\ the\ local\ high\ school\ from\ Yokosuka\.\ Thanks\ to\ his\ family\`s\ nearly\ constant\ cycle\ of\ moving\ from\ town\ to\ town\,\ Kaoru\ has\ only\ known\ school\ as\ a\ difficult\ place\ for\ readjusting\ every\ time\.\ However\,\ on\ his\ first\ day\ at\ this\ new\ school\,\ he\ meets\ http\:\/\/anidb\.net\/ch41395\ \[Sentarou\]\ and\ takes\ a\ new\ direction\ in\ life\.\\nSource\:\ ANN\\nNote\:\ The\ first\ episode\ received\ an\ early\ screening\ together\ with\ the\ first\ episode\ of\ http\:\/\/anidb\.net\/a8916\ \[Tsuritama\]\ at\ a\ special\ event\ held\ at\ Noitamina\ Shop\ \&\ Cafe\ Theatre\ on\ 07\.04\.2012\.\ 110\ lucky\ participants\ were\ chosen\ through\ a\ lottery\ to\ take\ part\ in\ the\ event\.\ Regular\ TV\ broadcast\ was\ held\ on\ 13\.04\.2012\.');
INSERT INTO animes VALUES(179,'Fate\/Zero\ \(2012\)','Fate\/Zero\ \(2012\)','Aoki\ Ei',2012,8.89,'http://img7.anidb.net/pics/anime/162795.jpg','\*\ Based\ on\ http\:\/\/anidb\.net\/cr2442\ \[Urobuchi\ Gen\]\ and\ http\:\/\/anidb\.net\/cr927\ \[Type\-Moon\]\`s\ 2006\-2007\ Fate\/Zero\ novel\,\ a\ prequel\ to\ Type\-Moon\`s\ much\ acclaimed\ Fate\/Stay\ Night\ 2004\ visual\ novel\.\\nThe\ Holy\ Grail\ War\ is\ a\ death\-match\ between\ 7\ magi\ \(Masters\)\ and\ their\ summoned\ heroic\ spirits\ \(Servants\)\.\ In\ this\ battle\ royale\,\ the\ prize\ is\ the\ legendary\ Holy\ Grail\,\ said\ to\ be\ an\ omnipotent\ wish\-granting\ device\ which\ will\ produce\ any\ sort\ of\ miracle\ in\ order\ to\ bend\ reality\ to\ accommodate\ the\ wishes\ it\ grants\.\ The\ winning\ Master\ and\ Servant\ shall\ be\ granted\ one\ wish\ each\,\ after\ which\ the\ Holy\ Grail\ will\ not\ be\ activated\ until\ the\ next\ War\.\\nAs\ the\ 4th\ Holy\ Grail\ War\ progresses\,\ several\ camps\ raise\ the\ stakes\,\ and\ the\ challenges\ only\ become\ bigger\ and\ more\ difficult\.\ Each\ Master\ and\ Servant\ will\ be\ faced\ with\ the\ impact\ of\ their\ own\ shortcomings\,\ and\ some\ of\ the\ competitors\ would\ do\ well\ in\ remembering\ that\ deceit\ and\ betrayal\ do\ not\ send\ prior\ warning\.\.\.\\n\—\ written\ by\ Hinoe\\nNote\:\ The\ first\ 2\ episodes\ along\ with\ the\ last\ episode\ of\ the\ previous\ season\ were\ shown\ at\ a\ special\ event\ on\ 06\.04\.2012\,\ 2\ days\ before\ the\ TV\ broadcast\.');
INSERT INTO animes VALUES(180,'Planetes','\プ\ラ\ネ\テ\ス','Taniguchi\ Gorou',2003,8.47,'http://img7.anidb.net/pics/anime/8587.jpg','It\ is\ the\ year\ 2075\.\ In\ a\ world\ where\ travelling\ between\ Earth\,\ the\ space\ stations\ and\ the\ Moon\ has\ become\ commonplace\.\\nhttp\:\/\/anidb\.net\/ch7236\ \[Hachimaki\]\ is\ just\ an\ ordinary\ salaryman\.\ He\ works\ at\ a\ space\ station\ collecting\ dangerous\ space\ debris\.\ However\,\ he\ dreams\ of\ owning\ his\ very\ own\ space\ ship\ someday\.\ And\ so\ he\ spends\ his\ days\ collecting\ debris\ together\ with\ his\ colleagues\ http\:\/\/anidb\.net\/ch15040\ \[Yuri\]\,\ http\:\/\/anidb\.net\/ch15039\ \[Fee\]\ and\ his\ friend\ http\:\/\/anidb\.net\/ch7237\ \[Tanabe\]\.\ Now\ it\ is\ his\ fourth\ year\ doing\ the\ same\ work\ and\ he\ is\ going\ to\ be\ 25\ years\ old\ soon\,\ which\ is\ why\ he\ starts\ to\ think\ about\ his\ life\.\\nHow\ does\ Hachimaki\ feel\?\ Well\,\ today\,\ Hachimaki\ is\ going\ to\ do\ the\ same\ job\.\.\.\\nSource\:\ AnimeNfo');
INSERT INTO animes VALUES(181,'From\ the\ New\ World','\新\世\界\よ\り','Ishihama\ Masashi',2012,8.41,'http://img7.anidb.net/pics/anime/95085.jpg','\*\ Based\ on\ http\:\/\/anidb\.net\/cr30705\ \[Kishi\ Yuusuke\]\`s\ award\-winning\ 2008\ speculative\ fiction\ novel\ Shinsekai\ yori\.\\nThe\ story\ is\ set\ in\ Japan\ a\ millennium\ from\ now\.\ Five\ children\ \—\ the\ protagonist\ http\:\/\/anidb\.net\/ch41838\ \[Saki\]\,\ http\:\/\/anidb\.net\/ch41837\ \[Satoru\]\,\ http\:\/\/anidb\.net\/ch41839\ \[Maria\]\,\ http\:\/\/anidb\.net\/ch41836\ \[Mamoru\]\,\ and\ http\:\/\/anidb\.net\/ch41840\ \[Shun\]\ \—\ have\ been\ born\ and\ raised\ in\ a\ tranquil\ town\ that\ can\ be\ described\ as\ a\ utopia\,\ overflowing\ with\ water\ and\ green\ foliage\.\ The\ world\ is\ ruled\ by\ people\ who\ have\ the\ cursed\ power\ or\ the\ gods\`\ power\ of\ telekinesis\.\\nAfter\ a\ certain\ incident\,\ Saki\ and\ the\ others\ come\ to\ realize\ the\ true\ nature\ of\ their\ world\.\ Before\ long\,\ they\ learn\ everything\,\ including\ the\ bloody\ history\ that\ brought\ humanity\ to\ this\ state\.\ The\ five\ throw\ themselves\ into\ life\-threatening\ adventure\ and\ fight\ to\ protect\ friends\ and\ a\ world\ on\ the\ brink\ of\ collapse\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(182,'Exogenesis\:\ Symphony\ Part\ 3\ \(Redemption\)','\振\り\子','',2012,8.36,'http://img7.anidb.net/pics/anime/84411.jpg','A\ short\ called\ \"Furiko\"\ \(or\ \"Pendulum\"\)\,\ that\ was\ featured\ on\ Japanese\ variety\ show\.\\nThe\ anime\ was\ drawn\ by\ the\ Japanese\ comedian\ Tekken\ \(\鉄\拳\)\,\ who\ named\ himself\ after\ the\ fighting\ game\.\\nThe\ short\ was\ later\ adapted\ into\ the\ official\ music\ video\ for\ the\ song\ used\ in\ the\ short\,\ \"Exogenesis\ Part\ 3\ \(Redemption\)\"\ by\ Muse\,\ and\ was\ extended\ to\ meet\ the\ full\ length\ of\ the\ song\.');
INSERT INTO animes VALUES(183,'Monogatari\ Series\ Second\ Season','\物\語\シ\リ\ー\ズ\ \セ\カ\ン\ド\シ\ー\ズ\ン','Itamura\ Tomoyuki',2013,8.95,'http://img7.anidb.net/pics/anime/136930.jpg','\*\ Based\ on\ a\ series\ of\ light\ novels\ written\ by\ http\:\/\/anidb\.net\/cr5970\ \[Nishio\ Ishin\]\ and\ illustrated\ by\ http\:\/\/anidb\.net\/cr6436\ \[Vofan\]\.\\nhttp\:\/\/anidb\.net\/ch8962\ \[Araragi\ Koyomi\]\,\ a\ senior\ year\ high\ school\ student\,\ has\ never\ been\ particularly\ popular\ among\ girls\,\ although\ he\ was\ certainly\ quite\ well\-known\ for\ his\ borderline\ delinquent\ actions\ during\ middle\ school\.\ However\,\ at\ one\ point\ he\ was\ bitten\ by\ a\ http\:\/\/anidb\.net\/ch20157\ \[powerful\ vampire\]\ and\ himself\ made\ into\ one\;\ although\ he\ was\ treated\ and\ became\ human\ again\,\ his\ vampirism\ never\ fully\ disappeared\.\ Since\ then\,\ he\ has\ become\ surrounded\ by\ strange\ girls\;\ those\ who\,\ not\ unlike\ himself\,\ came\ into\ contact\ with\ these\ supernatural\ beings\ collectively\ known\ as\ oddities\.\\nAs\ the\ time\ goes\ by\,\ Koyomi\`s\ relation\ with\ each\ of\ the\ girls\ around\ him\ develops\,\ but\ deeper\ trouble\ continues\ to\ arise\.\ http\:\/\/anidb\.net\/ch8967\ \[Oshino\ Meme\]\,\ the\ exorcist\ who\ helped\ him\ become\ human\ once\ again\,\ is\ now\ gone\,\ and\ will\ no\ longer\ act\ as\ support\ when\ Koyomi\ needs\ help\;\ he\ must\ deal\ with\ the\ problems\ on\ his\ own\ now\.\\nHowever\,\ right\ when\ even\ Koyomi\ has\ to\ leave\ to\ deal\ with\ some\ sort\ of\ trouble\,\ his\ friend\ http\:\/\/anidb\.net\/ch8965\ \[Hanekawa\ Tsubasa\]\ encounters\ a\ new\ oddity\ and\ her\ house\ is\ destroyed\ by\ a\ fire\.\ The\ new\ oddity\,\ a\ http\:\/\/anidb\.net\/ch57759\ \[tiger\]\,\ is\ now\ targeting\ Tsubasa\ and\,\ between\ her\ stress\ and\ the\ threat\ posed\ by\ the\ tiger\,\ http\:\/\/anidb\.net\/ch11876\ \[Black\ Hanekawa\]\ emerges\ once\ again\ so\ that\ the\ underlying\ oddity\,\ the\ Curse\ Cat\,\ can\ protect\ her\ master\.\ Since\ Tsubasa\ refuses\ to\ let\ herself\ be\ helped\ unless\ utterly\ unavoidable\ and\ will\ never\ seek\ the\ help\ of\ others\,\ http\:\/\/anidb\.net\/ch8963\ \[Senjougahara\ Hitagi\]\,\ her\ friend\ and\ Koyomi\`s\ girlfriend\,\ has\ to\ choose\ to\ take\ the\ situation\ into\ her\ hands\ for\ the\ sake\ of\ their\ friend\,\ so\ that\ her\ situation\ doesn\`t\ deteriorate\ even\ further\.\\n\—\ written\ by\ Hinoe');
INSERT INTO animes VALUES(184,'Chihayafuru\ 2','\ち\は\や\ふ\る2','Asaka\ Morio',2013,8.73,'http://img7.anidb.net/pics/anime/130689.jpg','After\ an\ exciting\ year\ for\ the\ Mizusawa\ High\ School\ karuta\ club\,\ a\ new\ semester\ begins\ as\ two\ new\ members\ join\ the\ group\.\ More\ passionate\ than\ ever\ for\ the\ ancient\ card\ game\,\ Chihaya\ sets\ ambitious\ goals\ for\ herself\ and\ for\ her\ friends\.\\nContinuation\ of\ the\ first\ series\.\ Chihaya\ and\ her\ friends\ have\ entered\ their\ second\ year\ of\ high\ school\,\ and\ they\ are\ anxious\ to\ recruit\ new\ first\ year\ members\ for\ the\ karuta\ club\ and\ to\ strengthen\ their\ team\.\ However\,\ the\ new\ members\ don\`t\ seem\ to\ share\ Chihaya\`s\ passion\ for\ karuta\,\ and\ a\ potential\ rival\ for\ Taichi\`s\ affections\ appears\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(185,'Jojo\`s\ Bizarre\ Adventure\ \(2012\)','\ジ\ョ\ジ\ョ\の\奇\妙\な\冒\険\ \(2012\)','Suzuki\ Ken\`ichi',2012,8.18,'http://img7.anidb.net/pics/anime/91163.jpg','\*\ Based\ on\ a\ manga\ by\ http\:\/\/anidb\.net\/cr981\ \[Araki\ Hirohiko\]\,\ originally\ serialised\ in\ Weekly\ Shounen\ Jump\ from\ 1987\ to\ 2002\,\ before\ being\ transferred\ to\ the\ monthly\ Ultra\ Jump\ in\ 2004\.\\nAn\ epic\ horror\-action\-adventure\!\ Spanning\ the\ generations\ of\ the\ Joestar\ family\,\ each\ arc\ focuses\ on\ a\ certain\ member\ of\ the\ family\ and\ his\/her\ battles\ with\ vampires\,\ super\ vampires\,\ and\ other\ Stand\ users\.\\nPhantom\ Blood\ stars\ http\:\/\/anidb\.net\/ch2068\ \[Jonathan\ Joestar\]\ and\ the\ ambitious\ http\:\/\/anidb\.net\/ch895\ \[Dio\ Brando\]\.\ It\ shows\ how\ the\ stone\ mask\ was\ found\ and\ how\ Dio\ first\ obtained\ and\ utilized\ his\ powers\.\ Once\ Jonathan\ and\ http\:\/\/anidb\.net\/ch47869\ \[Robert\ E\.\ O\.\ Speedwagon\]\ realize\ Dio\`s\ intentions\,\ they\ must\ team\ up\ with\ http\:\/\/anidb\.net\/ch47870\ \[Will\ A\.\ Zeppeli\]\ and\ learn\ Ripple\ \(Hamon\)\ to\ stop\ Dio\.\\nSource\:\ Baka\-Updates');
INSERT INTO animes VALUES(186,'The\ Garden\ of\ Sinners\:\ Recalled\ Out\ Summer','\劇\場\版\ \空\の\境\界\ \未\来\福\音\ the\ Garden\ of\ sinners\ recalled\ out\ summer','Sudou\ Tomonori',2013,8.27,'http://img7.anidb.net/pics/anime/140092.jpg','\*\ Based\ on\ a\ novel\ by\ http\:\/\/anidb\.net\/cr2174\ \[Nasu\ Kinoko\]\,\ writer\ for\ http\:\/\/anidb\.net\/cr927\ \[Type\-Moon\]\.\\nMirai\ Fukuin\ \(lit\.\ The\ Future\`s\ Gospel\ or\ Blessings\ for\ the\ Future\)\ is\ a\ an\ eighth\ installment\ of\ Kara\ no\ Kyoukai\ novel\ series\.\ It\ is\ divided\ into\ two\ parts\.\\nM\öbius\ ring\\nTakes\ place\ after\ the\ events\ of\ http\:\/\/anidb\.net\/e93770\ \[Remaining\ Sense\ of\ Pain\]\.\\nTwo\ psychics\,\ Shizune\ Seo\ and\ Mitsuru\ Kamekura\ \(Meruka\)\,\ can\ foresee\ the\ future\.\ Shizune\ was\ sick\ of\ her\ predictable\ boring\ life\.\ Meruka\ became\ a\ professional\ bomber\ taking\ advantage\ of\ his\ supernatural\ power\.\ When\ Shizune\ met\ Mikiya\ and\ when\ Meruka\ met\ Shiki\,\ their\ immutable\ future\ started\ to\ change\.\\nM\öbius\ link\\nTakes\ place\ ten\ years\ after\ the\ events\ of\ Kara\ no\ Kyoukai\.\\nRyougi\ Mana\,\ Shiki\`s\ daughter\,\ spends\ the\ day\ with\ Mitsuru\ Kamekura\.\\nNote\:\ Double\-billed\ in\ the\ cinemas\ with\ http\:\/\/anidb\.net\/a10566\ \[Extra\ Chorus\]\.');
INSERT INTO animes VALUES(187,'Gintama\:\ The\ Movie\:\ The\ Final\ Chapter\:\ Be\ Forever\ Yorozuya','\劇\場\版\ \銀\魂\ \完\結\篇\ \万\事\屋\よ\永\遠\な\れ','Fujita\ Youichi',2013,9.35,'http://img7.anidb.net/pics/anime/148050.jpg','While\ watching\ a\ movie\,\ Gintoki\ comes\ upon\ a\ \"movie\ thief\,\"\ a\ figure\ in\ Japanese\ culture\ often\ depicted\ as\ a\ man\ with\ a\ video\ camera\ as\ a\ head\.\ After\ scolding\ the\ movie\ thief\ for\ his\ actions\,\ he\ finds\ himself\ warped\ into\ another\ world\ via\ the\ camera\ lens\.\ In\ this\ world\,\ 5\ years\ have\ passed\,\ and\ not\ only\ has\ the\ land\ of\ Edo\ changed\ into\ an\ apocalyptic\ wasteland\,\ but\ Kagura\ has\ changed\ into\ a\ beautiful\ woman\ with\ no\ Chinese\ speech\ pattern\,\ Shinpachi\ has\ turned\ into\ a\ cool\ samurai\ who\ is\ not\ a\ tsukkomi\ anymore\,\ and\ the\ Gintoki\ of\ this\ time\ has\ gone\ missing\,\ though\ he\ is\ assumed\ to\ be\ dead\.\ Gintoki\ is\ determined\ to\ find\ out\ the\ truth\ of\ the\ deadly\ sickness\ that\ is\ ravaging\ Edo\,\ and\ also\ to\ understand\ the\ feelings\ of\ Kagura\ and\ Shinpachi\,\ who\ have\ been\ trying\ to\ deal\ with\ their\ leader\`s\ disappearance\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(188,'Gintama\ 3','\銀\魂\´\(2012\)','Fujita\ Youichi',2012,9.34,'http://img7.anidb.net/pics/anime/126342.jpg','Note\:\ In\ addition\ to\ \"Yorinuki\ Gintama\-san\"\ \(a\ repeat\ of\ selected\ Gintama\ anime\ episodes\)\,\ the\ broadcast\ included\ new\ Gintama\ episodes\.\ The\ rerun\ episodes\ aren\`t\ going\ to\ be\ added\ for\ this\ entry\ as\ they\ are\ _exactly_\ the\ same\ even\ down\ to\ the\ title\ screen\.');
INSERT INTO animes VALUES(189,'The\ Tale\ of\ the\ Princess\ Kaguya','\か\ぐ\や\姫\の\物\語','Takahata\ Isao',2013,8.28,'http://img7.anidb.net/pics/anime/165889.jpg','\*\ Adaptation\ of\ the\ Japanese\ folk\ tale\ Taketori\ Monogatari\ \(Tale\ of\ the\ Bamboo\ Cutter\)\,\ also\ known\ as\ Kaguya\ Hime\ \(Princess\ Kaguya\)\.\\nIn\ an\ idyllic\ rural\ setting\,\ http\:\/\/anidb\.net\/ch59900\ \[an\ old\ bamboo\ cutter\]\ and\ http\:\/\/anidb\.net\/ch59901\ \[his\ wife\]\ raise\ a\ tiny\ girl\ found\ nestled\ within\ a\ glowing\ bamboo\ stalk\ along\ with\ a\ fortune\ in\ gold\.\ As\ she\ approaches\ adulthood\,\ the\ bamboo\ cutter\ uses\ the\ fortune\ to\ purchase\ a\ villa\ in\ the\ capital\,\ buy\ himself\ a\ title\ and\ employ\ tutors\ to\ transform\ the\ country\ girl\,\ now\ given\ the\ name\ http\:\/\/anidb\.net\/ch59898\ \[Kaguya\]\,\ into\ a\ refined\ woman\.\ News\ of\ her\ beauty\ brings\ powerful\ and\ wealthy\ suitors\ who\ compete\ for\ her\ hand\ in\ marriage\,\ all\ the\ while\ Kaguya\ wishes\ that\ she\ and\ her\ family\ could\ return\ to\ their\ former\ life\.\ Sooner\ or\ later\,\ though\,\ her\ true\ origins\ will\ make\ their\ own\ claim\ upon\ her\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(190,'Attack\ on\ Titan','\進\撃\の\巨\人\ attack\ on\ titan','Araki\ Tetsurou',2013,8.24,'http://img7.anidb.net/pics/anime/133345.jpg','Several\ hundred\ years\ ago\,\ humans\ were\ nearly\ exterminated\ by\ titans\.\ Titans\ are\ typically\ several\ stories\ tall\,\ seem\ to\ have\ no\ intelligence\,\ devour\ human\ beings\ and\,\ worst\ of\ all\,\ seem\ to\ do\ it\ for\ the\ pleasure\ rather\ than\ as\ a\ food\ source\.\ A\ small\ percentage\ of\ humanity\ survived\ by\ walling\ themselves\ in\ a\ city\ protected\ by\ extremely\ high\ walls\,\ even\ taller\ than\ the\ biggest\ of\ titans\.\\nFlash\ forward\ to\ the\ present\ and\ the\ city\ has\ not\ seen\ a\ titan\ in\ over\ 100\ years\.\ Teenage\ boy\ http\:\/\/anidb\.net\/ch51115\ \[Eren\]\ and\ his\ foster\ sister\ http\:\/\/anidb\.net\/ch51116\ \[Mikasa\]\ witness\ something\ horrific\ as\ the\ city\ walls\ are\ destroyed\ by\ a\ super\ titan\ that\ appears\ out\ of\ thin\ air\.\ As\ the\ smaller\ titans\ flood\ the\ city\,\ the\ two\ kids\ watch\ in\ horror\ as\ their\ mother\ is\ eaten\ alive\.\ Eren\ vows\ that\ he\ will\ murder\ every\ single\ titan\ and\ take\ revenge\ for\ all\ of\ mankind\.\\nSource\:\ MangaHelpers\\nNote\:\ The\ last\ episode\ received\ a\ pre\-airing\ in\ Tokyo\,\ Marunouchi\ Piccadilly\ 1\ theater\.\ TV\ broadcast\ took\ place\ after\ midnight\,\ a\ few\ hours\ later\.');
INSERT INTO animes VALUES(191,'The\ Garden\ of\ Words','\言\の\葉\の\庭','Shinkai\ Makoto',2013,8.25,'http://img7.anidb.net/pics/anime/133053.jpg','We\ have\ met\,\ for\ each\ of\ us\ to\ walk\ forward\.\\nhttp\:\/\/anidb\.net\/ch53043\ \[Takao\]\,\ who\ is\ training\ to\ become\ a\ shoemaker\,\ skipped\ school\ and\ is\ sketching\ shoes\ in\ a\ Japanese\-style\ garden\.\ He\ meets\ a\ mysterious\ woman\,\ http\:\/\/anidb\.net\/ch53044\ \[Yukino\]\,\ who\ is\ older\ than\ him\.\ Then\,\ without\ arranging\ the\ times\,\ the\ two\ start\ to\ see\ each\ other\ again\ and\ again\,\ but\ only\ on\ rainy\ days\.\ They\ deepen\ their\ relationship\ and\ open\ up\ to\ each\ other\.\ But\ the\ end\ of\ the\ rainy\ season\ soon\ approaches\.\.\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(192,'Full\ Metal\ Panic\?\ Fumoffu','\フ\ル\メ\タ\ル\・\パ\ニ\ッ\ク\?\ \ふ\も\っ\ふ','Takemoto\ Yasuhiro',2003,8.22,'http://img7.anidb.net/pics/anime/129526.jpg','It\ is\ back\-to\-school\ mayhem\ with\ http\:\/\/anidb\.net\/ch1458\ \[Chidori\ Kaname\]\ and\ her\ battle\-hardened\ classmate\ http\:\/\/anidb\.net\/ch1456\ \[Sagara\ Sousuke\]\ as\ they\ encounter\ more\ misadventures\ in\ and\ out\ of\ Jindai\ High\ School\.\ But\ when\ Kaname\ gets\ into\ some\ serious\ trouble\,\ Sousuke\ takes\ the\ guise\ of\ http\:\/\/anidb\.net\/ch36402\ \[Bonta\-kun\]\ \—\ the\ gun\-wielding\,\ butt\-kicking\ mascot\.\ And\ while\ he\ struggles\ to\ continue\ living\ as\ a\ normal\ teenager\,\ Sousuke\ also\ has\ to\ deal\ with\ protecting\ his\ superior\ officer\ http\:\/\/anidb\.net\/ch1457\ \[Teletha\ Testarossa\]\,\ who\ has\ decided\ to\ take\ a\ vacation\ from\ http\:\/\/anidb\.net\/ch6219\ \[Mithril\]\ and\ spend\ a\ couple\ of\ weeks\ as\ his\ and\ Kaname\`s\ classmate\.\\nSource\:\ ANN\\nNote\:\ Because\ of\ a\ then\ current\ kidnapping\ event\,\ TV\ Tokyo\ did\ not\ broadcast\ what\ were\ supposed\ to\ be\ part\ 2\ of\ episode\ 1\ \(A\ Hostage\ with\ No\ Compromises\)\ and\ part\ 1\ of\ episode\ 2\ \(Hostility\ Passing\-By\)\.\ A\ Hostage\ with\ No\ Compromises\ was\ replaced\ by\ part\ 2\ of\ episode\ 2\ \(A\ Fruitless\ Lunchtime\)\ and\ thus\,\ episode\ 2\ was\ skipped\,\ leaving\ the\ episode\ count\ at\ 11\.\ The\ DVD\ release\ contained\ all\ the\ episodes\ in\ the\ intended\ order\.');
INSERT INTO animes VALUES(193,'Hidamari\ Sketch\:\ Sae\ Hiro\ Sotsugyou\ Hen','\ひ\だ\ま\り\ス\ケ\ッ\チ\ \沙\英\ヒ\ロ\ \卒\業\編','Yase\ Yuuki',2013,8.24,'http://img7.anidb.net/pics/anime/142078.jpg','\*\ Based\ on\ a\ 4\-koma\ manga\ by\ http\:\/\/anidb\.net\/cr1530\ \[Aoki\ Ume\]\,\ serialised\ in\ Manga\ Time\ Kirara\ Carat\.\\nhttp\:\/\/anidb\.net\/ch7059\ \[Sae\]\ and\ http\:\/\/anidb\.net\/ch7058\ \[Hiro\]\ take\ their\ final\ exams\ while\ the\ rest\ of\ the\ Hidamari\ Apartment\`s\ residents\ cheer\ them\ on\ and\ prepare\ for\ their\ eventual\ graduation\.');
INSERT INTO animes VALUES(194,'Fullmetal\ Alchemist','\鋼\の\錬\金\術\師\ FULLMETAL\ ALCHEMIST','Mizushima\ Seiji',2003,8.3,'http://img7.anidb.net/pics/anime/156001.jpg','There\ exist\ those\ with\ special\ abilities\ to\ manipulate\ objects\ and\ transform\ them\ into\ other\ objects\ called\ the\ Alchemists\.\ However\,\ this\ manipulation\ process\ comes\ at\ a\ price\,\ since\ the\ basic\ alchemy\ rules\ state\ that\ something\ with\ equivalent\ value\ is\ needed\ to\ perform\ the\ manipulation\.\\nThe\ renowned\ alchemist\ http\:\/\/anidb\.net\/ch5885\ \[Edward\ Elric\]\ loses\ his\ little\ brother\ http\:\/\/anidb\.net\/ch5908\ \[Alphonse\]\ in\ an\ accident\.\ Edward\ manages\ to\ contain\ his\ brother\`s\ soul\ in\ a\ large\ piece\ of\ armour\ suit\,\ but\ by\ doing\ so\ Edward\ loses\ his\ arm\ and\ leg\.\ And\ so\ the\ brothers\ set\ out\ on\ a\ perilous\ journey\ to\ regain\ their\ original\ bodies\.\\nSource\:\ AnimeNfo');
INSERT INTO animes VALUES(195,'Berserk','\剣\風\伝\奇\ベ\ル\セ\ル\ク','Takahashi\ Naohito',1997,8.13,'http://img7.anidb.net/pics/anime/13598.jpg','A\ mysterious\ warrior\ calling\ himself\ The\ Black\ Swordsman\ is\ out\ to\ get\ the\ King\ of\ a\ country\ called\ Midland\.\ As\ he\ battles\ the\ king\`s\ henchmen\,\ their\ cries\ of\ pain\ and\ the\ spilling\ blood\ take\ this\ relentless\ warrior\`s\ mind\ back\ in\ time\ to\ the\ path\ that\ led\ him\ to\ his\ current\ state\.\\nOn\ just\ any\ day\,\ a\ pack\ of\ hooligans\ are\ harassing\ a\ young\ lady\ in\ distress\ when\ all\ of\ a\ sudden\,\ they\`re\ under\ attack\.\ The\ Black\ Swordsman\ has\ returned\.\ He\ wields\ a\ giant\ sword\ as\ large\ as\ his\ grudge\ against\ the\ king\.\ When\ alone\ in\ the\ woods\,\ the\ Black\ Swordsman\ has\ a\ flash\ back\ to\ years\ past\ and\ his\ trials\ and\ tribulations\ in\ the\ Band\ of\ the\ Hawk\,\ a\ successful\ band\ of\ mercenaries\ under\ the\ charismatic\ leadership\ of\ Griffith\,\ a\ man\ driven\ by\ the\ ambition\ to\ become\ king\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(196,'Silver\ Spoon\ Season\ 2','\銀\の\匙\ Silver\ Spoon\ \(2014\)','Deai\ Kotomi',2014,8.12,'http://img7.anidb.net/pics/anime/147663.jpg','Recap\:\ http\:\/\/anidb\.net\/ch55012\ \[Hachiken\ Yuugo\]\ is\ a\ mild\-mannered\ academic\ who\ chooses\ to\ move\ away\ from\ his\ sub\-urban\ lifestyle\ and\ enrol\ at\ the\ Yezo\ Agricultural\ High\ School\ in\ the\ country\ because\ of\ strained\ relations\ with\ his\ family\.\ He\ soon\ finds\ himself\ slowly\ getting\ used\ to\ his\ new\ environment\ with\ a\ short\ learning\ curve\ and\ grows\ into\ an\ empathetic\ and\ compassionate\ individual\ as\ he\ struggles\ to\ understand\ the\ world\ of\ agriculture\ and\ how\ it\ affects\ the\ lives\ of\ his\ new\ friends\.\ \(Source\:\ Wikipedia\)\\nAs\ the\ new\ semester\ begins\ at\ Yezo\ Agricultural\ High\ School\,\ Yuugo\ is\ now\ used\ to\ the\ tough\ lifestyle\ of\ a\ rural\ high\ school\,\ while\ still\ wondering\ what\ he\ will\ do\ in\ the\ future\.\.\.\\nSource\:\ ANN');
INSERT INTO animes VALUES(197,'Fate\/stay\ night\ \[Unlimited\ Blade\ Works\]','Fate\/stay\ night\ \[Unlimited\ Blade\ Works\]','Miura\ Takahiro',2014,8.44,'http://img7.anidb.net/pics/anime/162411.jpg','\*\ Based\ on\ the\ second\ route\ of\ the\ Fate\/Stay\ Night\ erotic\ visual\ novel\ by\ http\:\/\/anidb\.net\/cr927\ \[Type\-Moon\]\.\\nHigh\ school\ junior\ student\ http\:\/\/anidb\.net\/ch1904\ \[Emiya\ Shirou\]\ is\ twice\ an\ orphan\.\ Once\,\ a\ great\ fire\ that\ destroyed\ more\ than\ a\ hundred\ homes\ took\ the\ lives\ of\ his\ biological\ parents\.\ He\ was\ then\ adopted\ by\ http\:\/\/anidb\.net\/ch1919\ \[the\ man\ who\ saved\ him\ from\ that\ inferno\]\,\ a\ man\ who\ called\ himself\ a\ magus\;\ however\,\ after\ a\ few\ years\,\ that\ man\,\ too\,\ died\.\ Shirou\ was\ left\ with\ a\ home\,\ the\ dream\ to\ become\ a\ superhero\,\ and\ some\ extremely\ limited\ knowledge\ of\ magecraft\,\ the\ art\ practised\ in\ secret\ by\ magi\ all\ over\ the\ world\.\ Now\,\ unbeknownst\ to\ him\,\ the\ city\ he\ lives\ in\,\ Fuyuki\ City\,\ is\ to\ become\ the\ place\ where\ a\ great\ war\ will\ be\ fought\ in\ secret\ by\ magi\ like\ the\ man\ who\ adopted\ him\.\\nFor\ this\ great\ war\,\ seven\ magi\ shall\ gather\ together\ in\ Fuyuki\.\ Each\ magus\ becomes\ a\ Master\,\ and\ each\ Master\ summons\ a\ Servant\,\ a\ spirit\ of\ a\ mighty\ hero\ of\ the\ past\ that\,\ due\ to\ their\ almost\ almighty\ powers\ in\ life\ and\ to\ the\ faith\ people\ have\ put\ in\ them\ through\ the\ times\,\ ascend\ to\ a\ higher\ level\ of\ existence\,\ outside\ of\ time\.\ Together\,\ Master\ and\ Servant\ fight\ against\ the\ other\ teams\ for\ the\ possession\ of\ the\ Holy\ Grail\,\ a\ relic\ said\ to\ be\ almighty\ and\ grant\ any\ wish\,\ no\ matter\ how\ great\.\ However\,\ in\ order\ to\ allow\ the\ winning\ Master\ and\ Servant\ to\ be\ granted\ one\ wish\ each\,\ all\ other\ teams\ must\ be\ defeated\,\ and\ the\ enemy\ Servants\ annihilated\.\ That\ war\ is\ thus\ called\ the\ Holy\ Grail\ War\.\ The\ Holy\ Grail\ War\ has\ happened\ four\ times\ so\ far\,\ and\ the\ fifth\ one\ is\ about\ to\ take\ place\.\\nThe\ hero\ each\ Servant\ was\ in\ life\ has\ fame\,\ and\ as\ such\ their\ lives\ are\ well\-known\.\ By\ knowing\ the\ true\ name\ of\ a\ Servant\,\ one\ clearly\ also\ knows\ its\ strengths\ and\ weaknesses\;\ thus\,\ it\ is\ the\ custom\ for\ each\ team\ to\ hide\ the\ identity\ of\ their\ Servant\ and\ try\ to\ find\ out\ those\ of\ the\ other\ ones\.\ To\ better\ hide\ the\ identity\,\ the\ Servants\ are\ usually\ referred\ to\ by\ their\ classes\,\ http\:\/\/anidb\.net\/ch38\ \[Saber\]\,\ http\:\/\/anidb\.net\/ch1906\ \[Archer\]\,\ http\:\/\/anidb\.net\/ch1908\ \[Lancer\]\,\ http\:\/\/anidb\.net\/ch1909\ \[Rider\]\,\ http\:\/\/anidb\.net\/ch1907\ \[Berserker\]\,\ http\:\/\/anidb\.net\/ch1910\ \[Caster\]\,\ and\ http\:\/\/anidb\.net\/ch1911\ \[Assassin\]\.\\nOne\ night\,\ Shirou\ witnesses\ a\ fight\ between\ two\ servants\,\ Archer\ and\ Lancer\.\ To\ preserve\ the\ secrecy\ of\ the\ War\,\ Lancer\ mortally\ wounds\ him\.\ However\,\ a\ girl\ who\ up\ until\ now\ was\ just\ a\ classmate\ of\ his\ and\ the\ school\ idol\,\ http\:\/\/anidb\.net\/ch241\ \[Toosaka\ Rin\]\,\ saves\ his\ life\ by\ pouring\ all\ the\ magical\ energy\ from\ a\ pendant\ into\ fixing\ his\ heart\.\ However\,\ he\ gets\ attacked\ by\ Lancer\ again\,\ and\ this\ time\ Rin\ will\ not\ be\ able\ to\ save\ him\.\ Just\ as\ he\`s\ about\ to\ die\ for\ good\,\ he\ unwittingly\ summons\ Saber\,\ who\ promptly\ drives\ Lancer\ off\.\ The\ powerful\ sword\ user\ turns\ to\ Shirou\ and\ asks\ whether\ he\ is\ her\ Master\,\ much\ to\ his\ bewilderment\.\ In\ spite\ of\ being\ just\ a\ rank\ amateur\,\ he\ now\ has\ to\ fight\ a\ war\ between\ powerful\ and\ experienced\ magi\,\ and\ has\ people\ he\ knows\ turned\ into\ enemies\.\\n\—\ written\ by\ Hinoe\\nNote\:\ Episodes\ 01\ and\ 02\ \(listed\ as\ 00\ and\ 01\)\ premiered\ at\ a\ special\ event\ on\ 28\.09\.2014\,\ each\ episode\ in\ different\ cities\ worldwide\.\ Their\ regular\ airing\ started\ on\ 05\.10\.2014\ and\ 12\.10\.2014\,\ respectively\.');
INSERT INTO animes VALUES(198,'Hajime\ no\ Ippo\:\ The\ Fighting\!\ \-\ Rising','\は\じ\め\の\一\歩\ THE\ FIGHTING\!\ Rising','Shishido\ Jun',2013,8.82,'http://img7.anidb.net/pics/anime/140330.jpg','http\:\/\/anidb\.net\/ch23\ \[Ippo\]\ continues\ to\ defend\ his\ Japanese\ Featherweight\ title\ from\ an\ ever\ stronger\ pool\ of\ challengers\.\ Meanwhile\,\ http\:\/\/anidb\.net\/ch3\ \[Takamura\]\ challenges\ for\ his\ second\ WBC\ title\ in\ the\ middleweight\ class\,\ and\ http\:\/\/anidb\.net\/ch106\ \[Aoki\]\ challenges\ for\ the\ Japanese\ Lightweight\ title\ and\ Coach\ http\:\/\/anidb\.net\/ch61\ \[Kamogawa\]\ and\ http\:\/\/anidb\.net\/ch12790\ \[Nekota\]\ reminisce\ about\ their\ days\ as\ prizefighters\ after\ WWII\.\\nSource\:\ ANN');
